INSERT INTO `prayers` VALUES
(1,'Before a Surgery','surgery1',2,'Peace before the surgery and easy recovery.','O Jesus Christ,\n\nGrant {{name}} joyful acceptance of the surgery which awaits, and let this be the relief and cure which {{gender2}} seeks.\n\nMake skilled the work of the surgeon and that of his team for it is unto their knowledge and skill that {{gender2}} is given for healing.\n\nI pray You, O Lord, that this procedure will be without complication, and that {{gender1}} recovery will be speedy and complete.',1,'O Jesus Christ,\n\nGrant me joyful acceptance of the surgery which awaits, and let this be the relief and cure which I seek.\n\nMake skilled the work of the surgeon and that of his team for it is unto their knowledge and skill that I am given for healing.\n\nI pray You, O Lord, that this procedure will be without complication, and that my recovery will be speedy and complete.','6zpiFJ6J.jpg'),
(2,'After A Surgery','surgery2',2,'Rest, care and healing after a surgery','Blessed Savior, thank you that {{name}}\'s operation is safely past, and now {{gender2}} can rest in your abiding presence, relaxing every tension, releasing every care and anxiety, receiving more and more of your healing life into every part of {{gender1}} being. In moments of pain {{name}} turns to you for strength, in times of loneliness {{gender2}} feels your loving nearness. Grant that your life and love and joy may flow through {{name}} for the healing of others in your name.\n',1,'Blessed Savior, thank you that my operation is safely past, and now I can rest in your abiding presence, relaxing every tension, releasing every care and anxiety, receiving more and more of your healing life into every part of my being. In moments of pain I turn to you for strength, in times of loneliness I feel your loving nearness. Grant that your life and love and joy may flow through me for the healing of others in your name.\n','iJit6EQj.jpg'),
(3,'Healing','healing1',8,'Grant compassion, ability to reach out to God for help, health in body and spirit.','Lord,\n\nYou invite all who are burdened to come to you. Allow Your healing Hand to heal {{name}}. Touch {{name}}\'s soul with Your compassion for others; touch {{gender1}} heart with Your courage and infinite Love for all; touch {{gender1}} mind with Your Wisdom, and may {{gender1}} mouth always proclaim Your praise.\n\nTeach {{name}} to reach out to You in all {{gender1}} needs, and help {{name}} to lead others to You by {{gender1}} example.\n\nMost loving Heart of Jesus, bring {{name}} health in body and spirit that {{gender2}} may serve You with all {{gender1}} strength. Touch gently {{gender1}} life which you have created, now and forever.',1,'Lord,\n\nYou invite all who are burdened to come to you. Allow Your healing Hand to heal me. Touch my soul with Your compassion for others; touch my heart with Your courage and infinite Love for all; touch my mind with Your Wisdom, and may my mouth always proclaim Your praise.\n\nTeach me to reach out to You in all my needs, and help me to lead others to You by example.\n\nMost loving Heart of Jesus, bring me health in body and spirit that I may serve You with all my strength. Touch gently my life which you have created, now and forever.','NyDLzZ7S.jpg'),
(10,'Family','family1',8,'Bring peace, purity and love to family and newborns.','O dear Jesus,\n\nI humbly implore You to grant Your special graces to {{name}}\'s family. May {{gender1}} home be the shrine of peace, purity, love, labor and faith. I beg You, dear Jesus, to protect and bless all of them, absent and present, living and dead.\n\nO Mary, loving Mother of Jesus, and our Mother, pray to Jesus for {{name}}\'s family, for all the families of the world, to guard the cradle of the newborn, the schools of the young and their vocations.\n\nBlessed Saint Joseph, holy guardian of Jesus and Mary, assist {{name}} by your prayers in all the necessities of life. Ask of Jesus that special grace which He granted to you, to watch over {{name}}\'s home at the pillow of the sick and the dying, so that with Mary and with you, heaven may find {{name}}\'s family unbroken in the Sacred Heart of Jesus.',1,'O dear Jesus,\n\nI humbly implore You to grant Your special graces to my family. May my home be the shrine of peace, purity, love, labor and faith. I beg You, dear Jesus, to protect and bless all of them, absent and present, living and dead.\n\nO Mary, loving Mother of Jesus, and our Mother, pray to Jesus for my family, for all the families of the world, to guard the cradle of the newborn, the schools of the young and their vocations.\n\nBlessed Saint Joseph, holy guardian of Jesus and Mary, assist me by your prayers in all the necessities of life. Ask of Jesus that special grace which He granted to you, to watch over my home at the pillow of the sick and the dying, so that with Mary and with you, heaven may find my family unbroken in the Sacred Heart of Jesus.','1GgeHBF3.jpg'),
(11,'General Prayer','general1',8,'Empower and strengthen our daily journey.','Loving Father, shine Your radiant light on {{name}}, renew {{gender1}} strength, and empower {{gender3}} with virtues needed to face the challenges of daily life.\n\nAnoint {{gender3}} with Your wisdom for every circumstance & experience.\n\nAlways lead {{gender3}} to the best decisions & the best paths as {{gender2}} journeys with You today.',1,'Loving Father, shine Your radiant light on me, renew my strength, and empower me with virtues needed to face the challenges of daily life.\n\nAnoint me with Your wisdom for every circumstance & experience.\n\nAlways lead me to the best decisions & the best paths as I journey with You today.','jl8ZDVf3.jpg'),
(12,'Animal Friends','pet1',4,'Heal suffering from our animal and pet companions.','Heavenly Father, our human ties with our friends of other species is wonderful and special gift from You. I now ask You to grant {{name}}\'s special animal companion your Fatherly care and healing power to take away any suffering they have. \n\nGive {{name}}, their human companion, new understanding of {{gender1}} responsibilities to these creatures of Yours. They have trust in {{name}} as {{gender2}} has in You; their souls and theirs are on this earth together to give one another friendship, affection, and caring. \n\nTake my heartfelt prayers and fill {{name}}\'s ill or suffering animal with healing Light and strength to overcome whatever weakness of body they have.',1,'Heavenly Father, our human ties with our friends of other species is wonderful and special gift from You. I now ask You to grant my special animal companions your Fatherly care and healing power to take away any suffering they have. \n\nGive me, their human companion, new understanding of my responsibilities to these creatures of Yours. They have trust in me as I have in You; our souls and theirs are on this earth together to give one another friendship, affection, and caring. \n\nTake my heartfelt prayers and fill my ill or suffering animal with healing Light and strength to overcome whatever weakness of body they have.','JW7CDLe9.jpg'),
(13,'Soulmate Prayer','love1',8,'Find a wife/husband/soulmate with pure heart and clear intentions.','Please fill {{name}} with your sacred presence; {{gender2}} asks for your Love and Guidance and for your blessings. As {{gender2}} explores the deep reaches of {{gender1}} heart, {{gender2}} asks for you assistance.\n\nIn releasing that which stands in the way of true love, {{name}}\'s heart is pure; {{gender1}} intentions clear. Please bring to {{name}} {{gender1}} most perfect partner.\n\nHelp {{name}} to seek a partner who enhances {{gender1}} life by their very being, who brings more love, joy, peace and prosperity to {{gender1}} life, who {{gender2}} can love fully and who can fully receive {{gender1}} love, who loves, honors and cherishes {{name}} completely, and always.\n\nMay {{name}}\'s heart be open and {{gender1}} head be clear. May {{gender1}} life be ready to welcome True love. May {{name}} be embraced in a circle of your love and uplifted by your grace.',1,'Please fill me with your sacred presence. I ask for your Love and Guidance and for your blessings. As I explores the deep reaches of my heart, I ask for you assistance.\n\nIn releasing that which stands in the way of true love. My heart is pure; my intentions clear. Please bring to me my most perfect partner.\n\nI seek a partner who enhances my life by their very being, who brings more love, joy, peace and prosperity to my life, who I can love fully and who can fully receive my love, who loves, honors and cherishes me completely, and always.\n\nMay my heart be open and my head be clear. May my life be ready to welcome True love. May I be embraced in a circle of your love and uplifted by your grace.','hYTp0bhK.jpg'),
(14,'Parents to Homeschool','children1',3,'Have necessary materials, clear communication and paitence.','Father, for {{name}} who have chosen to homeschool, or have not been given the choice by their school districts, we pray that {{gender2}} will rest in {{gender1}} circumstances and trust you completely with the outcome. \n\nWe pray for divine assistance in every area: that {{name}} has necessary materials and good internet; that {{name}} has the time and the energy to help their children as they need; that {{name}} has the discernment to know when to help a child with their work and when to leave them alone; that {{name}} has clear communication when explaining concepts or helping a child with their work; that {{name}} has time and energy to devote to their own work, and be able to honor {{gender1}} commitments to their employers while also helping {{gender1}} children; that husbands and wives would shoulder this work as a partnership, each honoring and appreciating the other; that you would offer special provision for single parents shouldering their children’s home education alone.',1,'Father, for those who have chosen to homeschool, or have not been given the choice by their school districts, we pray that we will rest in our circumstances and trust you completely with the outcome. \n\nWe pray for divine assistance in every area: that I have necessary materials and good internet; that I have the time and the energy to help their children as they need; that I have the discernment to know when to help a child with their work and when to leave them alone; that I have clear communication when explaining concepts or helping a child with their work; that I have time and energy to devote to their own work, and be able to honor my commitments to my employers while also helping my children; that husbands and wives would shoulder this work as a partnership, each honoring and appreciating the other; that you would offer special provision for single parents shouldering their children’s home education alone.','XyZPSqTC.jpg'),
(15,'Hope','hope1',8,'Help when feeling helpless, hope for love, kindness and a positive outlook.','Heavenly father, {{name}} is your humble servant, {{name}} comes before you today in need of hope. There are times when {{name}} feels helpless, There are times when {{name}} feels weak. I pray for hope.\n\n{{name}} needs hope for a better future. {{name}} needs hope for a better life. {{name}} needs hope for love and kindness. Some say that the sky is at it\'s darkest just before the light. I pray that this is true, for all seems dark.\n\n{{name}} needs your light, Lord, in every way. I pray that {{name}} is filled with your light from head to toe. To bask in your glory. To know that all is right in the world, as you have planned, and as you want it to be.\n\nHelp {{name}} to walk in your light, and live {{gender1}} life in faith and glory. In your name I pray.',1,'Heavenly father, I am your humble servant, I come before you today in need of hope. There are times when I feel helpless, There are times when I feel weak. I pray for hope.\n\nI need hope for a better future. I need hope for a better life. I need hope for love and kindness. Some say that the sky is at it\'s darkest just before the light. I pray that this is true, for all seems dark.\n\nI needs your light, Lord, in every way. I pray that I am filled with your light from head to toe. To bask in your glory. To know that all is right in the world, as you have planned, and as you want it to be.\n\nHelp me to walk in your light, and live my life in faith and glory. In your name I pray.','aaW8OnvI.jpg'),
(16,'Inspirational Prayer','inspiration1',8,'Do not worry about what may come; trust in the Lord.','Allow {{name}} to not look forward to what may happen tomorrow; the same everlasting Father who cares for {{gender3}} today will take care of {{gender3}} tomorrow and every day. \n\nEither He will shield {{name}} from suffering, or He will give {{gender3}} unfailing strength to bear it. Allow {{name}} to be at peace, then. Put aside all anxious thoughts and imaginations, and say continually:\n\nThe Lord is my strength and my shield. My heart has trusted in Him and I am helped. He is not only with me but in me, and I in Him.',1,'Help me to not look forward to what may happen tomorrow; the same everlasting Father who cares for me today will take care of me tomorrow and every day. \n\nEither He will shield me from suffering, or He will give me unfailing strength to bear it. Allow me to be at peace, then. Put aside all anxious thoughts and imaginations, and say continually:\n\nThe Lord is my strength and my shield. My heart has trusted in Him and I am helped. He is not only with me but in me, and I in Him.','MWCE9CCn.jpg'),
(17,'Marriage','marriage1',11,'Gratitude for healthy marriage, continued support in this Hoy unity.','Heavenly Father, {{name}} comes before you to thank you for all you have done and continue to do in {{gender1}} life and marriage. Lord, {{name}} comes before you on this day, Father, asking for a stronger bond of unity in {{gender1}} marriage covenant.\n\nLord, I pray that you will give {{name}} the power to be a united front for you. Letting nothing come between them.\n\nAssist {{name}}, God, to identify and work through everything that is not pleasing to you. So they can continually attain higher levels of unity in {{gender1}} marriage spiritually, physically, and mentally.\n\nFather, {{name}} is thankful and happy to see the work of your hands. As {{name}} tries {{gender1}} best to find your grace daily. We love you and thank you for all of these things.',1,'Heavenly Father, I come before you to thank you for all you have done and continue to do in my life and marriage. Lord, I come before you on this day, Father, asking for a stronger bond of unity in my marriage covenant.\n\nLord, I pray that you will give me the power to be a united front for you. Letting nothing come between them.\n\nAssist me, God, to identify and work through everything that is not pleasing to you. So they can continually attain higher levels of unity in my marriage spiritually, physically, and mentally.\n\nFather, I am thankful and happy to see the work of your hands. As I try to find your grace daily. We love you and thank you for all of these things.','uQaFhVvw.jpg'),
(18,'Safe Travels via Plane','travel1',12,'Pray for the pilot of the plane to grant presence of mind.','I’m praying for the safe travel of {{name}}, please guide & protect {{gender3}} that {{gender2}} may reach {{gender1}} destination safe. I’m praying also for the pilot of the plane – give presence of mind that he may able to do his duty and responsibilities for their safety as they travel. In Jesus name I pray.',1,'I’m praying for safe travel, please guide & protect me that I may reach my destination safe. I’m praying also for the pilot of the plane – give presence of mind that he may able to do his duty and responsibilities for their safety as they travel. In Jesus name I pray.','3anYTC5w.jpg'),
(19,'Strength','strength1',13,'Supply all needs, grant strength and passion.','Lord, my Rock and Redeemer, thank you that you are great and abundant in power, your strength is beyond measure. \n\nYou are able to bless {{name}} abundantly, so that in all things at all times, You will supply everything {{name}} needs, and {{gender2}} will abound in every good work. \n\nGive {{name}} the strength that {{gender2}} needs today Lord, may {{name}} thrive in the power of your spirit. May your love be the passion in {{gender1}} heart. \n\nMay your joy be {{gender1}} strength when times are hard. May your presence be {{gender1}} peace that overflows. Through Jesus Christ, our Lord.',1,'Lord, my Rock and Redeemer, thank you that you are great and abundant in power, your strength is beyond measure. \n\nYou are able to bless me abundantly, so that in all things at all times, You will supply everything my needs, and I will abound in every good work. \n\nGive me strength I need today Lord, may I thrive in the power of your spirit. May your love be the passion in my heart. \n\nMay your joy be my strength when times are hard. May your presence be my peace that overflows. Through Jesus Christ, our Lord.','zmk1hWHw.jpg'),
(20,'Inner Peace','peace1',14,'Bring peace to the worried, anxious, depressed and troubled.','Lord, please put Your peace in {{name}}\'s heart. {{gender2}} is worried and anxious. {{gender1}} mind races and obsesses. {{gender2}} can\'t help thinking about {{gender1}} problems. And the more {{gender2}} thinks about them, the more depressed {{gender2}} becomes. {{name}} feels like {{gender2}} is sinking down in quicksand and can\'t get out. Calm {{name}}, Lord. Slow {{gender3}} down, put Your peace in {{gender1}} heart.\n\nNo matter what problem {{name}} has, Lord, You are bigger, You are more powerful than it is. So {{name}} brings {{gender1}} problem to You. {{name}} knows what {{gender2}} wants. {{gender2}} knows {{gender1}} will. {{gender2}} does not know Yours. {{name}} does not know how You will use this problem for {{gender1}} salvation. {{gender2}} does not know what good You will work out from this evil.\n\nBut {{name}} trusts You. {{gender2}} trusts Your goodness and Your wisdom. So {{gender2}} places {{gender3}}self in Your hands. Please fill {{gender1}} heart with peace.',1,'Lord, please put Your peace in my heart. I\'m worried and anxious. My mind races and obsesses. I can\'t help thinking about my problems. And the more I think about them, the more depressed I become. I feel like I am sinking down in quicksand and can\'t get out. Calm me, Lord. Slow me down, put Your peace in my heart.\n\nNo matter what problem I have, Lord, You are bigger, You are more powerful than it is. So I bring my problem to You. I know what I want. I know my will. I do not know Yours. I do not know how You will use this problem for my salvation. I do not know what good You will workout from this evil.\n\nBut I trust You. I trust Your goodness and Your wisdom. So I place myself in Your hands. Please fill my heart with peace..','b5jNQzZo.jpg'),
(21,'Government Leader','leaders1',8,'Give counsel to our government leaders for the United States.','God of power and might, wisdom and justice, through you authority is rightly administered, laws are enacted, and judgment is decreed.\n\nAssist with your spirit of counsel and fortitude the President and other government leaders of these United States. May they always seek the ways of righteousness, justice and mercy.\n\nGrant that they may be enabled by your powerful protection to lead our country with honesty and integrity. We ask this through Christ our Lord.',1,'God of power and might, wisdom and justice, through you authority is rightly administered, laws are enacted, and judgment is decreed.\n\nAssist with your spirit of counsel and fortitude the President and other government leaders of these United States. May they always seek the ways of righteousness, justice and mercy.\n\nGrant that they may be enabled by your powerful protection to lead our country with honesty and integrity. We ask this through Christ our Lord.','KqL5YKd3.jpg'),
(22,'Financial Blessing','finances1',8,'Take care over finances and gratefulness for financial blessings.','Righteous God, help {{name}} to diligently obey Your voice, and to observe carefully all Your commandments which You command today so that {{name}} may be set high above all nations of the earth. \n\n{{name}} praises You in advance for the financial blessings that shall come upon {{gender3}} and overtake {{gender3}} because {{gender2}} has obeyed Your voice, Lord. See {{name}}\'s heart, see {{gender1}} faithfulness Father and please bless {{gender3}} as Your servant. Keep Your hand upon every aspect of {{gender1}} life, including {{gender1}} finances.',1,'Righteous God, help me to diligently obey Your voice, and to observe carefully all Your commandments which You command today so that I may be set high above all nations of the earth. \n\nI praise You in advance for the financial blessings that shall come upon me and overtake me because I have obeyed Your voice, Lord. See my heart, see my faithfulness Father and please bless me as Your servant. Keep Your hand upon every aspect of my life, including my finances.','iDw6KgLy.jpg'),
(23,'Salvation','salvation1',17,'Treasure the soul and grant eternal salvation.','Precious Blood and Word of God, You are {{name}}\'s eternal salvation. Lost in sin, You liberated {{gender3}}. You lifted {{name}} from perdition. Treasuring {{gender1}} feeble soul, You excused {{gender1}} constant frailties. Forever, {{name}} is indebted to You. Your cost can never be repaid, For You bought {{name}}\'s freedom with Blood. I ask that {{name}} will always seek You out my Lord, You are {{gender1}} beloved Deliverer! You are the Lamb of God!',1,'Precious Blood and Word of God, You are my eternal salvation. Lost in sin, You liberated me. You lifted me from perdition. Treasuring my feeble soul, You excused my constant frailties. Forever, I am indebted to You. Your cost can never be repaid, For You bought my freedom with Blood. I ask that you will always seek You out my Lord, You are my beloved Deliverer! You are the Lamb of God!','pGpQ7etp.jpg'),
(24,'Emotional Healing','emotions1',8,'Healing for feelings of sadness, loneliness, fear and anxiety.','Loving Father, {{name}} comes before you with faith in your promise that whatever {{gender2}} asks for in your name you will grant to {{gender3}} if it is for the good of {{gender1}} soul and in accordance with your Divine Will.\n\nHelp {{gender3}} to come trusting in your great love for {{gender3}} and believing that only you know what is best for {{gender3}}. {{name}} comes to you now to ask that you enter {{gender1}} heart and heal all {{gender1}} wounded emotions.\n\nYou know {{gender3}} better than {{gender2}} knows {{gender3}}self. Bring your healing love into every corner of {{gender3}} heart and release all the buried negative emotions inside that have not been resolved and continue to cause {{gender3}} pain and anguish.\n\nRemove all {{gender3}} unhealed hurts and painful memories that block the flow of your graces, robbing {{gender3}} of your peace, love and joy.\n\nHeal all feeling of sadness, loneliness, fear and anxiety.\nHeal all guilt, despair, feelings of betrayal and rejection.\nHeal all feelings of anger, hatred, resentment and bitterness.\n\nBring your healing love to all emotions that have caused {{gender3}} feelings of hopelessness, discouragement, helplessness and despair. Grant {{gender3}} the grace to forgive all those who caused these negative emotions and likewise to be forgiven by those to whom {{gender2}} has done the same harm.\n\nAnd then, dear Father, after {{name}} has been healed may {{gender2}} be a witness of your healing power and bring glory, honor and praise to you.\n\nThis I pray in Jesus\' name through Mary and all the saints.',1,'Loving Father, I come before you with faith in your promise that whatever I asks for in your name you will grant to me if it is for the good of my soul and in accordance with your Divine Will.\n\nI come trusting in your great love for me and believing that only you know what is best for me. I come to you now to ask that you enter my heart and heal all my wounded emotions.\n\nYou know me better than I know myself. Bring your healing love into every corner of my heart and release all the buried negative emotions inside that have not been resolved and continue to cause me pain and anguish.\n\nRemove all my unhealed hurts and painful memories that block the flow of your graces, robbing me of your peace, love and joy.\n\nHeal all feeling of sadness, loneliness, fear and anxiety.\nHeal all guilt, despair, feelings of betrayal and rejection.\nHeal all feelings of anger, hatred, resentment and bitterness.\n\nBring your healing love to all my emotions that have caused me feelings of hopelessness, discouragement, helplessness and despair. Grant me the grace to forgive all those who caused these negative emotions and likewise to be forgiven by those to whom I have done the same harm.\n\nAnd then, dear Father, after I have been healed may I be a witness of your healing power and bring glory, honor and praise to you.\n\nThis I pray in Jesus\' name through Mary and all the saints.','ekBuM2p4.jpg'),
(25,'Modesty and Pure Thoughts','sexual1',8,'Sexual conduct and protection against lust.','Jesus, Lover of chastity, Mary, Mother most pure, and Joseph, chaste guardian of the Virgin, to you {{name}} comes at this hour, begging you to plead with God for {{gender3}}. {{name}} earnestly wishes to be pure in thought, word and deed in imitation of your own holy purity.\n\nObtain for {{name}}, then, a deep sense of modesty which will be reflected in {{gender1}} external conduct. Protect {{gender1}} eyes, the windows of {{gender1}} soul, from anything that might dim the luster of a heart that must mirror only Christ-like purity.\n\nAnd when {{name}} receives Holy Communion, seal {{gender1}} heart forever against the suggestions of sinful pleasures. Heart of Jesus, Fount of all purity, have mercy on {{name}}.',1,'Jesus, Lover of chastity, Mary, Mother most pure, and Joseph, chaste guardian of the Virgin, to you I come at this hour, begging you to plead with God for me. I earnestly wish to be pure in thought, word and deed in imitation of your own holy purity.\n\nObtain for me, then, a deep sense of modesty which will be reflected in my external conduct. Protect my eyes, the windows of my soul, from anything that might dim the luster of a heart that must mirror only Christ-like purity.\n\nAnd when I receive Holy Communion, seal my heart forever against the suggestions of sinful pleasures. Heart of Jesus, Fount of all purity, have mercy on me.','IJzE0YYA.jpg'),
(26,'Addiction to Drugs','drugs1',8,'freedom from the addition to drugs','God of life, You made {{name}} in Your perfect image, to live in Your love and to give You glory, honor and praise. Open {{gender1}} heart to Your healing power. Come, Lord Jesus, calm {{gender1}} soul just as you whispered Peace to the stormy sea.\n\nSt. Jude, most holy Apostle, in {{gender1}} need {{name}} reaches out to you. I beg you to intercede for {{name}} that {{gender2}} may find strength to overcome {{gender1}} illness. Bless all those who struggle with addiction. Touch them, heal them, reassure them of the Father\'s constant love.\n\nRemain at {{name}}\'s side, St. Jude, to chase away all evil temptations, fears, and doubts. May the quiet assurance of your loving presence illuminate the darkness in {{gender1}} heart and bring lasting peace.',1,'God of life, You made me in Your perfect image, to live in Your love and to give You glory, honor and praise. Open my heart to Your healing power. Come, Lord Jesus, calm my soul just as you whispered Peace to the stormy sea.\n\nSt. Jude, most holy Apostle, in my need I reach out to you. I beg you to intercede for me that I may find strength to overcome my illness. Bless all those who struggle with addiction. Touch them, heal them, reassure them of the Father\'s constant love.\n\nRemain at my side, St. Jude, to chase away all evil temptations, fears, and doubts. May the quiet assurance of your loving presence illuminate the darkness in my heart and bring lasting peace.','drugs-svgrepo-com.svg'),
(27,'Suicide','suicide1',21,'GIve hope to despair, value to worth and fulfillment to suffering.','God our Creator, you give breath to each person you made, especially {{name}}. You treasure the gifts of each unique person. But when life becomes a burden rather than a gift, God of life, hold {{name}}.\n\nWhen darkness strangles the will to live, when days become endless nights, God of light, shine on {{name}}. When no one seems to understand, when {{gender2}} walks and waits alone, God of love, embrace {{name}} with your presence.\n\nWhere there is despair, bring hope; where there is shame, give value and worth; where there is emptiness, bring fulfillment; where there is suffering in mind and body, bring healing. God of hope, hear our prayer for life.',1,'God our Creator, you give breath to each person you made. You treasure the gifts of each unique person. But when life becomes a burden rather than a gift, God of life, hold me.\n\nWhen darkness strangles the will to live, when days become endless nights, God of light, shine on me. When no one seems to understand, when I walk and wait alone, God of love, embrace me with your presence.\n\nWhere there is despair, bring hope; where there is shame, give value and worth; where there is emptiness, bring fulfillment; where there is suffering in mind and body, bring healing. God of hope, hear our prayer for life.','n4iRBV3r.jpg'),
(28,'Baby Lives','life1',8,'Adoration of all creatures, especially baby lives','Father and maker of all, you adorn all creation with splendor and beauty, and fashion human lives in your image and likeness, especially {{name}}\'s baby.\n\nAwaken in every heart reverence for the work of your hands, and renew among your people a readiness to nurture and sustain your precious gift of life.\n',1,'Father and maker of all, you adorn all creation with splendor and beauty, and fashion human lives in your image and likeness, especially my baby.\n\nAwaken in every heart reverence for the work of your hands, and renew among your people a readiness to nurture and sustain your precious gift of life.\n','x5GLz7yu.jpg'),
(37,'You decide for me!','youdecide',8,'We will pick the prayer that best meets your needs!',NULL,1,NULL,'NAVFiuKD.jpg'),
(39,'Difficult Times','newPrayerName38',8,'Help during difficult and challenging times, bringing peace and strength every day.','Heavenly Father,\n\nThank You for all You\'ve been doing for {{name}}. Father, You know everything happening in {{gender1}} life right now. God, this is all too much for {{gender3}} and {{gender2}} can\'t do this on {{gender1}} own. Please forgive {{gender3}} for worrying so much about {{gender1}} problems and letting {{gender1}} faith fade.\n\nRight now, {{name}} casts all {{gender1}} problems onto you, {{gender2}} gives you all of {{gender1}} stress, {{gender2}} gives you all of {{gender1}} burdens. Please take them from {{name}} and grant {{gender3}} with inner peace and serenity. Comfort {{name}}\'s heart, give {{gender3}} the strength to pull through each day. Help {{name}} not to be discouraged but rather, help {{gender3}} to grow in faith and trust in Your timing.\n\nThank you, Father, for listening to my prayer. In Jesus\' name, I have prayed.',1,'Heavenly Father,\n\nThank You for all You\'ve been doing for me. Father, You know everything happening in my life right now. God, this is all too much for me and I can\'t do this on my own. Please forgive me for worrying so much about my problems and letting my faith fade.\n\nRight now, I cast all my problems onto you. I give you all of my stress. I give you all of my burdens. Please take them from me and grant me with inner peace and serenity. Comfort my heart, give me the strength to pull through each day. Help me not to be discouraged but rather, help me to grow in faith and trust in Your timing.\n\nThank you, Father, for listening to my prayer. In Jesus\' name, I have prayed.','mZrymany.jpg'),
(43,'Food','newPrayer',NULL,'Thankfulness for our food.','Our dear Heavenly Father, I thank you for {{name}}\'s food. Feed {{gender1}} soul on the bread of life and help {{gender3}} to do {{gender1}} part in kind words and loving deeds. I ask in Jesus\' name.',1,'Our dear Heavenly Father, I thank you for this food. Feed my soul on the bread of life and help me to do my part in kind words and loving deeds. I ask in Jesus\' name.','aG6v4cKC.jpg'),
(44,'Combat the Coronavirus Pandemic','newPrayer',NULL,'Help doctors, scientists, caregivers to heal all those impacted by COVID19.','Most Merciful and Triune God, we come to You in our weakness. We come to You in our fear. We come to You with trust. For You alone are our hope. We place before You the disease present in our world. We turn to You in our time of need.\n\nBring wisdom to doctors. Give understanding to scientists. Endow caregivers with compassion and generosity. Bring healing to those who are ill, especially {{name}}. Protect those who are most at risk. Give comfort to those who have lost a loved one. Welcome those who have died into Your Eternal Home.\n\nStabilize our communities. Unite us in our compassion. Remove all fear from our hearts. Fill us with confidence in Your care.',1,'Most Merciful and Triune God, we come to You in our weakness. We come to You in our fear. We come to You with trust. For You alone are our hope. We place before You the disease present in our world. We turn to You in our time of need.\n\nBring wisdom to doctors. Give understanding to scientists. Endow caregivers with compassion and generosity. Bring healing to those who are ill, especially me. Protect those who are most at risk. Give comfort to those who have lost a loved one. Welcome those who have died into Your Eternal Home.\n\nStabilize our communities. Unite us in our compassion. Remove all fear from our hearts. Fill us with confidence in Your care.','GrrwOg8f.jpg'),
(45,'Blessing for COVID Defense','newPrayer',NULL,'Medical professionals, caregivers, and researchers','God, as more people get sick, healthcare workers and first responders are working longer hours with fewer supplies and with more risk of contracting the coronavirus themselves. Renew their energy and sustain them on long shifts. Bring Your protection upon them as they work with patients. Multiply their supplies so they have the protective items needed to stay safe on the job.\n\nInspire and invigorate the research doctors developing better tests to diagnose the virus, create vaccines to prevent it, and identify protocols to eliminate the disease’s spread.',1,'God, as more people get sick, healthcare workers and first responders are working longer hours with fewer supplies and with more risk of contracting the coronavirus themselves. Renew their energy and sustain them on long shifts. Bring Your protection upon them as they work with patients. Multiply their supplies so they have the protective items needed to stay safe on the job.\n\nInspire and invigorate the research doctors developing better tests to diagnose the virus, create vaccines to prevent it, and identify protocols to eliminate the disease’s spread.','lGGFOvvv.jpg'),
(46,'Leadership about COVID19','newPrayer',NULL,'Leaders making decisions about COVID','Father, we seek Your wisdom daily. Be with people making decisions that affect the lives and futures of our families, communities, countries, and the wider world. We pray that they communicate clearly, truthfully, and calmly — with each other and with the public — and that their messages are received and heeded. May truth and empathy be the touchstones of people setting policies for our protection.',1,'Father, we seek Your wisdom daily. Be with people making decisions that affect the lives and futures of our families, communities, countries, and the wider world. We pray that they communicate clearly, truthfully, and calmly — with each other and with the public — and that their messages are received and heeded. May truth and empathy be the touchstones of people setting policies for our protection.','5YTltktR.jpg'),
(47,'September 11','newPrayer',NULL,'Bless those who lost their lives during the September 11, 2001 attack.','Lord Jesus Christ our God, twenty one years ago, in a dark hour for our beloved country of America, at a time of fear and turmoil, we turned to you for strength, understanding, and guidance. And again today, we ask you to hear our prayers..\n\nRemember the souls of all those who perished in the terrible calamities of September 11, 2001, in New York, Washington, and Pennsylvania. Receive them into the peace of your heavenly kingdom, and never cease to console their loved ones, who will always look back with grief upon their losses.\n\nBless, too, those who lost their lives or their loved ones in the two decades since that dreadful day. Tragically, casualties of injury, death, and misery have continued up to the present, and we pray fervently for an end to violence everywhere, and the establishment of your peace among humankind.',1,'Lord Jesus Christ our God, twenty one years ago, in a dark hour for our beloved country of America, at a time of fear and turmoil, we turned to you for strength, understanding, and guidance. And again today, we ask you to hear our prayers..\n\nRemember the souls of all those who perished in the terrible calamities of September 11, 2001, in New York, Washington, and Pennsylvania. Receive them into the peace of your heavenly kingdom, and never cease to console their loved ones, who will always look back with grief upon their losses.\n\nBless, too, those who lost their lives or their loved ones in the two decades since that dreadful day. Tragically, casualties of injury, death, and misery have continued up to the present, and we pray fervently for an end to violence everywhere, and the establishment of your peace among humankind.','y5yycgAs.jpg'),
(48,'Safe Travels General','newPrayer',NULL,'General prayer for safe travels.','O Almighty and merciful God, who has commissioned your angels to guide and protect us, may they be {{name}}\'s companions from {{gender1}} setting out until {{gender1}}  return. Clothe {{name}} with their invisible protection; keep from {{gender3}}  all danger of collision, of fire, of explosion, of falling; and finally, having preserved {{name}} from all evil, and especially from sin, guide {{name}} to {{gender1}} heavenly home. Be with {{name}} now as {{gender2}} travels and guard {{gender3}} every mile of {{gender1}} journey. Help {{gender3}} to be attentive, cautious and concerned about {{gender1}} fellow travelers. Make {{gender1}}  highways, skies and seas safe and keep us all from danger. Sacred Heart of Jesus, guide {{name}} to {{gender1}} destination and help {{gender3}} to travel prayerfully and carefully.',1,'O Almighty and merciful God, who has commissioned your angels to guide and protect us, may they be my companions from my setting out until I return. Clothe me with their invisible protection; keep from me  all danger of collision, of fire, of explosion, of falling; and finally, having preserved me from all evil, and especially from sin, guide me to my heavenly home. Be with me now as I travel and guard me every mile of my journey. Help me to be attentive, cautious and concerned about my fellow travelers. Make my highways, skies and seas safe and keep me from danger. Sacred Heart of Jesus, guide me to my destination and help me to travel prayerfully and carefully.\n','cPfuamSU.jpg'),
(51,'Good Night Sleep','newPrayer',NULL,'Bless us while we sleep.','Bless {{name}} as {{gender2}} rests. Restore {{gender3}} as {{gender2}} sleeps. Care for {{name}} as {{gender2}} drifts off. And make {{gender1}} dreaming sweet.\n\nYou are the safest place. You are the God of Grace. Forgiven, loved and held by you. Is each small seed of faith.\n\nYou know {{name}}\'s thoughts and feelings. You see {{gender1}} deep desires. You understand {{gender1}} weariness. And catch each tear {{gender2}} cries.\n\nYou walk beside {{name}} every day. You are a constant friend. You stay with {{name}} all through the night. On you {{gender2}} can depend.',1,'Bless me as I rest. Restore me as I sleep. Care for me as I drift off. And make me dream sweet.\n\nYou are the safest place. You are the God of Grace. Forgiven, loved and held by you. Is each small seed of faith.\n\nYou know my thoughts and feelings. You see my deep desires. You understand my weariness. And catch each tear I cry.\n\nYou walk beside me every day. You are a constant friend. You stay with me all through the night. On you I can depend.','kB3FHBM8.jpg'),
(53,'Vocations','newPrayer',NULL,'Help the church to recruit priests.','Almighty and eternal God, in your unfailing love you provide ministers for your Church. We pray for those whom you call to serve the Church as priests. Inspire in them a generous response. Grant them courage and vision to serve your people. May their lives and service call your people to respond to the presence of your Spirit among us that, faithful to the Gospel and hope of Jesus the Christ, we may announce glad tidings to the poor, proclaim liberty to captives, set prisoners free and renew the face of the earth.',1,'Almighty and eternal God, in your unfailing love you provide ministers for your Church. We pray for those whom you call to serve the Church as priests. Inspire in them a generous response. Grant them courage and vision to serve your people. May their lives and service call your people to respond to the presence of your Spirit among us that, faithful to the Gospel and hope of Jesus the Christ, we may announce glad tidings to the poor, proclaim liberty to captives, set prisoners free and renew the face of the earth.','RmLeFrix.jpg'),
(54,'Christ the King Novena','newPrayer',NULL,'Let\'s pray that God will reign in our hearts, and that we will love Him above all things.','Christ, our Savior and our King, renew in {{name}} allegiance to Your Kingship. I pray for {{name}} to have the grace to place You above the powers of this world in all things. I pray for {{name}} to have the grace to obey You before any civic authority. I pray for {{name}} to have the grace to fervently bring about Your Kingdom in my family and community.\n\nI pray that You will reign in {{gender1}} life. I pray that You will reign in {{gender1}} heart. O Prince of Peace, may Your reign be complete in {{name}}\'s life and in the life of the world. Christ, my King, please answer these petitions if they be in accordance with Your Holy Will.\n\nAs I reflect on Your second, glorious coming and the judgment of all mankind, I beg You to show {{name}} mercy and give {{gender3}} the grace to become a great saint. I pray that not only will {{gender2}}  spend eternity with You but that You may use {{gender3}} – a sinner – to bring others into Your Kingdom for Your glory.\n\nChrist the King, Your Kingdom come!',1,'Christ, our Savior and our King, renew in me allegiance to Your Kingship. I pray to have the grace to place You above the powers of this world in all things. I pray to have the grace to obey You before any civic authority. I pray to have the grace to fervently bring about Your Kingdom in my family and community.\n\nI pray that You will reign in my life. I pray that You will reign in my heart. O Prince of Peace, may Your reign be complete in my life and in the life of the world. Christ, my King, please answer these petitions if they be in accordance with Your Holy Will.\n\nAs I reflect on Your second, glorious coming and the judgment of all mankind, I beg You to show me mercy and give me the grace to become a great saint. I pray that not only will I spend eternity with You but that You may use me – a sinner – to bring others into Your Kingdom for Your glory.\n\nChrist the King, Your Kingdom come!','y0g4h9pM.jpg'),
(55,'Children in School','newPrayer',NULL,'Prayer for Child’s Success in School','God of abundance, we pray that You would pour out grace on {{name}} at school. May {{gender2}} experience success in every way. May {{gender2}} pay attention in his classes and receive excellent scores. May {{gender2}} employ good social skills and be liked and sought after by {{gender1}} classmates. May {{gender2}} be obedient to the school guidelines and have exemplary behavior. May {{gender2}} shine in sports and extracurricular activities.',1,'God of abundance, we pray that You would pour out grace on my children at school. May they experience success in every way. May they pay attention in his classes and receive excellent scores. May they employ good social skills and be liked and sought after by their classmates. May they be obedient to the school guidelines and have exemplary behavior. May they shine in sports and extracurricular activities.','ezBWTnnW.jpg'),
(56,'Gratitude','newPrayer',NULL,'Prayer For Gratitude','Thank you, Lord, for the blessings you have bestowed on {{name}}\'s life. You have provided {{gender1}} with more than {{gender2}} could ever have imagined. You have surrounded {{name}} with people who always look out for {{gender3}}. You have given {{gender1}} family and friends who bless {{gender1}} every day with kind words and actions. They lift {{gender1}} up in ways that keep {{gender1}} eyes focused on You and make {{gender1}} spirit soar.',1,'Thank you, Lord, for the blessings you have bestowed on my life. You have provided me with more than I could ever have imagined. You have surrounded me with people who always look out for me. You have given me family and friends who bless me every day with kind words and actions. They lift me up in ways that keep my eyes focused on you and make my spirit soar.','er40WeJ0.jpg'),
(57,'Serenity','newPrayer',NULL,'Prayer For Serenity.','God, grant {{name}} the serenity to accept the things {{gender2}} cannot change, the courage to change the things {{gender2}} can, and the wisdom to know the difference.\n\nLiving one day at a time, enjoying one moment at a time; accepting hardship as a pathway to peace; taking, as Jesus did, this sinful world as it is; trusting that You will make all things right if {{gender2}} surrender to Your will; so that {{gender2}} may be reasonably happy in this life and supremely happy with You forever in the next.',1,'God, grant me the serenity to accept the things I cannot change, the courage to change the things I can, and the wisdom to know the difference.\n\nLiving one day at a time, enjoying one moment at a time; accepting hardship as a pathway to peace; taking, as Jesus did, this sinful world as it is; trusting that You will make all things right if I surrender to Your will; so that I may be reasonably happy in this life and supremely happy with You forever in the next.','2NNErZ2U.jpg'),
(58,'Counsel','newPrayer',NULL,'Prayer for counsel','God of heavenly wisdom, you have given us Mary, Mother of Jesus, to be our guide and counselor. Grant that {{name}} will always seek Her motherly help in this life and so enjoy Her blessed presence in the life to come.\n\nO Mother of Good Counsel, intercede for {{name}}, that {{gender2}} may be wise, courageous and loving leaders of the Church. Help {{gender3}} dear mother, to know the mind of Jesus, your Son.\n\nMay the Holy Spirit, fill {{name}} with reverence for God’s creation, and compassion for all God’s children. May {{gender1}} labors of love on earth enhance the reign of God; and may God’s gifts of faith and living hope prepare {{gender3}} for the fullness of the world to come',1,'My Lord God, I have no idea where I am going. I do not see the road ahead of me. I cannot know for certain where it will end. Nor do I really know myself, and the fact that I think I am following Your will does not mean that I am actually doing so. But I believe that the desire to please You does in fact please you. And I hope I have that desire in all that I am doing. I hope that I will never do anything apart from that desire. And I know that, if I do this, You will lead me by the right road, though I may know nothing about it. Therefore I will trust You always though I may seem to be lost and in the shadow of death. I will not fear, for You are ever with me, and You will never leave me to face my perils alone.\n\n','7ASrGksu.jpg'),
(59,'Thanksgiving','newPrayer',NULL,'Prayer for Thanksgiving Day and gratitude.','Father in Heaven, Creator of all and source of all goodness and love, please look kindly upon {{name}} and receive {{gender1}} heartfelt gratitude in this time of giving thanks.\n\nThank you for all the graces and blessings. You have bestowed upon {{name}}, spiritual and temporal: {{gender1}} faith and religious heritage. {{gender1}} food and shelter, {{gender1}} health, the love we have for one another, {{gender1}} family and friends.\n\nDear Father, in Your infinite generosity, please grant us continued graces and blessing throughout the coming year.\n',1,'Father in Heaven, Creator of all and source of all goodness and love, please look kindly upon me and receive my heartfelt gratitude in this time of giving thanks.\n\nThank you for all the graces and blessings. You have bestowed upon me, spiritual and temporal: my faith and religious heritage. My food and shelter, my health, the love we have for one another, my family and friends.\n\nDear Father, in Your infinite generosity, please grant us continued graces and blessing throughout the coming year.\n','kk55I8Zb.jpg'),
(60,'Heal Stress','newPrayer',NULL,'A Prayer to Heal Stress','Loving God, please grant {{name}} peace of mind and calm {{gender1}} troubled heart. {{gender1}} soul is like a turbulent sea. {{gender2}} can\'t seem to find {{gender1}} balance so {{gender2}} stumbles and worries constantly. Give {{gender3}} the strength and clarity of mind to find {{gender1}} purpose and walk the path you\'ve laid out for {{gender3}}. I trust your Love God, and know that you will heal {{gender1}} stress. Just as the sun rises each day against the dark of night. Please bring {{name}} clarity with the light of God.\nIn your name I pray,',1,'Loving God, please grant me peace of mind and calm my troubled heart. My soul is like a turbulent sea. I can\'t seem to find my balance so I stumble and worry constantly. Give me the strength and clarity of mind to find my purpose and walk the path you\'ve laid out for me. I trust your Love God, and know that you will heal my stress. Just as the sun rises each day against the dark of night. Please bring me clarity with the light of God.\nIn your name I pray,','8wojg6g0.jpg'),
(61,'Surrender','newPrayer',NULL,'Prayer of Surrender: Prayer of St. Ignatius of Loyola.','Lord, take and receive all of {{name}}\'s liberty, {{gender1}} memory, {{gender1}} understanding and {{gender1}} entire will, All {{gender2}} has and calls {{gender1}} own.\n\nYou have given all to {{name}}. To you, Lord, {{gender2}} returns it.\n\nEverything is yours; do with it what you will. Give {{name}} only your love and your grace. That is enough for {{gender3}}.',1,'Lord, take and receive all my liberty, my memory, my understanding and my entire will, All I have and call my own.\n\nYou have given all to me. To you, Lord, I return it.\n\nEverything is yours; do with it what you will. Give me only your love and your grace. That is enough for me.','eitXqx6r.jpg'),
(62,'Sickness and Disease','newPrayer',NULL,'Sickness, disease and restore strength.','Holy Spirit, drive away from {{name}} all forms of sickness and disease. restore strength to {{gender1}} body and joy to {{gender1}} spirit, so that in {{gender1}} renewed health, {{gender2}} may bless and serve you, now and forevermore.',1,'Holy Spirit, drive away from me all forms of sickness and disease. restore strength to my body and joy to my spirit, so that in my renewed health, I may bless and serve you, now and forevermore.','M6WmLLiM.jpg'),
(63,'Gift of Wisdom','newPrayer',NULL,'A prayer for the gift of wisdom.','Great is the wisdom of the Lord! God Almighty, Your Wisdom includes an understanding of what is fair, what is logical, what is true, what is right and what is lasting. It mirrors Your pure intellect!\n\nI entreat You to grant {{name}} such Wisdom, that {{gender1}} labors may reflect Your insight. Your Wisdom expands in Your creations, displaying complexity and multiplicity. Your Wisdom is an eternity ahead of man.\n\nMay Your wisdom flourish forever!',1,'Great is the wisdom of the Lord! God Almighty, Your Wisdom includes an understanding of what is fair, what is logical, what is true, what is right and what is lasting. It mirrors Your pure intellect!\n\nI entreat You to grant me such Wisdom, that my labors may reflect Your insight. Your Wisdom expands in Your creations, displaying complexity and multiplicity. Your Wisdom is an eternity ahead of man.\n\nMay Your wisdom flourish forever!','TPfaCRxF.jpg'),
(64,'General Prayer 2','newPrayer',NULL,'Strengthen, mend, heal, revive peace and love.','Dear God, {{name}} comes before you at this moment. Please Enlighten what is dark in {{gender3}}, Strengthen what is weak in {{gender3}}, Mend what is broken in {{gender3}}, Heal what is sick in {{gender3}}, And revive whatever peace and love that has died in {{gender3}}. This prayer for {{name}}, {{gender1}} family, {{gender1}} friends, {{gender1}} enemies and even those who hate {{gender3}}.',1,'Dear God, I come before you at this moment. Please Enlighten what is dark in me, Strengthen what is weak in me, Mend what is broken in me, Heal what is sick in me, And revive whatever peace and love that has died in me. This prayer for me, my family, my friends, my enemies and even those who hate me.','BPN1uqP1.jpg'),
(65,'Christmas Prayer','newPrayer',NULL,'Prayer for Christmas','O sweet Child of Bethlehem, grant that we may share with all our hearts in this profound mystery of Christmas. Put into the hearts of men and women this peace for which they sometimes seek so desperately and which you alone can give to them. Help them to know one another better, and to live as brothers and sisters, children of the same Father. Reveal to them also your beauty, holiness and purity. Awaken in their hearts love and gratitude for your infinite goodness. Join them all together in your love. And give us your heavenly peace. Amen.',1,'O sweet Child of Bethlehem, grant that we may share with all our hearts in this profound mystery of Christmas. Put into the hearts of men and women this peace for which they sometimes seek so desperately and which you alone can give to them. Help them to know one another better, and to live as brothers and sisters, children of the same Father. Reveal to them also your beauty, holiness and purity. Awaken in their hearts love and gratitude for your infinite goodness. Join them all together in your love. And give us your heavenly peace. Amen.','aWH2LlGj.jpg'),
(66,'Deceased','newPrayer',NULL,'Prayer for a deceased, passed away friend or relative.','I commend {{name}} to almighty God, and entrust {{gender3}} to {{gender1}} Creator. \n\nMay {{name}} rest in the arms of the Lord who formed {{gender3}} from the dust of the earth. \n\nMay holy Mary, the angels and all the saints welcome  {{gender3}} now that {{gender2}} has gone forth from this life. \n\nMay Christ who was crucified for {{name}}, bring {{gender3}} freedom and peace. May Christ who died for {{name}} admit {{gender3}} into his garden of paradise. May Christ, the true Shepherd, embrace {{name}} as one of his flock. May he forgive all {{gender1}} sins, and set {{gender3}} among those he has chosen. \n\nMay {{gender2}} see {{gender1}} Redeemer face to face, and enjoy the vision of God, forever. ',1,'I commend {{name}} to almighty God, and entrust {{gender3}} to {{gender1}} Creator. \n\nMay {{name}} rest in the arms of the Lord who formed {{gender3}} from the dust of the earth. \n\nMay holy Mary, the angels and all the saints welcome  {{gender3}} now that {{gender2}} has gone forth from this life. \n\nMay Christ who was crucified for {{name}}, bring {{gender3}} freedom and peace. May Christ who died for {{name}} admit {{gender3}} into his garden of paradise. May Christ, the true Shepherd, embrace {{name}} as one of his flock. May he forgive all {{gender1}} sins, and set {{gender3}} among those he has chosen. \n\nMay {{gender2}} see {{gender1}} Redeemer face to face, and enjoy the vision of God, forever. ','Ny4MwtAP.jpg'),
(67,'New Years','newPrayer',NULL,'New Year\'s Prayer','As the dawn breaks on a new year, let us give thanks for all we hold dear: our health, our family and our friends.\n\nLet us release our grudges, our anger and our pains, for these are nothing but binding chains. Let us live each day in the most loving ways, the God-conscious way. Let us serve all who are in need, regardless of race, color or creed.\n\nLet us keep God of our own understanding in our hearts and to chant God\'s name each day. Let us lead the world from darkness to light, from falsehood to truth and from wrong to right.\n\nLet us remember that we are all one, embracing all, discriminating against none.\n\nMay your year be filled with peace, prosperity and love. May God\'s blessings shower upon you and bestow upon each of you a bright, healthy and peaceful new year.\n',1,'As the dawn breaks on a new year, let us give thanks for all we hold dear: our health, our family and our friends.\n\nLet us release our grudges, our anger and our pains, for these are nothing but binding chains. Let us live each day in the most loving ways, the God-conscious way. Let us serve all who are in need, regardless of race, color or creed.\n\nLet us keep God of our own understanding in our hearts and to chant God\'s name each day. Let us lead the world from darkness to light, from falsehood to truth and from wrong to right.\n\nLet us remember that we are all one, embracing all, discriminating against none.\n\nMay your year be filled with peace, prosperity and love. May God\'s blessings shower upon you and bestow upon each of you a bright, healthy and peaceful new year.\n','1rXQYCQ3.jpg'),
(68,'Car Accident Victims','newPrayer',NULL,'Prayer for Peace that Surpasses the Circumstances','Lord, our Peace-Bringer, it is terrifying to have your way of life, your independence, and more ripped away from you in a matter of minutes. The days ahead will be hard for the accident victims in {{name}}\'s life, and there will be many new challenges. They will have adjustments to make as their bodies mend, and it may be a slow process. As {{name}} and {{gender1}} loved ones deal with this new normal for their lives, I pray for You to grant them a peace that surpasses all understanding. If they do not know You as their Savior, then I ask You to make a way for them to know You, so You help them during this crisis. I know that sudden tragedies easily rock peace. It is, for this reason, there can be no real peace apart from You.',1,'Lord, our Peace-Bringer, it is terrifying to have your way of life, your independence, and more ripped away from you in a matter of minutes. The days ahead will be hard for the accident victims, and there will be many new challenges. They will have adjustments to make as their bodies mend, and it may be a slow process. As they deal with this new normal for their lives, I pray for You to grant them a peace that surpasses all understanding. If they do not know You as their Savior, then I ask You to make a way for them to know You, so You help them during this crisis. I know that sudden tragedies easily rock peace. It is, for this reason, there can be no real peace apart from You.','z9ikZC3h.jpg'),
(69,'Coronavirus (COVID)','newPrayer',NULL,'A Prayer for Persons Suffering from the Coronavirus','Merciful God, hear our fervent prayer for all who suffer from the coronavirus, especially {{name}}. May {{gender2}} receive the proper treatment and the comfort of your healing presence. May {{gender1}} caregivers, families and neighbors be shielded from the onslaught of the virus.\n\nGive solace to those who grieve the loss of loved ones. Protect and guide those who strive to find a cure, that their work may conquer the disease and restore communities to wholeness and health.\n\nHelp us to rise above fear. We ask all this through the intercession of Our Lady of Lourdes, and in the name of your Son, Jesus, and the Holy Spirit, now and forever.',1,'Merciful God, hear our fervent prayer for all who suffer from the coronavirus, especially me. May I receive the proper treatment and the comfort of your healing presence. May my caregivers, families and neighbors be shielded from the onslaught of the virus.\n\nGive solace to those who grieve the loss of loved ones. Protect and guide those who strive to find a cure, that their work may conquer the disease and restore communities to wholeness and health.\n\nHelp us to rise above fear. We ask all this through the intercession of Our Lady of Lourdes, and in the name of your Son, Jesus, and the Holy Spirit, now and forever.','7hcELpeM.jpg'),
(70,'Good Lab Result','newPrayer',NULL,'Prayer for a Good Result','God my Healer, as {{name}} awaits the results of this lab work, {{gender2}} asks in the Name of Jesus that {{gender2}} receive a favorable report. You know that {{name}} has been leaning in on You for full and complete healing of this problem, and {{gender2}} is standing on Your Word in this matter. {{gender1}} eyes look to You in hope and love, waiting for Your deliverance.',1,'God my Healer, as I’m awaiting the results of this lab work, I ask in the Name of Jesus that I receive a favorable report. You know that I have been leaning in on You for full and complete healing of this problem, and I am standing on Your Word in this matter. My eyes look to You in hope and love, waiting for Your deliverance.','IYax71cs.jpg'),
(71,'Pregnancy','newPrayer',NULL,'Prayer For Pregnancy To St. Gerard','Holy St. Gerard, dearest son of the father, please accept {{name}}\'s prayers and bless {{gender3}} with a child; {{name}}\'s faith in you is undoubtedly and unshakable. The only desire {{gender2}} has is to raise a child under your guidance to make this world a better place. Please bless {{name}} with a baby and allow {{gender3}} to become a better parent.',1,'\nHoly St. Gerard, Dearest son of the father, please accept my prayers and bless me with a child. My faith in you is undoubtedly and unshakable. The only desire I have to raise a child under your guidance to make this world a better place. Please bless me with a baby and allow me to become a better parent for once.','toy4XIvs.jpg'),
(72,'Interview Success','newPrayer',NULL,'Prayer for success after an interview for a job or other opportunity.','Thank you for helping {{name}} in the interview. Let {{name}} give you any worries or mistakes that {{gender2}} may have made, and to rest in your love. Lord, if this is your will, please secure this opportunity for {{name}}. Come fill any areas of uncertainty with your spirit of gentleness and hope. Quiet {{name}}\'s heart now, and help {{gender3}} to trust in you.',1,'Thank you for helping me in the interview. I choose to give you any worries or mistakes that I may have made, and to rest in your love. Lord, if this is your will, please secure this job for me. Come fill any areas of uncertainty with your spirit of gentleness and hope. Quiet my heart now, and help me to trust in you.','W9ksoiTg.jpg'),
(74,'Healing of Cancer','newPrayer',NULL,'Prayer to St. Peregrine for those healed and recovered from cancer.','Dear holy servant of God, St. Peregrine, we pray today for healing.\n\nIntercede for us! God healed {{name}} of cancer and others were healed by your prayers. Please pray for the physical healing of {{name}}.\n\nThese intentions bring us to our knees seeking your intercession for healing.\n\nWe are humbled by our physical limitations and ailments. We are so weak and so powerless. We are completely dependent upon God. And so, we ask that you pray for us.\n\nPray for us, that in our pain we will not become selfish but ever more selfless!\n\nWe know, St. Peregrine, that you are a powerful intercessor because your life was completely given to God. We know that in as much as you pray for our healing, you are praying even more for our salvation.\n\nA life of holiness like yours is more important than a life free of suffering and disease. Pray for our healing, but pray even more that we might come as close to Our Lord as you are.',1,'Dear holy servant of God, St. Peregrine, we pray today for healing.\n\nIntercede for us! God healed you of cancer and others were healed by your prayers. Please pray for my physical healing.\n\nThese intentions bring us to our knees seeking your intercession for healing.\n\nWe are humbled by our physical limitations and ailments. We are so weak and so powerless. We are completely dependent upon God. And so, we ask that you pray for us.\n\nPray for us, that in our pain we will not become selfish but ever more selfless!\n\nWe know, St. Peregrine, that you are a powerful intercessor because your life was completely given to God. We know that in as much as you pray for our healing, you are praying even more for our salvation.\n\nA life of holiness like yours is more important than a life free of suffering and disease. Pray for our healing, but pray even more that we might come as close to Our Lord as you are.','YW4Eifmz.jpg'),
(75,'Stroke Recovery','newPrayer',NULL,'Prayer for Strength After a Stroke','Have mercy, O loving God, upon {{name}} who has suffered a stroke. Remove the sudden fear that may befall {{gender3}}. Endow {{gender3}} with courage in the struggle to recover what has been lost. Grant {{gender3}} strength and hope to envision new days ahead and a spirit of faith to take the risk of living fully once again.',1,'Have mercy, O loving God, upon me because I have suffered a stroke. Remove the sudden fear that befalls me. Endow me with courage in the struggle to recover what has been lost. Grant me strength and hope to envision new days ahead and a spirit of faith to take my risk of living fully once again.','oBofYfkb.jpg'),
(78,'For the Future','newPrayer',NULL,'Prayer for the future','Lord, I ask that You would guide {{name}}. God, You have a plan for{{gender2}}, so please help {{gender1}} to not only discover that plan but to take the steps along the way to trust You and to follow the road so that {{gender2}} arrives at the destination You have for {{gender3}}. Lord, I trust You with my full heart and I know that You will sustain and guide {{name}}. Thank You for the love and kindness You have shown me. I know You will show the same to {{name}}.',1,'Lord, I ask that You would guide me. God, You have a plan for me, so please help me to not only discover that plan but to take the steps along the way to trust You and to follow the road so that I arrive at the destination You have for me. Lord, I trust You with my full heart and I know that You will sustain and guide me. Thank You for the love and kindness You have shown me. I know ','QjfRXnw6.jpg'),
(79,'Grandchildren','newPrayer',NULL,'for grandchildren','Thank You for the blessing of having {{name}}\'s grandchildren in {{gender1}} life and I ask that You would protect them from a chaotic culture. Help them to see through the fog of chaos to find the beacon of Your love. I pray, Lord, that You would protect {{name}}\'s grandchildren at work and at school. God, give them the discernment to know what\'s right and wrong and to understand Your truth. \n\nI pray that You would put Your hand on their lives. I pray that You would put inside their hearts a thirst to live by Your standards and to always seek Your love every single day of their lives. Lord, I thank You for the blessing that are {{name}}\'s beautiful grandchildren. Please equip {{name}} to help guide them along their path in life. ',1,'Thank You for the blessing of having them in my life and I ask that You would protect them from a chaotic culture. Help them to see through the fog of chaos to find the beacon of Your love. I pray, Lord, that You would protect my grandchildren at work and at school. God, give them the discernment to know what\'s right and wrong and to understand Your truth. \n\nI pray that You would put Your hand on their lives. I pray that You would put inside their hearts a thirst to live by Your standards and to always seek Your love every single day of their lives. Lord, I thank You for the blessing that are these beautiful grandchildren. Please equip me to help guide them along their path in life. ','VTh79zVF.jpg'),
(80,'Focus','newPrayer',NULL,'Powerful prayer for focus','Most High God, distractions seem to be everywhere in {{name}}\'s life and {{gender2}} cannot focus. {{name}} feels as though {{gender2}} is being pulled in a million directions at once. Lord, remove these distractions from {{name}}\'s life. Help {{gender3}} to focus and to get things done, that {{gender2}} may be able to serve You better.',1,'Most High God, distractions seem to be everywhere this day and age. I cannot focus, even to pray. I feel as though I am being pulled in a million directions at once. I cannot take the time to even spend with my family. Lord, remove these distractions from my life. Help me to focus and to get things done, that I may be able to serve You better.','yccErGVp.jpg'),
(81,'God\'s Kingdom','newPrayer',NULL,'A Prayer for God\'s Kingdom to Come','Our Father in heaven, we bow before You, our great and glorious King. This world gives no weight to You, but we draw near to You in worship.\n\nAll power and authority belongs to You and we thank You that You have chosen to establish a kingdom. In perfect justice and in love and mercy, You chose to bring all who believe into Your kingdom. We are so thankful, and gladly embrace You as our Lord and our King.\n\nFather, we pray for the spread of the gospel in our world. There are people we love who, today, are outside of your kingdom. Lord, in Your mercy, bring them in! Cause them to be born again we pray. Deliver them from the kingdom of darkness. Bring them into the kingdom of Your dear Son Jesus Christ, and light in our hearts a passion for the spread of the gospel in this generation. Help us to do Your work.\n\nCome, judge the world in righteousness! Come, and bring us safely into Your presence, to live under the blessing of Your rule.',1,'Our Father in heaven, we bow before You, our great and glorious King. This world gives no weight to You, but we draw near to You in worship.\n\nAll power and authority belongs to You and we thank You that You have chosen to establish a kingdom. In perfect justice and in love and mercy, You chose to bring all who believe into Your kingdom. We are so thankful, and gladly embrace You as our Lord and our King.\n\nFather, we pray for the spread of the gospel in our world. There are people we love who, today, are outside of your kingdom. Lord, in Your mercy, bring them in! Cause them to be born again we pray. Deliver them from the kingdom of darkness. Bring them into the kingdom of Your dear Son Jesus Christ, and light in our hearts a passion for the spread of the gospel in this generation. Help us to do Your work.\n\nCome, judge the world in righteousness! Come, and bring us safely into Your presence, to live under the blessing of Your rule.','U8IzbB6g.jpg'),
(82,'Strength','newPrayer',NULL,'Prayer for strength.','Dear God, please give {{name}} strength when {{gender2}} is weak, love when {{gender2}} feels forsaken, courage when {{gender2}} is afraid, wisdom when {{gender2}} feels foolish, comfort when {{gender2}} is alone, hope when {{gender2}} feels rejected, and peace when {{gender2}} is in turmoil.',1,'Dear God, please give me strength when I am weak, love when I feel forsaken, courage when I am afraid, wisdom when I feel foolish, comfort when I am alone, hope when I feel rejected, and peace when I am in turmoil.','pIC9egoF.jpg'),
(83,'St. Michael the Archangel','newPrayer',NULL,'Defend us in battle, protection from evil.','Saint Michael the Archangel, defend {{name}} in battle. Be {{gender1}} protection against the wickedness and snares of the devil; May God rebuke him, we humbly pray; And do thou, O Prince of the Heavenly Host, by the power of God, thrust into hell Satan and all evil spirits who wander through the world for the ruin of souls.',1,'Saint Michael the Archangel, defend me in battle. Be my protection against the wickedness and snares of the devil; May God rebuke him, we humbly pray; And do thou, O Prince of the Heavenly Host, by the power of God, thrust into hell Satan and all evil spirits who wander through the world for the ruin of souls.','lrkZPjas.jpg'),
(93,'Medical Appointment','newPrayer',NULL,'Prayer Before A Medical Test, Procedure or Appointment','I am believing and trusting God for complete healing for {{name}} as {{gender2}} prepares for this appointment.\n\nI pray that God’s healing power will be completely received and made manifest in {{name}}\'s life, from the tips of {{gender3}} head to the soles of {{gender3}} feet, to the glory of His Holy Name.\n\nMay {{name}} experience and enjoy perfect health in body, spirit, soul and mind, and May {{gender3}} life forever glorify God and encourage others into His family.\n\nPraying in particular for {{name}}\'s upcoming appointment! Praying for God’s mercy, guidance, and overwhelming grace. Praying for a good report today and beyond in the name of Jesus!',1,'I am believing and trusting God for complete healing as I prepare for this medical appointment.\n\nI pray that God’s healing power will be completely received and made manifest in my life, from the tips of my head to the soles of my feet, to the glory of His Holy Name.\n\nMay I experience and enjoy perfect health in body, spirit, soul and mind, and May my life forever glorify God and encourage others into His family.\n \nPraying in particular for my upcoming appointment! Praying for God’s mercy, guidance, and overwhelming grace. Praying for a good report today and beyond in the name of Jesus!','KJt3HCEs.jpg'),
(101,'Child in Hospital','newPrayer',NULL,'Prayer for a child in hospital','Dear God, \n\nBe so close to our beautiful child, {{name}}. Be {{gender1}} special friend. Bless  {{gender3}} while in hospital with unexpected joy, with comfort, care and love without end. Prompt each doctor to be gentle, and the nurses to be fun. Give  {{gender3}} other children  {{gender2}} can play with, brighten  {{gender1}} days with shafts of sun. \n\nHold {{name}} very safely, so that  {{gender2}} knows you’re there. Bless  {{gender1}} sleep with lovely dreams, give {{gender3}} excellent care. Bless  {{gender1}} body, help  {{gender3}} heal. With restoration power, touch each hurt, each wound, each illness, watch  {{gender3}} hour by hour. \n\nHelp us be all that {{name}} needs, to love with endless grace. Draw us close as a family, keep us strong, keep us safe.',1,'Dear God, \n\nBe so close to my beautiful child, be their special friend. Bless them while in hospital with unexpected joy, with comfort, care and love without end. Prompt each doctor to be gentle, and the nurses to be fun. Give them other children they can play with, brighten their days with shafts of sun. Hold them very safely, so that they know you’re there. Bless their sleep with lovely dreams, give them excellent care. Bless their bodies, help them heal, With restoration power, touch each hurt, each wound, each illness, watch them hour by hour. Help me to be all that they need, to love with endless grace. Draw us close as a family, keep us strong, keep us safe.\n','xgACYAGg.jpg'),
(102,'Recently Deceased','newPrayer',NULL,'For the Recently Deceased','In your hands, O Lord, we humbly entrust {{name}}. In this life you embraced {{gender3}} with your tender love; deliver {{gender3}} now from every evil and bid {{gender3}} eternal rest.\n\nWelcome {{name}} into paradise, where there will be no sorrow, no weeping or pain, but fullness of peace and joy with your Son and the Holy Spirit forever and ever.',1,'In your hands, O Lord, we humbly entrust our brothers and sisters. In this life you embraced them with your tender love; deliver them now from every evil and bid them eternal rest.\n\nWelcome them into paradise, where there will be no sorrow, no weeping or pain, but fullness of peace and joy with your Son and the Holy Spirit forever and ever.','V8LvdlY4.jpg'),
(103,'Peace in Ukraine','newPrayer',NULL,'Peace in Ukraine','O Lord Jesus, Servant and Master, Bringer of Peace and Reconciliation, with deep sorrow and concern, we cry out to you for the beginnings of this war now occurring in Ukraine. We long for you to arrest this violence and destruction, to bring this war to a just end, and for your protection for all innocent victims and everyone directly involved in military action, in Ukraine and in Russia. Lord, in your mercy.',1,'O Lord Jesus, Servant and Master, Bringer of Peace and Reconciliation, with deep sorrow and concern, we cry out to you for the beginnings of this war now occurring in Ukraine. We long for you to arrest this violence and destruction, to bring this war to a just end, and for your protection for all innocent victims and everyone directly involved in military action, in Ukraine and in Russia. Lord, in your mercy.','nyfpw7ht.jpg'),
(104,'Hospitalization','newPrayer',NULL,'Prayer for Healing of Someone Hospitalized','Gracious Father, all health and healing are gifts from your hand. We pray for {{name}}, give {{gender1}} doctors and nurses the wisdom and skill as they work for {{gender3}} healing.\n\nWhile they wait and faces many unknowns, calm all doubts and fears with the Word of your promise that nothing can separate us from your love that is ours in Christ Jesus (Romans 8:39).\n\nSpeed {{name}}’s healing if it is your will, and give {{gender1}} an extra measure of patience as {{gender2}} waits for you to work all these things for {{gender1}} good (Romans 8:28); through Jesus Christ, our Lord.',1,'Gracious Father, all health and healing are gifts from your hand. Give doctors and nurses the wisdom and skill as they work for healing.\n\n“While he waits and faces many unknowns, calm all doubts and fears with the Word of your promise that nothing can separate us from your love that is ours in Christ Jesus (Romans 8:39).”\n\nSpeed the healing if it is your will, and give an extra measure of patience as we wait for you to work all these things for his good (Romans 8:28); through Jesus Christ, our Lord.','JP1S6ity.jpg'),
(105,'Miscarriage or Stillbirth','newPrayer',NULL,'Blessing of Parents after a Miscarriage or Stillbirth','Compassionate God, soothe the hearts of {{name}}, and grant that through the prayers of Mary, who grieved by the Cross of her Son, you may enlighten their faith, give hope to their hearts, and peace to their lives.\n\nLord, grant mercy to all the members of this family and comfort them with the hope that one day we will all live with you, with your Son Jesus Christ, and the Holy Spirit, forever and ever.\n\nLord, God of all creation, we bless and thank you for your tender care. Receive this life you created in love and comfort your faithful people in their time of loss with the assurance of your unfailing mercy. Through Christ our Lord.',1,'Compassionate God, soothe our hearts, and grant that through the prayers of Mary, who grieved by the Cross of her Son, you may enlighten our faith, give hope to our hearts, and peace to our lives.\n\nLord, grant mercy to all the members of my family and comfort us with the hope that one day we will all live with you, with your Son Jesus Christ, and the Holy Spirit, forever and ever.\n\nLord, God of all creation, we bless and thank you for your tender care. Receive this life you created in love and comfort your faithful people in their time of loss with the assurance of your unfailing mercy. Through Christ our Lord.','RzBmzr5q.jpg'),
(106,'Deceased Pet','newPrayer',NULL,'Prayer to say goodbye to a pet, dog, cat.','O Lord our God, we come before You this day in sadness. {{name}}, who brought {{gender1}} family so much joy in life, has now died; {{gender3}} happy times in {{gender1}} family’s embrace have come to an end. O God, help {{name}}\'s family to remember the good times with {{gender1}}. Remind them to rejoice in the happy times that {{name}} brought to their home. Let them be thankful for the good life they were blessed to give to {{gender1}}.\n\nWe are grateful to You, God, for creating {{name}}, for entrusting {{gender3}} to {{gender1}} family\'s care, and for sustaining {{gender3}} in love for a measure of time.  O God, we ask that You watch over {{name}} in death. You entrusted {{name}} to {{gender1}} family\'s care; now, they give {{gender3}} back to You. May {{name}} find a happy new home in Your loving embrace.\n\nAs we remember {{name}}, may we love each other more dearly. May we care for all Your creatures, for every living thing, just as the blessed life of {{name}} was protected. May {{gender1}} memory bless our lives with love and caring forever. ',1,'O Lord our God, we come before You this day in sadness. {{name}}, who brought us so much joy in life, has now died; {{gender3}} happy times in our family’s embrace have come to an end. We miss {{name}} already.\n\nHelp us, O God, to remember the good times with {{name}}. Remind us to rejoice in the happy times {{gender2}} brought to our home. Let us be thankful for the good life we were blessed to give to {{gender3}}.\n\nWe are grateful to You, God, for creating {{name}}, for entrusting {{gender3}} to our care, and for sustaining {{gender3}} in our love for a measure of time. We understand that all that lives must come to an end. We knew that this day would come. And yet, O God, we would have wanted one more day of play, one more evening of love with {{name}}.\n\nO God, as we have taken care of {{name}} in life, we ask that You watch over {{gender1}} in death. You entrusted {{name}} to our care; now, we give {{gender3}} back to You. May {{name}} find a happy new home in Your loving embrace.\n\nAs we remember {{name}}, may we love each other more dearly. May we care for all Your creatures, for every living thing, as we protected the blessed life of {{name}}. May {{gender1}} memory bless our lives with love and caring forever. ','oPIPjPEf.jpg'),
(107,'Cancer Patients','newPrayer',NULL,'For Cancer Patients or anyone battling cancer','My God and my Creator, you have given {{name}} life and blessed {{gender3}} with opportunities and experiences. Help {{gender3}} to appreciate {{gender1}} friends and family, the simple joys, and continue to share wonderful and inspiring things with {{gender3}}.\n\nEven though {{name}} suffers from cancer, even though life has been harsh and debilitating that it might break {{gender1}} heart and augment {{gender1}} fear, I pray that {{gender1}} faith in you still gives {{gender3}} comfort and hope. I trust in your healing grace.',1,'My God and my Creator, you have given me life and blessed me with opportunities and experiences. I thank you for my friends and my family, for the simple joys, for the wonderful and inspiring things you’ve shared with me.\n\nEven though I suffer from cancer, even though life has been harsh and debilitating that it breaks my heart and augments my fear, my faith in you still gives me comfort and hope. I trust in your healing grace.','A2GtcTZm.jpg'),
(108,'St. Benedict','newPrayer',NULL,'Short Prayer to St. Benedict','Admirable Saint and Doctor of Humility, you practiced what you taught, assiduously praying for God\'s glory and lovingly fulfilling all work for God and the benefit of all human beings. You know the many physical dangers that surround us today often caused or occasioned by human inventions. Guard us against poisoning of the body as well as of mind and soul, and thus be truly a Blessed one for us.',1,'Admirable Saint and Doctor of Humility, you practiced what you taught, assiduously praying for God\'s glory and lovingly fulfilling all work for God and the benefit of all human beings. You know the many physical dangers that surround us today often caused or occasioned by human inventions. Guard us against poisoning of the body as well as of mind and soul, and thus be truly a Blessed one for us. Amen.','FVFmWFWH.jpg'),
(109,'Peace in Ukraine 2','newPrayer',NULL,'A prayer for peace in Ukraine.','Heavenly Father, Your Son taught us “Blessed are the Peacemakers for they shall be called Children of God.”\n\nIn this time of great worry, we fervently pray that Your Holy Spirit sustain all the people of Ukraine to be vigilant and dedicated to peace and justice. Grant their leaders wisdom and prudence. Yet, may they also have the strength and perseverance to defend their land from all adversity and foreign attacks. Help us all to live according to your Divine Will. \n\nO God, our Father, in the days to come, we beseech you to comfort the suffering, heal the wounded, and accept the souls of the faithful departed into Your Heavenly Kingdom. We ask also that the Most Holy Mother of God extend her blessed mantle of protection over our Ukraine. \n',1,'Heavenly Father, Your Son taught us “Blessed are the Peacemakers for they shall be called Children of God.”\n\nIn this time of great worry, we fervently pray that Your Holy Spirit sustain all the people of Ukraine to be vigilant and dedicated to peace and justice. Grant their leaders wisdom and prudence. Yet, may they also have the strength and perseverance to defend their land from all adversity and foreign attacks. Help us all to live according to your Divine Will. \n\nO God, our Father, in the days to come, we beseech you to comfort the suffering, heal the wounded, and accept the souls of the faithful departed into Your Heavenly Kingdom. We ask also that the Most Holy Mother of God extend her blessed mantle of protection over our Ukraine. \n\n','FbTn5VGH.jpg'),
(110,'Easter Morning','newPrayer',NULL,'Use these simple words to offer up a quiet moment to God before the Easter festivities begin in earnest.','Heavenly Father, {{name}}\'s heart is so full of joy today. You feel so near to {{gender3}} on this most special celebration of Easter. May the love {{gender2}} feels this morning stay with {{gender3}}  the rest of the day and always. As {{name}} begins this day celebrating Jesus’s victory over death, we pray, O Heavenly Father, that You be near to {{name}} and continue to guide {{gender3}} until {{gender2}}  joins in the unending celebration in heaven. In Your name we pray. I offer up this morning to {{name}}, Lord, and pray in gratitude for the gift of salvation that Jesus won for us. As the day gets busier, may {{name}} never stray far from the quiet peace that {{gender2}} feels in {{gender1}} heart right now, knowing how deep Your love is for {{gender3}}.',1,'Heavenly Father, my heart is so full of joy today. You feel so near to me on this most special celebration of Easter. May the love I feel this morning stay with me the rest of the day and always. As I begin this day celebrating Jesus’s victory over death, I pray, O Heavenly Father, that You be near to me and continue to guide me until I join in the unending celebration in heaven. In Your name I pray. I offer up this morning to you, Lord, and pray in gratitude for the gift of salvation that Jesus won for me. As the day gets busier, may I never stray far from the quiet peace I feel in my heart right now, knowing how deep Your love is for me.','S09DQUnR.jpg'),
(111,'Increase Faith','newPrayer',NULL,'Prayer to increase faith','Please grant {{name}} the ability to know, love, and serve God even more in {{gender1}} life each day. May {{gender2}} turn from sin, turn to God, and listen to His voice in prayer and in the Scriptures. May {{gender2}} study more about {{gender1}} faith so {{gender2}} may understand God better, love God more, and truly live {{gender1}} life for God. May {{name}} pray for {{gender3}}self that {{gender2}} will work to increase {{gender1}} faith and devotion to God.',1,'In the Prayer to Increase Faith, we recognize that we can fall short of truly living our Catholic faith. May we know, love, and serve God even more in our lives each day. May we turn from sin, turn to God, and listen to His voice in prayer and in the Scriptures. May we study more about our faith so we may understand Him better, love Him more, and truly live our lives for Him. May we pray for ourselves that we will work to increase our faith and devotion to God.','3NWXM4wJ.jpg'),
(112,'Mothers Day','newPrayer',NULL,'Ask Mary to bless all mothers','Mary, on this day when we honor all mothers, we turn to you. We thank the Lord whom you serve for the great gift of motherhood. Never has it been known that anyone who sought your intercession was left unaided by grace. \nDear Mother, thank you for your \'Yes\' to the invitation of the angel which brought heaven to earth and changed human history. You opened yourself to God\'s word and the Word was made flesh and dwelt among us.\n\nDear mother, intercede for all of our mothers. Ask your Divine Son to give them the grace of surrendered love. May they find daily strength to say yes to the call to the sacrificial love- the very heart of the vocation of motherhood. May their love and witness be a source of great inspiration for all of us called to follow your Son.\n\nOn this Mothers day, Mother of the Word Incarnate, pray for us who have recourse to you.',1,'Mary, on this day when we honor all mothers, we turn to you. We thank the Lord whom you serve for the great gift of motherhood. Never has it been known that anyone who sought your intercession was left unaided by grace. \nDear Mother, thank you for your \'Yes\' to the invitation of the angel which brought heaven to earth and changed human history. You opened yourself to God\'s word and the Word was made flesh and dwelt among us.\n\nDear mother, intercede for all of our mothers. Ask your Divine Son to give them the grace of surrendered love. May they find daily strength to say yes to the call to the sacrificial love- the very heart of the vocation of motherhood. May their love and witness be a source of great inspiration for all of us called to follow your Son.\n\nOn this Mothers day, Mother of the Word Incarnate, pray for us who have recourse to you.','iyujWzi2.jpg'),
(121,'St. Lucy Eye Ailment','newPrayer',NULL,'Eye ailment and health to St. Lucy','O blessed St. Lucy, patron saint of the blind and those with eye ailments, I come before you seeking your prayers for {{name}} and all who have eye problems. Confident in your advocacy, I place {{name}} at your feet so that you can carry {{gender3}} to the throne of God for His blessing. \n\nPray dear saint that He heal {{name}} completely and restore {{gender1}} eyes to full health. Pray {{gender2}} is filled with peace and that {{name}} can courageously face every day with hope and joy in {{gender1}} heart. Thank you, St. Lucy for your prayers. I trust in your patronage.',1,'O blessed St. Lucy, patron saint of the blind and those with eye ailments, I come before you seeking your prayers for me and all who have eye problems. Confident in your advocacy, I place them all at your feet so that you can carry me to the throne of God and present them to Him for His blessing. Pray dear saint that if it is His holy will that He heal me completely and restore my eyes to full health. If it is not, pray I am filled with peace and that I can courageously face every day with hope and joy in their hearts. Thank you, St. Lucy for your prayers. I trust in your patronage.','X1FEydVx.jpg'),
(122,'School shooting','newPrayer',NULL,'Let the shooting end','God, our hearts are broken with pain at the senseless deaths caused by gun violence. Families mourn, children live in fear, and some in our nation respond by arming themselves with more guns with greater capacity to end life. Our disconnection and alienation has caused some to turn to guns for protection and safety. We ask that you touch our hearts with your love, heal our brokenness, and turn us away from violence toward peace. Help us to transform our own hearts and to seek peaceful ways of resolving our differences. Let our hands reach out and connect with those who feel alone, those who live in fear, and those suffering from mental illness. Let our voices be raised asking our legislators to enact gun laws to protect all in our society, especially those most vulnerable. Let our pens write messages demanding change while also scripting words of hope and transformation. We ask this in the name of the God who desires that we live together in peace.',1,'God, our hearts are broken with pain at the senseless deaths caused by gun violence. Families mourn, children live in fear, and some in our nation respond by arming themselves with more guns with greater capacity to end life. Our disconnection and alienation has caused some to turn to guns for protection and safety. We ask that you touch our hearts with your love, heal our brokenness, and turn us away from violence toward peace. Help us to transform our own hearts and to seek peaceful ways of resolving our differences. Let our hands reach out and connect with those who feel alone, those who live in fear, and those suffering from mental illness. Let our voices be raised asking our legislators to enact gun laws to protect all in our society, especially those most vulnerable. Let our pens write messages demanding change while also scripting words of hope and transformation. We ask this in the name of the God who desires that we live together in peace.','4uNImMLC.jpg'),
(142,'Quit Smoking','newPrayer',NULL,'Prayer to Quit Smoking','Lord, help {{name}} to feel inspired by You, to believe in your words, and to increased {{gender1}} faith in you. Today, {{name}} is feeling helpless. I ask you to encourage {{name}} again to quit smoking and be a better child of yours. Please provide {{gender3}} wisdom and strength to overcome {{gender1}} addiction.',1,'Lord, You inspired me to believe in your words, and that increased my faith in you. Today I am feeling helpless and asking you to encourage me again to quit smoking and be a better child of yours. Please provide me wisdom and strength to overcome my addiction.','hsd7Hvb4.jpg'),
(143,'Overcoming Evil','newPrayer',NULL,'Prayer for overcoming evil and someone who treated you badly','Loving Lord, I have no idea why You have allowed this painful situation to come into {{name}}\'s life. Someone has badly mistreated {{gender3}}, and I do not know why. This attack was unexpected and seemingly unwarranted. Gracious Lord, I pray for You to please heal {{name}}\'s mind, so the thoughts of what happened are not playing over and over again. I pray You will heal {{name}}\'s wounds so that they do not leave a permanent emotional scar. Guard {{name}} so that their hateful actions will not overcome {{gender3}}, but {{gender2}} will be an overcomer through Your strength. Help {{name}} to focus on who {{gender1}} in You and forget what they have said and done.',1,'Loving Lord, I have no idea why You have allowed this painful situation to come into my life. Someone has badly mistreated me, and I do not know why. I have many scars from wounds I created by stupid choices. However, this situation is entirely different because the attack was unexpected and seemingly unwarranted. Gracious Lord, I pray for You to please heal my mind, so the thoughts of what happened are not playing over and over again. I pray You will heal my wounds so that they do not leave a permanent emotional scar. Guard me so that their hateful actions will not overcome me, but I will be an overcomer through Your strength. Help me to focus on who I am in You and forget what they have said and done.','OGGq2eUs.jpg'),
(144,'Forgive a family member','newPrayer',NULL,'God’s Love to Forgive a Family Member','Lord of unfailing love, {{name}} is grieving the loss of {{gender1}} relationship with {{gender1}} family member. They have turned on {{name}}, and {{gender2}} can truthfully say that {{gender2}} does not know why. Your Word gives clear direction on how to love Your enemies. It is difficult to imagine a member of {{name}}\'s family would become this, but they have. I know You want {{name}} to forgive them, and {{gender2}} is willing but needs Your help to make it to that point. I pray that You will pour out Your love on {{name}}. Let it overflow so that {{gender2}} can feel it coursing through {{gender1}} veins and healing every wound they inflicted. Help {{name}} to allow Your love to be {{gender1}} strength as {{gender2}} responds to such an unloving action. Strangers we can walk away from, but family, Lord? Grant {{name}} healing and empower me to love {{gender1}} enemy according to Your will.',1,'Lord of unfailing love, I am grieving the loss of my relationship with my family member. They have turned on me, and I can truthfully say that I do not know why. Your Word gives clear direction on how to love Your enemies. I never imagined a member of my family would become this, but they have. I know You want me to forgive them, and I am willing but need Your help to make it to that point. I pray that You will pour out Your love on me. Let it overflow so that I can feel it coursing through my veins and healing every wound they inflicted. I need Your love to be my strength as I respond to such an unloving action. Strangers we can walk away from, but family, Lord? Grant me healing and empower me to love my enemy according to Your will. Amen.','dvUQZ1UD.jpg'),
(145,'Healing and Forgiving Heart','newPrayer',NULL,'Prayer for Guidance to Healing and Forgiving Heart','Living God, look upon Your child and be merciful to {{name}} in {{gender1}} trial. There are been devastation to {{gender1}} life by the wrong done to {{gender3}}. I pray that {{name}} can forgive the person who hurt {{gender3}}. Though the wounds are deep, help {{name}} to find healing. I pray that You redeem {{name}} from this oppression and direct {{gender1}} steps through Your Word. Please don’t let iniquity have dominion over {{name}}. Make Your face shine upon {{gender3}} and guide {{gender3}} to healing and a forgiving heart. I pray You direct {{name}}\'s steps and be the light upon {{gender1}} path amid this horrible situation. Guide {{name}} to the safe haven of Your loving arms.',1,'Living God, look upon Your child and be merciful to me in my trial. My life has been devastated by the wrong done to me. I want to forgive the person who hurt me, but the wounds are deep, and I cannot find healing. I pray that You redeem me from this oppression and direct my steps through Your Word. Please don’t let iniquity have dominion over me. Make Your face shine upon me and guide me to healing and a forgiving heart. I pray You direct my steps and be the light upon my path amid this horrible situation. Guide me to the safe haven of Your loving arms.','sGT2dYkT.jpg'),
(146,'Peace','newPrayer',NULL,'Prayer for Leading to Jesus’ Place of Peace','Jesus, my Savior, I pray that {{name}} knows you as {{gender1}} precious Light in the darkness. Bring {{{name}} out of this time of darkness and hurt. Heal {{gender1}} wounds with the balm of Your love. As {{name}} deals with this hurt done against {{gender3}}, {{gender1}} life is in turmoil. Jesus, You came to guide {{name}}\'s feet in the way of peace. You saved {{gender3}} and reconciled {{gender3}} to God and brought peace. I pray You please move amid this hurtful conflict and direct {{name}}\'s feet again into the way of peace. Please cleanse {{name}}\'s heart of all hurt, resentfulness, and bitterness. Lead {{gender3}} to Your place of peace. ',1,'Jesus, my Savior, You are my precious Light in the darkness. Bring me out of this time of darkness and hurt. Heal my wounds with the balm of Your love. As I deal with this hurt done against me, my life is in turmoil. Jesus, You came to guide my feet in the way of peace. You saved me and reconciled me to God and brought peace. I pray You please move amid this hurtful conflict and direct my feet again into the way of peace. My heart is Yours; please cleanse it of all hurt, resentfulness, and bitterness. Lead me to Your place of peace. ','WqxCJ0RC.jpg'),
(147,'External evils','newPrayer',NULL,'Prayers for Evils Outside the Home or in the Workplace','Dear Father, {{name}} seeks Your protection from the wickedness of the evil one. You are the Almighty God, and his power doesn’t stand a chance to the might You yield. Help {{name}} to come to Your refuge with joy for You shelter {{gender3}} against the attack of the devil. Protect {{name}}, O Lord, from the craftiness of the enemy, and save {{gender3}} from evil plots. Cover {{name}} with Your presence when {{gender2}} feels weak so that evil will flee from {{name}}\'s presence.',1,'Dear Father, I seek Your protection from the wickedness of the evil one. You are the Almighty God, and his power doesn’t stand a chance to the might You yield. I come to Your refuge with joy for You shelter me against the attack of the devil. Protect me, O Lord, from the craftiness of the enemy, and save me from his evil plots. Cover me with Your presence when I feel weak so that he will flee from my presence.','Ml1i3FHS.jpg'),
(148,'Protection from Violent People','newPrayer',NULL,'Protection from Violent People Prayer','Faithful Father, there are violent people out there who are eager to do physical harm without any respect for human life. You are our Savior from those who wish to do us harm. You are our Protector from the violent hands of the wicked. As {{name}} goes about {{gender1}} day today, steer {{gender3}} away from the places where evil people lie in wait. Keep {{gender3}} out of reach from their harmful intentions and cradle {{gender3}} in the safety of Your loving hands.',1,'Faithful Father, There are violent people out there who are eager to do physical harm without any respect for human life. You are our Savior from those who wish to do us harm. You are our Protector from the violent hands of the wicked. As we go about our day today, steer us away from the places where evil people lie in wait. Keep us out of reach from their harmful intentions and cradle us in the safety of Your loving hands.','lXnjZYNl.jpg'),
(149,'Protection from Serious Diseases','newPrayer',NULL,'Protection from Serious Diseases Prayer','Dear God, You regard {{name}}\'s body as Your temple. You also commanded {{gender3}} to take good care of {{gender1}} health. Help {{name}} maintain good health. Remind {{name}} when {{gender2}} carelessly misuses or abuses {{gender1}} body that this is against Your will. As {{name}} goes about {{gender1}} day, keep {{gender3}} safe from contracting or developing diseases or ailments. Help {{name}} to use extra precautions so that {{gender2}} may be spared from serious sicknesses or harm to {{gender1}} body.',1,'Dear God, You regard our body as Your temple. You also commanded us to take good care of our health. Help me maintain good health. Remind me when I carelessly misuse or abuse my body that this is against Your will. As I go about my day, keep me safe from contracting or developing diseases or ailments. Help me to use extra precautions so that I may be spared from serious sicknesses or harm to my body. Amen.','X0BrvuVb.jpg'),
(150,'Children','newPrayer',NULL,'Give children strength, hope and joy.','Oh God, send Your grace upon {{name}}\'s children so they will know Your loving and healing presence. Give to {{gender1}} children strength, hope, and joy as they face the challenges of life. You called {{name}} to receive the children, may {{gender2}} provide support and care necessary for their journey to wellbeing. We look to You and Your Son, Jesus Christ, as a sign of mercy and joy. We ask this through the intercession of Our Lady of Lourdes in the name of Your Son, Jesus and the Holy Spirit, now and forever.',1,'Oh God, send Your grace upon my children so they will know Your loving and healing presence. Give to my children strength, hope, and joy as they face the challenges of life. You called me to receive my children, may I provide support and care necessary for their journey to wellbeing. I look to you and Your Son, Jesus Christ, as a sign of mercy and joy. I ask this through the intercession of Our Lady of Lourdes in the name of Your Son, Jesus and the Holy Spirit, now and forever.','aFe1spOI.jpg'),
(151,'Economic hardship ','newPrayer',NULL,'Economic hardships ','Gracious God, \n\nI know that your love is infinite and that you care about all areas of {{name}}\'s life. In this time of economic insecurity, help {{name}} to trust that all of our security is in you. Keep {{name}} mindful that you always have and always will provide for {{gender1}} needs. Apart from you {{gender2}} can do nothing. \n\nMerciful God, We ask that you give our leaders the wisdom to guide our nation and the world out of the current economic crisis. Help us to protect the poor and all those who are struggling during this difficult time, especially {{name}}. Provide for {{gender1}} needs and give {{gender3}} hope. Open new opportunities for {{gender3}} and furnish the resources {{gender2}} needs to live with dignity.  Encourage those who have enough to share essential resources with those who lack the necessities of life, and to do so with humble, grateful and loving hearts. ',1,'Gracious God, \n\nI know that your love is infinite and that you care about all areas of my life. In this time of economic insecurity, help me to trust that all of my security is in you. Keep me mindful that you always have and always will provide for my needs. Apart from you I can do nothing. \n\nMerciful God, I ask that you give our leaders the wisdom to guide our nation and the world out of the current economic crisis. Help us to protect the poor and all those who are struggling during this difficult time. Provide for my needs and give me hope. Open new opportunities for me and furnish the resources I need to live with dignity.  Encourage those who have enough to share essential resources with those who lack the necessities of life, and to do so with humble, grateful and loving hearts. ','g6BwyGBo.jpg'),
(152,'Bless our Fathers','newPrayer',NULL,'Prayer for our dads on Father\'s Day','Heavenly Father, we ask You to bless {{name}}\'s earthly father for the many times he reflected the love, strength, generosity, wisdom and mercy that You exemplify in Your relationship with us, Your children.\n\nWe honor {{name}}\'s father for putting {{gender1}} needs above their own convenience and comfort; for teaching {{name}} to show courage and determination in the face of adversity; for challenging {{name}} to move beyond {{gender1}} self-limiting boundaries; for modeling the qualities that would turn {{name}} into a responsible, principled, caring adult.\n\nGive {{name}}\'s father the grace to acknowledge and learn from his mistakes. Give him the grace to extend to them the same forgiveness that you offer us all. Help {{name}}\'s father to resist the urge to stay stuck in past bitterness, instead, moving forward with humility and peace of heart.\n\nIn union with St. Joseph, whom you entrusted with Your Son, we ask Your generous blessings today and every day.\n',1,'Heavenly Father, we ask You to bless my earthly father for the many times they reflected the love, strength, generosity, wisdom and mercy that You exemplify in Your relationship with us, Your children.\n\nI honor my father for putting my needs above his own convenience and comfort; for teaching me to show courage and determination in the face of adversity; for challenging me to move beyond self-limiting boundaries; for modeling the qualities that would turn me into a responsible, principled, caring adult.\n\nGive my father the grace to acknowledge and learn from his mistakes. Give him the grace to extend to them the same forgiveness that you offer us all. Help us to resist the urge to stay stuck in past bitterness, instead, moving forward with humility and peace of heart.\n\nWe pray that our fathers who have passed into the next life have been welcomed into Your loving embrace, and that our family will one be day be reunited in your heavenly kingdom.\n\nIn union with St. Joseph, whom you entrusted with Your Son, we ask Your generous blessings today and every day.\n','tDRlOjLp.jpg'),
(153,'Adoption ','newPrayer',NULL,'Prayer for parents trying to adopt a child','We pray that the adoption process for {{name}} will run smoothly and that the doors will open so a prospective child may become a permanent part of this new family.  We pray for wisdom and discernment for all doctors, lawyers, social workers, judges and court staff that they will work in the best interest of this child.  We also pray for Your provision of the resources of money and expert advice needed for the prospective parents.',1,'We pray that the adoption process will run smoothly and that the doors will open so a prospective child may become a permanent part of this my family.  We pray for wisdom and discernment for all doctors, lawyers, social workers, judges and court staff that they will work in the best interest of this child.   We also pray for Your provision of the resources of money and expert advice needed for us.','upF15ckj.jpg'),
(154,'World Peace','newPrayer',NULL,'Prayer for peace','Lord Jesus Christ, You are the true King of peace. In You alone is found freedom.\n\nPlease free our world from conflict. Bring unity to troubled nations. Let Your glorious peace reign in every heart. Dispel all darkness and evil. Protect the dignity of every human life. Replace hatred with Your love.\n\nGive wisdom to world leaders. Free them from selfish ambition. Eliminate all violence and war. Glorious Virgin Mary, Saint Michael the Archangel, Every angel and saint: Please pray for peace.\n\nPray for unity amongst nations. Pray for unity amongst all people. Pray for the most vulnerable. Pray for those suffering. Pray for the fearful. Pray for those most in need. Pray for us all.\n\nJesus, Son of the Living God, have mercy on us. Jesus, hear our prayers. Jesus, we trust in You!',1,'Lord Jesus Christ, You are the true King of peace. In You alone is found freedom.\n\nPlease free our world from conflict. Bring unity to troubled nations. Let Your glorious peace reign in every heart. Dispel all darkness and evil. Protect the dignity of every human life. Replace hatred with Your love.\n\nGive wisdom to world leaders. Free them from selfish ambition. Eliminate all violence and war. Glorious Virgin Mary, Saint Michael the Archangel, Every angel and saint: Please pray for peace.\n\nPray for unity amongst nations. Pray for unity amongst all people. Pray for the most vulnerable. Pray for those suffering. Pray for the fearful. Pray for those most in need. Pray for us all.\n\nJesus, Son of the Living God, have mercy on us. Jesus, hear our prayers. Jesus, we trust in You!','rRuq7xc6.jpg'),
(155,'Kidney Disease','newPrayer',NULL,'Prayer to St. Benedict to heal kidney disease.','O blessed and compassionate St. Benedict, you were full of the love of God and led countless others to Him, His Word, and His holy Church. Trusting in your intercession, I turn to you seeking prayers for {{name}} and any who suffer from diseases of the kidneys.  Pray dear saint that if it be God’s will for {{gender3}} that {{gender2}} be healed and restored to fullness of health. Thank you, holy St. Benedict, for your intercession on {{gender1}} behalf.',1,'O blessed and compassionate St. Benedict, you were full of the love of God and led countless others to Him, His Word, and His holy Church. Trusting in your intercession, I turn to you seeking prayers for {{name}} and any who suffer from diseases of the kidneys.  Pray dear saint that if it be God’s will for them that they be healed and restored to fullness of health. Thank you, holy St. Benedict, for your intercession on {{gender1}} behalf.','dXyPOSIp.jpg'),
(156,'Loss Prayer','newPrayer',NULL,'For those who mourn the death of a loved one.','Eternal God, Bless {{name}} who is mourning, with the comfort of your love that {{gender2}} may face each new day with hope and the certainty that nothing can destroy the good that has been given. May {{gender1}} memories become joyful, {{gender1}} days enriched with friendship, and {{gender1}} lives encircled by your love.',1,'Eternal God, Bless those who mourn, with the comfort of your love that they may face each new day with hope and the certainty that nothing can destroy the good that has been given. May their memories become joyful, their days enriched with friendship, and their lives encircled by your love.','GJukxTcs.jpg'),
(157,'Sick and Suffering','newPrayer',NULL,'For the sick and suffering.','Heavenly Father, giver of life and health: Comfort and relieve {{name}}, your sick servant, and give your power of healing to those who minister to {{gender1}} needs, that {{gender2}} may be strengthened in {{gender1}} weakness and have confidence in your loving care; through Jesus Christ our Lord.',1,'Heavenly Father, giver of life and health: Comfort and relieve all of your sick servants, and give your power of healing to them, that they may be strengthened in their weakness and have confidence in your loving care; through Jesus Christ our Lord.','yC32Ulw8.jpg'),
(158,'Person in the ICU','newPrayer',NULL,'Prayer for ICU paitent','Heavenly Father, It is so hard to watch {{name}} suffer. It doesn\'t seem fair for {{gender3}} to have to endure so much pain. Even though I am powerless, I believe that you are powerful and capable of stepping into this situation and completely altering the outcome. In faith, I am responding to the promises in your word that you listen to my prayers and those prayers can make {{name}} well. So, I am bringing {{name}} before you to ask for your healing touch in {{gender1}} life. Thank you for the forgiveness of sin and the promise of eternal healing. I am asking you to provide healing for {{name}} on this side of heaven.',1,'Heavenly Father, It is so hard to watch people suffer. It doesn\'t seem fair for them to have to endure so much pain. Even though I am powerless, I believe that you are powerful and capable of stepping into this situation and completely altering the outcome. In faith, I am responding to the promises in your word that you listen to our prayers and those prayers can make them well. So, I am bringing them before you to ask for your healing touch in their life. Thank you for the forgiveness of sin and the promise of eternal healing. I am asking you to provide healing for them on this side of heaven.','QORtUPR1.jpg'),
(159,'Feeling alone ','newPrayer',NULL,'Pray to St. Jude for hope and feeling alone','St. Jude, friend to those in need, {{name}} am weary from grief, without joy, without hope, struggling to find the light {{name}} know is in {{gender1}} soul. {{name}} turn to you, {{gender1}} most trusted intercessor. Take away this emptiness and the pain of {{gender1}} broken heart. In your compassion, help {{gender1}} tears to lead {{name}} to a place of peace in {{gender1}} heart. Too long have {{name}} forgotten the goodness of God’s world. Heal {{name}}. {{name}} yearn to feel light, to feel joy. Envelop {{name}} in brightness, and do not hold back. And {{name}} promise, if {{name}} receive these gifts, {{name}} will share them always in your name. Amen.',1,'St. Jude, friend to those in need, for all those who are weary from grief, without joy, without hope, struggling to find the light they know is in their soul. Help them to turn to you, their most trusted intercessor. Take away this emptiness and the pain of their broken heart. In your compassion, lead them to a place of peace in their heart. Too long have they forgotten the goodness of God’s world. Heal them. Help them to yearn to feel light, to feel joy. Envelop them in brightness, and do not hold back. Help them to receive these gifts, and to share them always in your name.','RA5iYt9t.jpg'),
(160,'Prayer to St. Monica','newPrayer',NULL,'Help my child turn to Christ','From your place in heaven, I beg that you will plead before the Throne of the Holy One, for the sake of {{name}}\'s child who has wandered from from the faith, and all that we have tried to teach. I know, dear Monica, that {{name}}\'s children belong not to us, but to God, and that God often permits this wandering as part of one’s journey toward Him.\n\nYour son, Augustine, wandered, too; eventually he found the faith, and came to believe, and in that belief became a true teacher. Help {{name}}, therefore, to have patience, and to believe that all things — even this disappointing movement away from the faith — work ultimately to His own good purposes.\n\nFor the sake of {{name}}\'s child’s soul, help {{name}} to understand and trust in this. St. Monica, please teach {{name}} to persist in faithful prayer as you did for your son’s sake. Inspire {{name}} to behave in ways that will not further distance {{name}}\'s child from Christ, but only draw them gently towards his marvelous light.\n\nPlease teach {{name}} what you know about this painful mystery of separation, and how it is reconciled in the re-orientation of our children toward heaven. O Saint Monica, lover of Christ and His Church, pray for me, and for {{name}}\'s child, that we may acquire heaven, joining with you, there, in offering constant and thankful praise to God,',1,'From your place in heaven, I beg that you will plead before the Throne of the Holy One, for the sake of my child, who has wandered from from the faith, and all that we have tried to teach. I know, dear Monica, that our children belong not to us, but to God, and that God often permits this wandering as part of one’s journey toward Him.\n\nYour son, Augustine, wandered, too; eventually he found the faith, and came to believe, and in that belief became a true teacher. Help me, therefore, to have patience, and to believe that all things — even this disappointing movement away from the faith — work ultimately to His own good purposes.\n\nFor the sake of my child’s soul, I pray to understand and trust in this. St. Monica, please teach me to persist in faithful prayer as you did for your son’s sake. Inspire me to behave in ways that will not further distance my child from Christ, but only draw them gently towards his marvelous light.\n\nPlease teach me what you know about this painful mystery of separation, and how it is reconciled in the re-orientation of our children toward heaven. O Saint Monica, lover of Christ and His Church, pray for me, and for my child, that we may acquire heaven, joining with you, there, in offering constant and thankful praise to God,','oCBC7KEt.jpg'),
(161,'Wife','newPrayer',NULL,'Glorify, and help your wife grow emotionally, mentally and spiritually.','Jesus, I pray for {{name}}\'s wife. Each day, teach {{name}} how to lay {{gender1}} life down for her and live in a way that glorifies You and her. Keep her healthy, Lord, and allow {{name}} to create space for her emotional, mental, and spiritual growth in a way that aids her health. Teach {{name}} how to build her up rather than break her down. I trust that {{name}} loves You, God. Help {{name}} love her the way You love the church.',1,'Jesus, I pray for my wife. Each day, teach me how to lay my life down for her and live in a way that glorifies You and her. Keep her healthy, Lord, and allow me to create space for her emotional, mental, and spiritual growth in a way that aids her health. Teach me how to build her up rather than break her down. I love You, God. Help me love her the way You love the church.','qfAL4A4G.jpg'),
(162,'Baptism','newPrayer',NULL,'Blessing for the gift of Baptism','Lord, thank you for the precious gift of baptism, that {{name}} can publicly declare {{gender1}} love and passion for you. Lord, we ask for your goodness and blessings to be poured out on this faithful servant. We pray that you would work deeply within {{gender1}} heart and soul to renew and refresh {{gender1}} each day. Come guide {{gender1}} footsteps, give {{gender1}} a hope and a vision for the future. \n\nFather, cover and protect {{gender1}} now, encircle {{gender1}} with your promises and fill {{gender1}} hearts with joy. May this day be one {{gender2}} cherishes and remembers forever!\n',1,'Lord, thank you for the precious gift of baptism, that I can publicly declare my love and passion for you. Lord, I ask for your goodness and blessings to be poured out on me, your faithful servant. I pray that you would work deeply within my heart and soul to renew and refresh me each day. Come guide my footsteps, give me a hope and a vision for the future. \n\nToday, the past is gone. I stand free and whole, loved and forgiven within the kingdom of God. Father, cover and protect me now, encircle me with your promises and fill my hearts with joy. May this day be one Icherish and remember forever!\n','fU0ziKjJ.jpg'),
(163,'Financial Help','newPrayer',NULL,'A Prayer for Financial and Money Help From God','Dear Lord, help {{name}} to leave {{gender1}} financial worries in Your Hands. Guide {{name}} to peace so that {{gender2}} can hear your wisdom. Keep {{name}} mindful of {{gender1}} blessings no matter how much or little {{gender2}} may have. Grant {{name}} the patience and tolerance necessary to calm {{gender1}} spirit knowing that You have everything under control.',1,'Dear Lord, help me to leave my financial worries in Your Hands. Guide me to peace so that I can hear your wisdom. Keep me mindful of my blessings no matter how much or little I may have. Grant me the patience and tolerance necessary to calm my spirit knowing that you have everything under control.','dUzWhskT.jpg'),
(164,'Conflict Resolution','newPrayer',NULL,'Conflict resolution with your adult children','Dear Heavenly Father,\n\nI\'m sure that {{name}} is grateful for You being present in {{gender1}} children\'s lives while they were still in the womb. From there you brought them into the world and have blessed them with a life that has brought them into adulthood.\n\nLord, we understand that {{name}}\'s relationship with {{gender1}} children is different now that they are adults. Help {{name}} to understand that when {{gender1}} kids were young, {{gender2}} could guide them to change their behavior and attitude, or face certain consequences. \n\nToday, {{name}} can’t discipline {{gender1}} adult children in the same way, and {{name}} knows that {{gender2}} shouldn’t. Please remind {{name}} that, as adults, we all have different ideas of how things should be. I pray that despite these differences between {{name}}\'s children, they would strive to love and overcome conflict whenever possible. And {{name}} knows you make that possible.\n\nI also pray, God, that {{name}}\'s children continue to honor {{gender3}} as their parent, and that {{name}} can honor them as {{gender1}} adult children.\n\nThank you for hearing my prayer. Thank you that you have provided {{name}} with the perfect model of love, your son Jesus Christ. May {{gender1}} children and {{name}} aspire to be more like Jesus in their interactions with each other.',1,'Dear Heavenly Father,\n\nFirst, I want to say thank you for my children. Thank you for being present in their lives while they were still in the womb. From there you brought them into the world and have blessed them with a life that has brought them into adulthood.\n\nLord, my relationship with my children is different now that they are adults. When they were young, I could guide them to change their behavior and attitude, or face certain consequences. I can’t discipline my adult children in the same way, and I know that I shouldn’t.\n\nPlease remind me that, as adults, we all have different ideas of how things should be. I also pray that despite these differences between us, my children would strive to love and overcome conflict whenever possible. And I know you make that possible.\n\nI pray, God, that my children continue to honor me as their parent, and that I can honor them as my adult child.\n\nThank you for hearing my prayer. Thank you that you have provided us with the perfect model of love, your son Jesus Christ.\n\nMay my children and I aspire to be more like Jesus in our interactions with each other.','s3TdydtZ.jpg'),
(165,'Happiness','newPrayer',NULL,'Happiness and energy.','O Heavenly Father, I pray that you cheer {{name}} up and refresh {{gender1}} spirit. Gladden {{gender1}} heart and mind so that {{gender2}} may sing your glory. Even when {{name}} is overwhelmed by despair and difficulties, guide {{gender3}} toward your light and be {{name}}\'s refuge. With Your blessing upon {{name}}, may {{gender2}} no longer feel sorrow or grief.',1,'O Heavenly Father, I pray that you cheer up and refresh my spirit. Gladden my heart and mind so that I may sing your glory. Even when I am overwhelmed by despair and difficulties, guide me toward your light and be my refuge. With Your blessing upon me, I no longer feel sorrow or grief.','VhkW2RtC.jpg'),
(166,'St. Camillus for the Sick','newPrayer',NULL,'For the sick who need cure and patience. ','St. Camillus, special patron of the sick, who during forty years didst devote yourself with truly heroic charity to the relief of their spiritual and temporal miseries: since holy Church has confided them to your mighty protection, deign, from your heavenly glory, to come now to {{name}}\'s assistance. Obtain for {{gender3}} either the cure of {{gender1}} maladies, or patience and Christian resignation, that {{gender2}} may be strengthened and sanctified and at the same time obtain for {{name}} the grace in life and death to imitate you in the practice of divine love.',1,'St. Camillus, special patron of the sick, who during forty years didst devote yourself with truly heroic charity to the relief of their spiritual and temporal miseries: since holy Church has confided them to your mighty protection, deign, from your heavenly glory, to come now to my assistance. Obtain for me either the cure of my maladies, or patience and Christian resignation, that I may be strengthened and sanctified and at the same time obtain for me the grace in life and death to imitate you in the practice of divine love.','6dwyC6Mj.jpg'),
(167,'Medical Issues','newPrayer',NULL,'Unresolved medical issues','O God of heavenly powers, by the might of your command you drive away from {{name}}\'s all sickness and all infirmity: Be present in your goodness with {{gender1}}, that {{gender1}} weakness may be banished and {{gender1}} strength restored; and that, {{gender1}} health being renewed, {{gender2}} may bless your holy Name; through Jesus Christ {{gender1}} Lord.',1,'O God of heavenly powers, by the might of your command\nyou drive away from my body all sickness and all infirmity:\nBe present in your goodness with me, your servant, that my\nweakness may be banished and my strength restored; and that,\nmy health being renewed, I may bless your holy Name;\nthrough Jesus Christ our Lord.','0noWHnlq.jpg'),
(168,'New Home','newPrayer',NULL,'Moving to a new home','Dear Heavenly Father, please be with {{name}}, I pray, as {{gender2}} moves on from the old to the new. The joy, memories, and hardships of the last season of {{gender1}} life are behind {{gender3}}. Help {{name}} to leave them there, Lord, and not carry them with {{gender3}} into this new season.\n\nLord, please lead {{name}} to Your choice, so that {{gender1}} new home will be in the center of Your will. I also pray for every member of {{name}}\'s family to be satisfied with the choice. Thank Lord for Your help!',1,'In Jesus\' name, I pray, Amen. Dear Heavenly Father, please be with me, I pray, as I move on from the old to the new. The joy, memories, and hardships of the last season of my life are behind me. Help me to leave them there, Lord, and not carry them with me into this new season.\n\nLord, please lead us to Your choice, so that our new home will be in the center of Your will. I also pray for every family member to be satisfied with the choice. Thank Lord for Your help!','4V3W8pEW.jpg'),
(169,'Calmness Prayer','newPrayer',NULL,'A Christian Prayer for Peace of Mind','Almighty God, We bless you for our lives, we give you praise for your abundant mercy and grace we receive. We thank you for your faithfulness even though we are not that faithful to you.\n\nLord Jesus, we ask you to give us all around peace in our mind, body, soul and spirit. We want you to heal and remove everything that is causing stress, grief, and sorrow in our lives.\n\nPlease guide our path through life and make our enemies be at peace with us. Let your peace reign in our family, at our place of work, businesses and everything we lay our hands on.\n\nLet your angels of peace go ahead of us when we go out and stay by our side when we return. In Jesus\' name,',1,'Almighty God, We bless you for our lives, we give you praise for your abundant mercy and grace we receive. We thank you for your faithfulness even though we are not that faithful to you.\n\nLord Jesus, we ask you to give us all around peace in our mind, body, soul and spirit. We want you to heal and remove everything that is causing stress, grief, and sorrow in our lives.\n\nPlease guide our path through life and make our enemies be at peace with us. Let your peace reign in our family, at our place of work, businesses and everything we lay our hands on.\n\nLet your angels of peace go ahead of us when we go out and stay by our side when we return. In Jesus\' name,','pisfOqWW.jpg'),
(170,'Colon Cancer Operation','newPrayer',NULL,'Someone undergoing an operation for colon cancer.','Heavenly Father,\n\nYou know the difficulties which can come from Colorectal Cancer. You also know that {{name}} is dealing with this disease but we know that you have gone before {{gender3}} into every procedure, every treatment, every test, every scan and every doctor’s appointment.\n\nI thank you for all of this. Now, give Your wisdom and discernment to {{name}}\'s medical team. Fill {{gender3}} body with resilience and strength. Surround {{gender3}} with loving support and care.\n\nRemove the difficulty {{gender3}} body is enduring from {{gender3}} treatments and above all, take each and every cancer cell from {{gender3}} body. You are the Alpha and Omega, the Beginning and the End. All things, every cancer, is under your dominion. So, we ask for you to make {{name}}\'s life cancer free once and for ever more.\n\nWe ask all of this humbly, in your Son’s name.',1,'Heavenly Father,\n\nYou know the difficulties which can come from Colorectal Cancer. You also know my loved one who is dealing with this disease but we know that you have gone before them.\n\nYou have gone before them into: Every procedure, every treatment, every test, every scan and every doctor’s appointment.\n\nWe thank you for all of this. And yet we are bold enough to ask for more. Give your wisdom and discernment to their medical team. Fill their body with resilience and strength. Surround them with loving support and care.\n\nRemove the difficulty their body is enduring from their treatments and above all, take each and every cancer cell from their body. You are the Alpha and Omega, the Beginning and the End. All things, every cancer, is under your dominion. So, we ask for you to make their lives cancer free once and for ever more.\n\nWe ask all of this humbly, in your Son’s name, Amen.','lxAdcX1g.jpg'),
(171,'During Surgery','newPrayer',NULL,'Prayer during surgery','Dearest Lord, {{name}} entrusts {{gender1}} life to You today as {{gender2}} goes on the operating table. May Your hand be upon the surgeons and doctors who will do the operation. Allow them to act as extensions of Your healing hands. Enable them to be the instruments that will help {{name}} recover {{gender1}} strength. As {{gender2}} falls asleep from the anesthetic, {{gender2}} asks You to be with {{gender3}} always. Allow {{gender3}} to feel Your presence. Let Your peace surround {{gender3}} even as {{gender2}} is unconscious. Help {{name}} to trust in Your promise, God, that when {{gender2}} calls to you for help, you will heal {{gender3}}. All these things I ask in Your Name.',1,'Dearest Lord, I entrust my life to You today as I go on the operating table. May Your hand be upon the surgeons and doctors who will do the operation. Allow them to act as extensions of Your healing hands. Enable them to be the instruments that will help me recover my strength. As I fall asleep from the anesthetic, I ask You to be with me always. Allow me to feel Your presence. Let Your peace surround me even as I am unconscious. I trust in Your promise, God, that when I call to you for help, you will heal me. All these things I ask in Your Name, Amen.','idq9fMu4.jpg'),
(172,'Woman in Labor','newPrayer',NULL,'Prayer for a woman in labour or giving birth','Send your angels to keep guard as labor for {{name}} begins. Lord, comfort and protect {{gender1}}. Surround {{gender1}} with your hope and goodness. Hold {{gender1}} through each wave of delivery. Give to {{gender3}} a perfect life. Come hold {{gender3}} newborn baby safely within your promises, now and forever.',1,'Send your angels to keep guard as labor begins. Lord, comfort and protect me. Surround me with your hope and goodness. Hold me through each wave of delivery. Give to me a perfect life. Come hold my newborn baby safely within your promises, now and forever.','ACOwaRtH.jpg'),
(173,'Find housing ','newPrayer',NULL,'Prayer to find housing ','Living God, You continually send out Your angels to do Your will on this earth. As {{name}} sets out to locate a new home, I ask if You will please provide direction to {{gender3}}. You alone know what {{name}}\'s future holds and where {{gender2}} should be living. I know You have a plan, and a purpose for {{name}}\'s life, and {{gender3}} future home will play an essential part in fulfilling those things. I ask for You to please guide {{name}} to a home that will fit with the plans You have for {{gender3}} life.',1,'Living God, You continually send out Your angels to do Your will on this earth. As I set out to locate a new home, I ask if You will please provide direction to me. You alone know what my future holds and where I should be living. I know You have a plan, and a purpose for my life, and my future home will play an essential part in fulfilling those things. I ask for You to please guide me to a home that will fit with the plans You have for my life. Amen.','o35Ef0kH.jpg'),
(174,'Sick Child','newPrayer',NULL,'Prayer for a sick child','St. Gerard, who, like the Saviour, loved children so tenderly and by your prayers freed many from disease and even death, listen to us who are pleading for our sick child. We thank God for the great gift of our son/daughter and ask Him to restore our child to health if such be His holy will. This favour, we beg of you through your love for all children and mothers.',1,'St. Gerard, who, like the Saviour, loved children so tenderly and by your prayers freed many from disease and even death, listen to us who are pleading for our sick child. We thank God for the great gift of our son/daughter and ask Him to restore our child to health if such be His holy will. This favour, we beg of you through your love for all children and mothers.','wFPVIID2.jpg'),
(175,'Cough and Cold','newPrayer',NULL,'Prayer for Healing from a Cough and Cold','Lord, thank you for keeping me in good health all the time. My eyes are on you because you are my healer. No illness is too hard for you to heal.\n\nI need your healing touch today from a cough and cold that have attacked me and made it difficult to breathe or sleep. I know you want to see me well with a strong and healthy body.\n\nStrengthen my immune system not to fall victim to viruses and bacteria that cause illnesses.\n\nGive me relief from the symptoms of the cough and cold so I can go about my daily tasks with enthusiasm.\n\nAs I take medicine for the cough and cold, may you work through it to give me quick relief.\n\nClear my nostrils and throat that I can breathe easily and bring down the fever that is making my body hot and uncomfortable.\n\nMay your Spirit of life give life to my mortal body (Romans 8:11) and energize it each day.',1,'Lord, thank you for keeping me in good health all the time. My eyes are on you because you are my healer. No illness is too hard for you to heal.\n\nI need your healing touch today from a cough and cold that have attacked me and made it difficult to breathe or sleep. I know you want to see me well with a strong and healthy body.\n\nStrengthen my immune system not to fall victim to viruses and bacteria that cause illnesses.\n\nGive me relief from the symptoms of the cough and cold so I can go about my daily tasks with enthusiasm.\n\nAs I take medicine for the cough and cold, may you work through it to give me quick relief.\n\nClear my nostrils and throat that I can breathe easily and bring down the fever that is making my body hot and uncomfortable.\n\nMay your Spirit of life give life to my mortal body (Romans 8:11) and energize it each day.','OyFcnyl4.jpg'),
(176,'Renew Me','newPrayer',NULL,'Renew My Mind, Body, and Soul','Lord, I come before you today in need of your healing hand. In you all things are possible. Hold my heart within yours, and renew my mind, body, and soul.\n\nI am lost, but I come to you with grace. You gave us life, and you also give us the gift of infinite joy. Give me the strength to move forward on the path you’ve laid out for me.\n\nGuide me towards better health, and give me the wisdom to identify those you’ve placed around me to help me get better. In your name, I pray.',1,'Lord, I come before you today in need of your healing hand. In you all things are possible. Hold my heart within yours, and renew my mind, body, and soul.\n\nI am lost, but I come to you with grace. You gave us life, and you also give us the gift of infinite joy. Give me the strength to move forward on the path you’ve laid out for me.\n\nGuide me towards better health, and give me the wisdom to identify those you’ve placed around me to help me get better. In your name, I pray.','lpy4MraG.jpg'),
(177,'Care of the Environment','newPrayer',NULL,'A Prayer for the Care of the Environment','O God, enlarge within us the sense of communion we have with all living things, to whom you gave the earth as a home, which we share with them. Grant us the courage to care for your creation, as just and loving caretakers.\n\nWe are thankful for your abundant creation; may we honor your beautiful work with reverential care and love. Through Christ our Lord.',1,'O God, enlarge within us the sense of communion we have with all living things, to whom you gave the earth as a home, which we share with them. Grant us the courage to care for your creation, as just and loving caretakers.\n\nWe are thankful for your abundant creation; may we honor your beautiful work with reverential care and love. Through Christ our Lord.','69tfnZia.jpg'),
(178,'Unity','newPrayer',NULL,'Prayer for Unity in America','God, help us begin to heal and move forward. Where the sting of grief weighs down our souls, bring Your comfort. Where fear of discrimination disturbs our peace of mind, fill us with trust in You.\n\nWhere unfair judgements shroud our ability to see the good in each other, help us connect at the heart of our common humanity. Where the darkness of hatred hides within us, bring it to light and replace it with Your love. Remove the blinders of predjudice from our eyes; help us to see each other clearly as Your beloved children..\n\nGive us the courage to be accountable for our actions and attitudes which harm others, and give us the strength to forgive those, who have wounded us. Open our hearts to be kind to one another, as we learn and grow. Strengthen us in our most broken places; Make something beautiful out of our pain.\n\nIlluminate our minds with Your Truth. We need Your justice, mercy and love more than ever, Lord. We need Your wisdom, guidance and vision for the future. We need You to create a new path for us, and fill us with the grace to follow it. Though it feels like we’re being torn apart at the seams, we know You are with us. Help us to rise as a stronger, more empathic people.\n\nAwaken a Holy passion and conviction of what is right in us. Help us unite in our desires for peace. Give us the strength to work together for the common good. We praise You, we thank You and we aspire only to do Your will.\n\nIn Jesus name we pray.',1,'God, help us begin to heal and move forward. Where the sting of grief weighs down our souls, bring Your comfort. Where fear of discrimination disturbs our peace of mind, fill us with trust in You.\n\nWhere unfair judgements shroud our ability to see the good in each other, help us connect at the heart of our common humanity. Where the darkness of hatred hides within us, bring it to light and replace it with Your love. Remove the blinders of predjudice from our eyes; help us to see each other clearly as Your beloved children..\n\nGive us the courage to be accountable for our actions and attitudes which harm others, and give us the strength to forgive those, who have wounded us. Open our hearts to be kind to one another, as we learn and grow. Strengthen us in our most broken places; Make something beautiful out of our pain.\n\nIlluminate our minds with Your Truth. We need Your justice, mercy and love more than ever, Lord. We need Your wisdom, guidance and vision for the future. We need You to create a new path for us, and fill us with the grace to follow it. Though it feels like we’re being torn apart at the seams, we know You are with us. Help us to rise as a stronger, more empathic people.\n\nAwaken a Holy passion and conviction of what is right in us. Help us unite in our desires for peace. Give us the strength to work together for the common good. We praise You, we thank You and we aspire only to do Your will.\n\nIn Jesus name we pray.','iK5mqdcB.jpg'),
(180,'Find a Job','newPrayer',NULL,'Prayer to St. Joseph for gainful employment','Dear Saint Joseph, you were yourself once faced with the responsibility of providing the necessities of life for Jesus and Mary. Look down with fatherly compassion upon {{name}} in {{gender1}} anxiety over {{gender1}} present inability to support {{gender1}} family. Please help {{name}} to find gainful employment very soon, so that this heavy burden of concern will be lifted from {{gender1}} heart and that {{gender2}} is soon able to provide for those whom God has entrusted to {{gender1}} care. Help {{name}} to guard against bitterness and discouragement, so that {{gender2}} may emerge from this trial spiritually enriched and with even greater blessings from God.',1,'Dear Saint Joseph, you were yourself once faced with the responsibility of providing the necessities of life for Jesus and Mary. Look down with fatherly compassion upon me in my anxiety over my present inability to support my family. Please help me to find gainful employment very soon, so that this heavy burden of concern will be lifted from my heart and that I am soon able to provide for those whom God has entrusted to my care. Help us to guard against bitterness and discouragement, so that we may emerge from this trial spiritually enriched and with even greater blessings from God.','oNUmarWX.jpg'),
(181,'Pet Surgery','newPrayer',NULL,'Pet undergoing surgery.','Merciful Lord, touch {{name}} with Your gentle hand of healing and comfort. I pray that You would deliver {{gender3}} of {{gender1}} symptoms and heal the underlying cause. I also pray that You would use veterinarians, medicines, and natural means to bring {{gender3}} once more to good health. Grant {{name}}\'s owners wisdom and compassion as they care for {{gender3}} as Your stewards. In Jesus\' name.',1,'Merciful Lord, touch my pet with Your gentle hand of healing and comfort. I pray that You would deliver {{gender3}} of {{gender1}} symptoms and heal the underlying cause. I also pray that You would use veterinarians, medicines, and natural means to bring {{gender1}} once more to good health. Grant me wisdom and compassion as I care for my pet as Your steward. In Jesus\' name.','O8F3ap3R.jpg'),
(182,'Students in College','newPrayer',NULL,'Prayer for students in college, school or any academic and educational institution','Lord, we pray for the protection of {{name}}. We ask that you would guard {{gender3}} heart and {{gender3}} mind in Christ Jesus. That you would wrap {{gender3}} up in Your love, And deliver {{gender3}} from all evil. Lord, we pray that you would give {{name}} great enthusiasm for {{gender1}} studies. May you inspire {{gender3}} each and everyday. May each seminar and class bring fresh inspiration to {{gender1}} work. May each moment be filled with the energy {{gender2}} needs for {{gender3}} tasks. \n\nLord, we pray that {{name}} would know the hope to which {{gender2}} is called. That {{gender3}} life would be transformed by revelation from Heaven. That You would inspire {{gender3}} direction And gently lead {{gender3}} into {{gender3}} destiny. Lord, we especially pray for {{name}}\'s friends at college. May they come to know Your goodness and love, To walk in Your freedom and grace All the days of their lives.\n',1,'Lord, I pray for my protection. I ask that you would guard my heart and my mind in Christ Jesus. That you would wrap me up in Your love, And deliver me from all evil. Lord, I pray that you would give me great enthusiasm for my studies. May you inspire me each and everyday. May each seminar and class bring fresh inspiration to my work. May each moment be filled with the energy I need for my tasks. Lord, I pray that I know the hope to which I am called. That my life would be transformed by revelation from Heaven. That You would inspire my direction And gently lead me into my destiny. Lord, I especially pray for my friends at college. May they come to know Your goodness and love, To walk in Your freedom and grace All the days of their life.\n','QMn6mxOX.jpg'),
(183,'Forgive Others','newPrayer',NULL,'Attempt to forgive and healing the hurt.','Dear Heavenly Father, {{name}} comes to You today with a heavy heart, the weight of the unforgiveness hanging on {{gender3}}. I pray that You would help {{gender3}} to let go of this burden that {{gender2}} has been carrying for far too long. Remind {{name}} how much you love and care for {{gender3}} as well as how much {{gender2}} has been forgiven.',1,'Dear Heavenly Father, I come to You today with a heavy heart, the weight of the unforgiveness hanging on me. I pray that You would help me to let go of this burden that I have been carrying for far too long. Remind me how much you love and care for me, as well as, how much I have been forgiven.','IRSPr8UZ.jpg'),
(184,'First Day of School','newPrayer',NULL,'Children starting school, give them excitement and calm','We give you our hopes, worries and fears as our lovely child {{name}} starts school. We pray that you would fill {{gender1}} heart with excitement and calm {{gender1}} worries with your love. Please go before {{name}}, help {{gender3}} make friends, enjoy the activities and build relationships with {{gender1}} teachers and caregivers. May we learn to entrust {{gender3}} each day into your care, and as we do may {{gender2}} grow in confidence and independence. Father, may joy abound in {{gender1}} heart as {{gender2}} enters this new exciting season of {{gender1}} life.',1,'I give you my hopes, worries and fears as my lovely children start school. I pray that you would fill their hearts with excitement and calm their worries with your love. Please go before them, help them make friends, enjoy the activities and build relationships with their teachers and caregivers. May I learn to entrust them each day into your care, and as I do may they grow in confidence and independence. Father, may joy abound in their hearts as they enter this new exciting season of their lives.','qGpHlpPk.jpg'),
(185,'Healing of Broken bones','newPrayer',NULL,'A prayer to St. Stanislaus for the recovery of broken bones','Dear St. Stanislaus, angel of purity and seraph of charity, while you bore bravely the pain of illness and broken bones, you stood unwaveringly in your faith during your hours of distress. You were miraculously cured through the love and care of your patron, St. Barbara, and Mary, the Mother of Jesus. \n\nYou know the pains {{name}} is suffering because of {{gender1}} broken bones. Please ask our Lord to grant {{gender3}} peace and patience during {{gender1}} suffering. Agree with {{gender3}} in prayer before God for His prompt healing and relief that {{gender2}} so much desires. In Jesus\' Name.',1,'Dear St. Stanislaus, angel of purity and seraph of charity, while you bore bravely the pain of illness and broken bones, you stood unwaveringly in your faith during your hours of distress. You were miraculously cured through the love and care of your patron, St. Barbara, and Mary, the Mother of Jesus. \n\nYou know the pains I am suffering because of my broken bones. Please ask our Lord to grant me peace and patience during my suffering. Agree with me in prayer before God for His prompt healing and relief that I so much desire. In Jesus\' Name. Amen.','KzHwwQN8.jpg'),
(186,'Teenagers','newPrayer',NULL,'Teenager challenges','Holy Father, thank You for teaching {{name}}\'s teen to revere You. Revering You is the seed of true knowledge. Teach them wisdom and let them be disciplined in all walks of life. Let them excel in studies and their relationships with others now and in the future. Help them do what is right and never let them go astray. Give them insight and the power to discern right and wrong. Help them listen to the correction and instruction of those with more experience. With all this only, Your gift to me will be able to live a happy life as You decreed for Your followers.',1,'Holy Father, thank You for teaching my teen to revere You. Revering You is the seed of true knowledge. Teach him/her wisdom and let them be disciplined in all walks of life. Let them excel in studies and their relationships with others now and in the future. Help them do what is right and never let them go astray. Give them insight and the power to discern right and wrong. Help them listen to the correction and instruction of those with more experience. With all this only, Your gift to me will be able to live a happy life as You decreed for Your followers.','Sn82Ki4Q.jpg'),
(189,'Weight Loss','newPrayer',NULL,'Permanent Changes to help with obesity and weight loss ','Faithful and True God, please help {{name}} to successfully and safely lose the extra weight that is harming {{gender1}} health. I also ask for Your aid in {{gender1}} struggle to maintain a healthy weight once {{gender2}} reaches {{gender1}} goal. Help {{name}} to make the permanent changes in {{gender1}} lifestyle and in {{gender1}} health habits to achieve and keep a healthy body. Help {{name}} make this commitment to a sustainable plan that {{gender2}} can follow throughout {{gender1}} life.',1,'Faithful and True God, I ask for Your help in successfully and safely losing this extra weight that is harming my health. I also need Your aid in maintaining a healthy weight once I reach my goal. Help me to make the permanent changes in my lifestyle and in my health habits to achieve and keep a healthy body. Help me make this commitment to a sustainable plan that I can follow throughout my life. Amen.','wv0fqsC0.jpg'),
(190,'Dying from Cancer','newPrayer',NULL,'Someone dying or going to die from Cancer','God of All Comfort, as {{name}} passes away from this life, please be with {{gender1}}. May Your overwhelming and gentle presence be known and felt. Please be near {{gender1}} in {{gender1}} worry, fear, and doubt. Remind {{gender1}} of Your eternal kingdom and light. Surround {{gender1}} in the love from this life and the next. Open {{gender1}} heart to You, Lord. May {{gender2}} leave this life with comfort and feeling loved. I ask this in Jesus’ compassionate name.',1,'God of All Comfort, as my loved one passes away from this life, please be with them. May Your overwhelming and gentle presence be known and felt. Please be near them in their worry, fear, and doubt. Remind them of Your eternal kingdom and light. Surround them in the love from this life and the next. Open their heart to You, Lord. May they leave this life with comfort and feeling loved. I ask this in Jesus’ compassionate name, Amen.','FAWMWA5u.jpg'),
(191,'Brain','newPrayer',NULL,'Healing of the brain','Heavenly Father, I pray for {{name}}, who is dealing with a condition in {{gender1}} brain. I pray today that great faith, perseverance, patience and endurance are among the first fruits of the Spirit that you may grant {{gender1}}, in this time of great pain and anticipation of healing.\n\nLord Jesus Christ, Healer of all diseases and our Great Physician of all times, we intercede for {{name}}, who is in traumatic condition, not knowing the depth of {{gender1}} illness. Nor does {{gender2}} know the length of {{gender1}} ordeal in {{gender1}} recovery. I pray and ask You to come and take Your place, in spirit, in the doctors, nurses and specialists. Bless all those who will aid {{gender1}} in {{gender1}} medical needs. Nothing is impossible in Your hands of power. In Your hands of healing and in Your heart of love, mercy and compassion.',1,'Heavenly Father, I am dealing with a condition in my brain. I pray today that great faith, perseverance, patience and endurance are among the first fruits of the Spirit that you may grant me, in this time of great pain and anticipation of healing.\n\nLord Jesus Christ, Healer of all diseases and our Great Physician of all times, we intercede for me who is in traumatic condition, not knowing the depth of my illness. Nor do I know the length of my ordeal in their recovery. I pray and ask You to come and take Your place, in spirit, in the doctors, nurses and specialists. Bless all those who will aid them in their medical needs. Nothing is impossible in Your hands of power. In Your hands of healing and in Your heart of love, mercy and compassion.','TgFwYASu.jpg'),
(192,'St. Raphael','newPrayer',NULL,'Prayer to Archangel Raphael','Most Holy Mother, Queen of the Angels and Archangels, send me your Champion, the Archangel Saint Raphael, let him heal me of all my spiritual and physical ailments in Jesus’ Holy name. May he protect me from satan and all the evil spirits. Saint Raphael be my guide and protector on my journey through life. O’ glorious Saint Raphael the Archangel, herald of blessings, pray for us!',1,'O Raphael, lead us toward those we are waiting for, those who are waiting for us: Raphael, Angel of happy meeting, lead us by the hand toward those we are looking for. May all our movements be guided by your Light and transfigured with your joy.','ukoZFjBM.jpg'),
(193,'Respiratory disease','newPrayer',NULL,'Respiratory disease heal pneumonia, lungs and chronic obstructive airway disease or COAD.','Lord, You are the God of all flesh and there is nothing impossible for You to do. Lord, I pray that you shall heal {{name}} from every respiratory disease affecting {{gender1}} life in the name of Jesus Christ. I pray by the mercy of the Lord, that {{gender1}} chronic cough is healed today in the name of Jesus Christ. I beg you to cure {{name}}\'s lungs and body of any disorders. Please induce {{gender1}} health back to normal.',1,'Lord, the scripture said you are the God of all flesh and there is nothing impossible for you to do. Lord, I pray that you shall heal me from every respiratory disease affecting my life in the name of Jesus Christ. I pray by the mercy of the Lord, my chronic cough is healed today in the name of Jesus Christ.','ezfBqyMY.jpg'),
(194,'Prosperity, Peace, And Strength','newPrayer',NULL,'Prayer For Prosperity, Peace, And Strength','We are ever grateful to you for the prosperity and peace you have so abundantly bestowed upon us. We place our faith in you and your Divine will. While this year has brought many blessings, it has also been a challenging year, and we ask that you uplift obstacles that are preventing further prosperity and peace of mind in lives. We humbly ask for your healing from the wounds of the past, and plead for your loving kindness as we heal. Please show us the right choices to make so that we can glorify you each day! Please lift any snares, evil, or other negative forces working against us, our business, our family, and friends, and all of our health and happiness. We place our burdens in your hands, knowing that it is through your mercy and benevolence that we can prosper. These things we pray in Jesus name.',1,'We are ever grateful to you for the prosperity and peace you have so abundantly bestowed upon us. We place our faith in you and your Divine will. While this year has brought many blessings, it has also been a challenging year, and we ask that you uplift obstacles that are preventing further prosperity and peace of mind in lives. We humbly ask for your healing from the wounds of the past, and plead for your loving kindness as we heal. Please show us the right choices to make so that we can glorify you each day! Please lift any snares, evil, or other negative forces working against us, our business, our family, and friends, and all of our health and happiness. We place our burdens in your hands, knowing that it is through your mercy and benevolence that we can prosper. These things we pray in Jesus name.','k1Xf2vGI.jpg'),
(195,'St. Benedict XVI','newPrayer',NULL,'Pope passes','Almighty and Everlasting God, we pray for His Holiness Benedict XVI, Roman Pontiff Emeritus, who has taught us that God is love and that we are saved in hope. We give thanks for his lifetime of service to the Church and for the example of his integrity and humility. We pray in gratitude for his ministry as shepherd, guide and protector of the Church. May your Holy Spirit bless him with peace and consolation as he goes forth from this life. We pray in the name of Jesus Christ who said, \'Come to me, all you who labor and are burdened, and I will give you rest.\'',1,'Almighty and Everlasting God, we pray for His Holiness Benedict XVI, Roman Pontiff Emeritus, who has taught us that God is love and that we are saved in hope. We give thanks for his lifetime of service to the Church and for the example of his integrity and humility. We pray in gratitude for his ministry as shepherd, guide and protector of the Church. May your Holy Spirit bless him with peace and consolation as he goes forth from this life. We pray in the name of Jesus Christ who said, \'Come to me, all you who labor and are burdened, and I will give you rest.\'','NHnb49ep.jpg'),
(196,'Martin Luther King Jr.','newPrayer',NULL,'MLK day','Holy God. Today, we remember Rev. Dr. Martin Luther King Jr.’s struggle for equality, justice, and dignity for African Americans that inspired so many other reform movements that seek to highlight the plight of the oppressed in society.\n\nWe pray that all of those in civil and religious authority be reminded that we all have been created in your image, and that there is an intrinsic dignity in each of us that calls for uplifting every man and woman, young and old.\n\nWe pray that your Holy Spirit remind us all that you show no partiality with regards to nationality, race, ethnicity, or gender, and to do so is to go against your great commandment of love toward one another.\n\nWe pray that the church will not be complicit of injustice by being silent, but that it can rise up with a prophetic voice that speaks truth to power and advances the values of your Kingdom.\n\nWe pray these things in the name of our blessed redeemer, Jesus Christ.',1,'Holy God. Today, we remember Rev. Dr. Martin Luther King Jr.’s struggle for equality, justice, and dignity for African Americans that inspired so many other reform movements that seek to highlight the plight of the oppressed in society.\n\nWe pray that all of those in civil and religious authority be reminded that we all have been created in your image, and that there is an intrinsic dignity in each of us that calls for uplifting every man and woman, young and old.\n\nWe pray that your Holy Spirit remind us all that you show no partiality with regards to nationality, race, ethnicity, or gender, and to do so is to go against your great commandment of love toward one another.\n\nWe pray that the church will not be complicit of injustice by being silent, but that it can rise up with a prophetic voice that speaks truth to power and advances the values of your Kingdom.\n\nWe pray these things in the name of our blessed redeemer, Jesus Christ.','4mQQZuuc.jpg'),
(197,'Pope Clement XI','newPrayer',NULL,'The Universal Prayer Attributed to Pope Clement XI','I offer you, Lord, my thoughts to be directed to you,\nmy words, to be about you,\nmy deeds, to respect your will,\nmy trials, to be endured for you. Lord, enlighten my understanding, I pray:\narouse my will,\ncleanse my heart,\nsanctify my soul. May I strive to obey my superiors,\nto help those dependent on me,\nto have care for my friends,\nforgiveness for my enemies. May I learn from you\nhow precarious are earthly things,\nhow great divine things,\nhow fleeting is time,\nhow lasting things eternal.',1,'I offer you, Lord, my thoughts to be directed to you, my words, to be about you, my deeds, to respect your will, my trials, to be endured for you. \n\nLord, enlighten my understanding, I pray: arouse my will, cleanse my heart, sanctify my soul. May I strive to obey my superiors, to help those dependent on me, to have care for my friends, forgiveness for my enemies. \n\nMay I learn from you how precarious are earthly things, how great divine things, how fleeting is time, how lasting things eternal.',NULL),
(198,'Children behavior in school','openAI',NULL,'Give wisdom and understanding to a child to encourage academic growth and development.','\n\nDear God, we come before you today asking for your help and guidance in our sons behavior at school. We pray that you would touch his heart and mind, and help him to see the importance of good behavior and positive attitude. Lord, we ask that you would give him wisdom and understanding of what is right and wrong in his actions and words towards others. We pray that you would bless his teachers with patience, love, and wisdom in dealing with our son. Lord, we also ask for your strength and grace for us as parents to support and encourage our son in his growth and development. We trust in your love and mercy, and believe that you can bring positive changes in our sons behavior. In Jesus name, we pray, Amen.',1,'\n\nDear God, we come before you today asking for your help and guidance in our sons behavior at school. We pray that you would touch his heart and mind, and help him to see the importance of good behavior and positive attitude. Lord, we ask that you would give him wisdom and understanding of what is right and wrong in his actions and words towards others. We pray that you would bless his teachers with patience, love, and wisdom in dealing with our son. Lord, we also ask for your strength and grace for us as parents to support and encourage our son in his growth and development. We trust in your love and mercy, and believe that you can bring positive changes in our sons behavior. In Jesus name, we pray, Amen.','KuNiGL8s.jpg'),
(200,'Safe travels via Car','openAI',NULL,'Guidance and protection to avoid obstacles while driving.','As {{name}} prepares to make {{gender1}} journey to Morristown, {{gender2}} asks for your guidance and protection. I pray that the roads are clear and traffic is light, so that {{gender2}} may arrive safely and peacefully to {{gender1}} destination. Please grant {{gender3}} patience and wisdom as {{gender2}} navigates the roads, and may your presence be with {{gender3}} throughout {{gender1}} journey. I believe that with your help, {{name}} can overcome any obstacles {{gender2}} may face on the way. Thank you for always being there for {{name}}, and for all your blessings in {{gender1}} life.',1,'As I prepare to make my journey to Morristown, I ask for your guidance and protection. I pray that the roads are clear and traffic is light, so that I may arrive safely and peacefully to my destination. Please grant me patience and wisdom as I navigate the roads, and may your presence be with me throughout my journey. I believe that with your help, I can overcome any obstacles I may face on the way. Thank you for always being there for me, and for all your blessings in my life.','0MBHY9hc.jpg'),
(201,'Law Enforcement and Police','openAI',NULL,'Protect everyone who serve our community through law enforcement.','I come before you today with a heavy heart, seeking your divine protection and guidance for {{name}}, who is a police officer. Lord, I pray that You will safeguard {{gender3}} from all danger, harm, and evil while {{gender2}} is on duty. Please keep {{gender3}} safe from any physical or emotional harm that may come {{gender1}} way as {{gender2}} serves and protects others.\n\nGrant {{gender3}} the courage and strength to carry out {{gender1}} duties with honor and integrity, always seeking to serve with compassion and empathy. Keep {{gender3}} focused on {{gender1}} purpose and strengthen {{gender1}} resolve to make a positive impact on the communities {{gender2}} serves.\n\nPlease also be with {{gender1}} fellow officers, who tirelessly put their lives on the line to protect us. May they be surrounded by your love and protection at all times, and may they be blessed with your guidance and wisdom as they carry out their duties.\n\nWe ask for your divine protection and guidance for all police officers who are serving in our communities. Please grant them the courage and wisdom they need to carry out their duties with honor and distinction.',1,'I come before you today with a heavy heart, seeking your divine protection and guidance for {{name}}, who is a police officer. Lord, I pray that You will safeguard {{gender3}} from all danger, harm, and evil while {{gender2}} is on duty. Please keep {{gender3}} safe from any physical or emotional harm that may come {{gender1}} way as {{gender2}} serves and protects others.\n\nGrant {{gender3}} the courage and strength to carry out {{gender1}} duties with honor and integrity, always seeking to serve with compassion and empathy. Keep {{gender3}} focused on {{gender1}} purpose and strengthen {{gender1}} resolve to make a positive impact on the communities {{gender2}} serves.\n\nPlease also be with {{gender1}} fellow officers, who tirelessly put their lives on the line to protect us. May they be surrounded by your love and protection at all times, and may they be blessed with your guidance and wisdom as they carry out their duties.\n\nWe ask for your divine protection and guidance for all police officers who are serving in our communities. Please grant them the courage and wisdom they need to carry out their duties with honor and distinction.','sOgKRqOk.jpg'),
(202,'Invasive Surgery','openAI',NULL,'Battle through surgery and get healthy and strong.','We come to you today with heavy hearts, asking for your guidance and comfort for our loved one who is undergoing invasive surgery. Please guide the hands of the surgeons and medical professionals, infuse them with your knowledge and wisdom to perform this procedure flawlessly.\n\nWe pray for the health and safety of our mother as we put our trust in you to guide and protect her. We ask that you keep her free from infections and any other complications during the surgery and in the days to come.\n\nMay your loving hand be with her as she battles through this surgery, and may she emerge stronger and healthier, ready to embrace the new day with renewed energy and enthusiasm.\n\nWe lift our mother up to you, God, and we ask for your strength to see us through this difficult time. Thank you for your everlasting love, and for answering our prayers.',1,'We come to you today with heavy hearts, asking for your guidance and comfort for our loved one who is undergoing invasive surgery. Please guide the hands of the surgeons and medical professionals, infuse them with your knowledge and wisdom to perform this procedure flawlessly.\n\nWe pray for the health and safety of our mother as we put our trust in you to guide and protect her. We ask that you keep her free from infections and any other complications during the surgery and in the days to come.\n\nMay your loving hand be with her as she battles through this surgery, and may she emerge stronger and healthier, ready to embrace the new day with renewed energy and enthusiasm.\n\nWe lift our mother up to you, God, and we ask for your strength to see us through this difficult time. Thank you for your everlasting love, and for answering our prayers.','ivUz0BOW.jpg'),
(203,'Assistance and Support','openAI',NULL,'Touch hearts, provide assistance, support and help to those in need. ','We come before you today with a humble heart and a sincere request. Lord, we ask for your help for all people who are in need of any kind of assistance. We pray that you would touch their hearts and provide them with the support they need.\n\nLord, we also ask that you would raise up people who are willing and able to help those in need. We pray that you would bless these individuals with the resources, wisdom, and compassion necessary to be a blessing to others.\n\nMay their actions bring glory and honor to your name, Lord. May others see their good works and be drawn to you. We trust that, as we ask according to your will, you will hear our prayers and respond with your abundant grace.',1,'\n\nDear Heavenly Father,\n\nWe come before you today with a humble heart and a sincere request. Lord, we ask for your help for all people who are in need of any kind of assistance. We pray that you would touch their hearts and provide them with the support they need.\n\nLord, we also ask that you would raise up people who are willing and able to help those in need. We pray that you would bless these individuals with the resources, wisdom, and compassion necessary to be a blessing to others.\n\nMay their actions bring glory and honor to your name, Lord. May others see their good works and be drawn to you. We trust that, as we ask according to your will, you will hear our prayers and respond with your abundant grace.\n\nIn Jesus name we pray,\n\nAmen.','zREa6VsS.jpg'),
(204,'Head Injury','openAI',NULL,'Recovery from head injury','Dear God,\n\nI come to you in prayer to ask for healing and recovery for my injured head. I ask that you pour out your healing power upon me and restore my mind and body to full health.\n\nI know that with you all things are possible, and I trust in your goodness and grace to heal me. Please grant me the strength and courage to endure the recovery process and take good care of myself.\n\nI also ask for your comfort and peace during this difficult time. Help me to stay positive and hopeful, knowing that you are always with me and that I will emerge from this injury stronger and more resilient than before.\n\nThank you for your boundless love and mercy, and for hearing my prayers.',1,'Dear God,\n\nI come to you in prayer to ask for healing and recovery for my injured head. I ask that you pour out your healing power upon me and restore my mind and body to full health.\n\nI know that with you all things are possible, and I trust in your goodness and grace to heal me. Please grant me the strength and courage to endure the recovery process and take good care of myself.\n\nI also ask for your comfort and peace during this difficult time. Help me to stay positive and hopeful, knowing that you are always with me and that I will emerge from this injury stronger and more resilient than before.\n\nThank you for your boundless love and mercy, and for hearing my prayers.\n','jNHGxkhO.jpg'),
(205,'Head Injury','openAI',NULL,'Healing for a head injury','Heavenly Father,\n\nI come before you today with a heavy heart, asking for your healing hand to touch my head and bring healing to my injury. You are the great physician, and I know that nothing is impossible with you.\n\nI pray that you will remove any pain, discomfort, and inflammation that I am experiencing. Please restore the proper functioning of my brain and all the parts of my body that have been affected by this injury.\n\nHelp me to trust in your goodness and love, even in the midst of this trial. Give me strength, courage, and patience as I go through the healing process. And may your peace, which surpasses all understanding, guard my heart and mind through Christ Jesus.\n\nI pray all these things in the name of Jesus Christ.\n',1,'Heavenly Father,\n\nI come before you today with a heavy heart, asking for your healing hand to touch my head and bring healing to my injury. You are the great physician, and I know that nothing is impossible with you.\n\nI pray that you will remove any pain, discomfort, and inflammation that I am experiencing. Please restore the proper functioning of my brain and all the parts of my body that have been affected by this injury.\n\nHelp me to trust in your goodness and love, even in the midst of this trial. Give me strength, courage, and patience as I go through the healing process. And may your peace, which surpasses all understanding, guard my heart and mind through Christ Jesus.\n\nI pray all these things in the name of Jesus Christ.\n','hKwswdBm.jpg'),
(206,'Head Injury','openAI',NULL,'Friend with a head injury','Dear God,\n\nWe come to you with a humble heart and ask for your divine healing touch. We pray for the complete recovery of our dear friend who has suffered an injury to their head. Lord, we ask that you ease their pain and discomfort and bring them the strength and courage to face the challenges of the recovery process.\n\nWe ask that you guide the doctors and healthcare professionals who are caring for our loved one. Give them the wisdom and knowledge to provide the best possible treatment and care.\n\nLord, we believe in your power to heal, and we trust that you will work through them to bring complete healing to their whole body, including their head.\n\nWe ask all these things in the name of your son, Jesus Christ.',1,'Dear God,\n\nWe come to you with a humble heart and ask for your divine healing touch. We pray for the complete recovery of our dear friend who has suffered an injury to their head. Lord, we ask that you ease their pain and discomfort and bring them the strength and courage to face the challenges of the recovery process.\n\nWe ask that you guide the doctors and healthcare professionals who are caring for our loved one. Give them the wisdom and knowledge to provide the best possible treatment and care.\n\nLord, we believe in your power to heal, and we trust that you will work through them to bring complete healing to their whole body, including their head.\n\nWe ask all these things in the name of your son, Jesus Christ.','rPIqeRwT.jpg'),
(207,'Head Injury','openAI',NULL,'My head injury','Dear Lord,\n\nI come to you with a heavy heart and a burdened mind, seeking your divine healing touch for my head injury. I know that you are the great physician, and you have the power to heal anything that ails me.\n\nIn your infinite mercy, I pray that you would remove this injury from my head and restore me to full health. I pray that you would ease the pain and discomfort that I am feeling, and grant me the strength and courage to endure this trial.\n\nI trust in your goodness, Lord, and I know that you care for me deeply. I pray that you would be with me every step of the way as I seek to recover from this injury.\n\nIn Jesus name, I pray.',1,'Dear Lord,\n\nI come to you with a heavy heart and a burdened mind, seeking your divine healing touch for my head injury. I know that you are the great physician, and you have the power to heal anything that ails me.\n\nIn your infinite mercy, I pray that you would remove this injury from my head and restore me to full health. I pray that you would ease the pain and discomfort that I am feeling, and grant me the strength and courage to endure this trial.\n\nI trust in your goodness, Lord, and I know that you care for me deeply. I pray that you would be with me every step of the way as I seek to recover from this injury.\n\nIn Jesus name, I pray.','IGUW89qx.jpg'),
(208,'Body and head recovery','openAI',NULL,'Body and head recovery','Dear God,\n\nI come to you with a heavy heart, seeking your help and healing touch. I pray that you heal my head from this injury and bring a full restoration of my health. Give me strength and courage to face the challenges that come with the recovery process. \n\nMay your loving arms hold me close and give me comfort in this time of need. I trust in your goodness and mercy to surround me with love and protection. \n\nMay your healing power flow through every part of my body and bring complete healing to my head. I believe in your power to heal and restore, and I am grateful for your presence in my life.\n\nThank you for listening to my prayer and for your steadfast love and support.\n',1,'Dear God,\n\nI come to you with a heavy heart, seeking your help and healing touch. I pray that you heal my head from this injury and bring a full restoration of my health. Give me strength and courage to face the challenges that come with the recovery process. \n\nMay your loving arms hold me close and give me comfort in this time of need. I trust in your goodness and mercy to surround me with love and protection. \n\nMay your healing power flow through every part of my body and bring complete healing to my head. I believe in your power to heal and restore, and I am grateful for your presence in my life.\n\nThank you for listening to my prayer and for your steadfast love and support.\n','zpvT6CUC.jpg'),
(209,'Job Search','openAI',NULL,'Job search','Dear Lord,\n\nI come before You with a humble heart, asking for Your divine guidance and intervention in my job search. I pray that You would lead me to a job that I would truly love, one that will enable me to use my talents and skills to the fullest.\n\nPlease grant me wisdom and discernment as I search for job openings, and open doors of opportunity for me through Your grace. Remove any obstacles that may hinder me from securing a good job, and may Your favor and blessings rest upon my efforts.\n\nI also pray that You would give me the strength and perseverance to endure any setbacks in my job search, knowing that You are infinitely more capable than I am to provide me with a suitable job.\n\nThank You for Your steadfast love and unwavering commitment to care for Your children. I trust in Your providence and provision, and I give all the glory and honor to You.\n\nIn Jesus name, I pray,',1,'Dear Lord,\n\nI come before You with a humble heart, asking for Your divine guidance and intervention in my job search. I pray that You would lead me to a job that I would truly love, one that will enable me to use my talents and skills to the fullest.\n\nPlease grant me wisdom and discernment as I search for job openings, and open doors of opportunity for me through Your grace. Remove any obstacles that may hinder me from securing a good job, and may Your favor and blessings rest upon my efforts.\n\nI also pray that You would give me the strength and perseverance to endure any setbacks in my job search, knowing that You are infinitely more capable than I am to provide me with a suitable job.\n\nThank You for Your steadfast love and unwavering commitment to care for Your children. I trust in Your providence and provision, and I give all the glory and honor to You.\n\nIn Jesus name, I pray,',NULL),
(210,'Find a Job','openAI',NULL,'Find the right job','Dear God,\n\nI come to you with a heavy heart, seeking guidance and help in finding the right job. Please guide me towards a job that is fulfilling, rewarding and satisfies my needs. I trust in your divine wisdom and loving-kindness to provide me with the perfect job that I will enjoy and feel good about. \n\nMay you enlighten my mind and empower me to make the right decisions that will lead me to the job of my dreams. Bless me with the confidence to pursue this search with patience and determination, and the strength to overcome any obstacles that may come my way.\n\nThank you for your love and guidance. I know that with your help, I can find the job that I will love and enjoy.',1,'Dear God,\n\nI come to you with a heavy heart, seeking guidance and help in finding the right job. Please guide me towards a job that is fulfilling, rewarding and satisfies my needs. I trust in your divine wisdom and loving-kindness to provide me with the perfect job that I will enjoy and feel good about. \n\nMay you enlighten my mind and empower me to make the right decisions that will lead me to the job of my dreams. Bless me with the confidence to pursue this search with patience and determination, and the strength to overcome any obstacles that may come my way.\n\nThank you for your love and guidance. I know that with your help, I can find the job that I will love and enjoy.','UhNAxk1t.jpg'),
(211,'Victims in Ukraine','openAI',NULL,'Pray for victims of the Ukraine war.','Dear God,\n\nWe come to you with heavy hearts, praying for all the victims of the ongoing war in Ukraine. It breaks our hearts to see innocent people suffering because of the hatred and violence that plagues this region.\n\nWe pray for your comfort and healing to surround those who have lost loved ones, who have been injured or traumatized by the conflict. We ask that you provide them with the strength and courage they need to carry on through these challenging times.\n\nWe also pray for the leaders who have the power to bring peace to this region. May they be guided by your wisdom, compassion, and justice in their decisions and actions.\n\nWe pray for a resolution to this conflict that brings about lasting peace, justice, and reconciliation for all those affected.\n\nIn Jesus name, we pray.',1,'Dear God,\n\nWe come to you with heavy hearts, praying for all the victims of the ongoing war in Ukraine. It breaks our hearts to see innocent people suffering because of the hatred and violence that plagues this region.\n\nWe pray for your comfort and healing to surround those who have lost loved ones, who have been injured or traumatized by the conflict. We ask that you provide them with the strength and courage they need to carry on through these challenging times.\n\nWe also pray for the leaders who have the power to bring peace to this region. May they be guided by your wisdom, compassion, and justice in their decisions and actions.\n\nWe pray for a resolution to this conflict that brings about lasting peace, justice, and reconciliation for all those affected.\n\nIn Jesus name, we pray.',NULL),
(212,'Find someone to love','openAI',NULL,'Find someone to love','Dear God,\n\nI come to you with a humble heart, asking for your guidance and assistance in finding someone to love. Please help me to open my heart to the right person, who will cherish and love me for who I am. Grant me the patience to wait for the right person, and the courage to pursue them with honesty and purity of heart.\n\nFather, I know that your love is all-encompassing and that you have a perfect plan for my life. I pray that you lead me to the person who fits into that plan, who will complement me and be my lifetime partner.\n\nI trust in your wisdom and grace to guide me to the right path of love. Thank you, God, for your unconditional love and mercy. In Jesus name, I pray.\n',1,'Dear God,\n\nI come to you with a humble heart, asking for your guidance and assistance in finding someone to love. Please help me to open my heart to the right person, who will cherish and love me for who I am. Grant me the patience to wait for the right person, and the courage to pursue them with honesty and purity of heart.\n\nFather, I know that your love is all-encompassing and that you have a perfect plan for my life. I pray that you lead me to the person who fits into that plan, who will complement me and be my lifetime partner.\n\nI trust in your wisdom and grace to guide me to the right path of love. Thank you, God, for your unconditional love and mercy. In Jesus name, I pray.\n','R8GbzR24.jpg'),
(213,'Find someone to love','openAI',NULL,'Find someone to love','Dear God,\n\nI come to you today with an earnest request to find someone to love. Please guide me to the right person who will cherish, respect, and love me unconditionally. Help me to also be a loving and caring partner to this person and bless our relationship with your grace and wisdom.\n\nOpen my heart to love and help me to recognize when I have found the one. Grant me the courage to pursue and build a strong and healthy relationship with this special person.\n\nI trust that you will answer my prayer in your perfect timing and in your perfect way. I thank you in advance for your mercy and love.\n\nIn Jesus name.',1,'Dear God,\n\nI come to you today with an earnest request to find someone to love. Please guide me to the right person who will cherish, respect, and love me unconditionally. Help me to also be a loving and caring partner to this person and bless our relationship with your grace and wisdom.\n\nOpen my heart to love and help me to recognize when I have found the one. Grant me the courage to pursue and build a strong and healthy relationship with this special person.\n\nI trust that you will answer my prayer in your perfect timing and in your perfect way. I thank you in advance for your mercy and love.\n\nIn Jesus name.','0U2qTnC8.jpg'),
(214,'Struggle with Catholic Faith','openAI',NULL,'Struggle with Catholic faith','Dear Lord, I come to you humbly, seeking your guidance and your grace. I know that I struggle with my Catholic faith, and I ask that you help me to overcome these doubts and uncertainties. Help me to see the truth in your word, and to trust in your infinite wisdom and love for me. Give me the courage to explore my doubts and uncertainties openly and honestly, knowing that you are with me every step of the way. Please send the Holy Spirit to comfort and reassure me, and to help me find peace and strength in my faith. I pray that you will continue to guide me in all of my thoughts and actions, and that you will fill me with your grace and blessings.',1,'Dear Lord, I come to you humbly, seeking your guidance and your grace. I know that I struggle with my Catholic faith, and I ask that you help me to overcome these doubts and uncertainties. Help me to see the truth in your word, and to trust in your infinite wisdom and love for me. Give me the courage to explore my doubts and uncertainties openly and honestly, knowing that you are with me every step of the way. Please send the Holy Spirit to comfort and reassure me, and to help me find peace and strength in my faith. I pray that you will continue to guide me in all of my thoughts and actions, and that you will fill me with your grace and blessings.',NULL),
(215,'Struggle with Catholic Faith','openAI',NULL,'Confusion with Catholic Faith','Dear Heavenly Father,\n\nI come before you today to ask for your divine guidance and support in my struggle with my Catholic faith. I feel lost, confused, and at times even doubtful of the truths and teachings of the Church. Please help me to overcome my doubts and fears, and deepen my faith in you and in the teachings of the Catholic Church.\n\nGrant me the grace to seek out answers to my questions, and to be open to the wisdom of the saints, the Catechism, and the teachings of the Church. Give me the strength to persevere in prayer, and to trust in your holy will. May I be filled with the peace and joy that comes from knowing and living in your truth.\n\nBless me with the humility to recognize my limitations and to seek help when I need it, whether it be from a spiritual director, a priest, or a trusted friend. And may I always be a witness to your love and mercy, and share my faith with others with confidence and enthusiasm.\n\nWe ask this in the name of Jesus Christ, our Lord and Savior.\n',1,'Dear Heavenly Father,\n\nI come before you today to ask for your divine guidance and support in my struggle with my Catholic faith. I feel lost, confused, and at times even doubtful of the truths and teachings of the Church. Please help me to overcome my doubts and fears, and deepen my faith in you and in the teachings of the Catholic Church.\n\nGrant me the grace to seek out answers to my questions, and to be open to the wisdom of the saints, the Catechism, and the teachings of the Church. Give me the strength to persevere in prayer, and to trust in your holy will. May I be filled with the peace and joy that comes from knowing and living in your truth.\n\nBless me with the humility to recognize my limitations and to seek help when I need it, whether it be from a spiritual director, a priest, or a trusted friend. And may I always be a witness to your love and mercy, and share my faith with others with confidence and enthusiasm.\n\nWe ask this in the name of Jesus Christ, our Lord and Savior.\n',NULL),
(216,'Struggle with Catholic Faith','openAI',NULL,'Heavy heart about Catholic faith','Dear God,\n\nI come to you with a heavy heart as I struggle with my Catholic faith. I feel lost, unsure, and distant from your love. I know that your love for me is unfailing, but I find it hard to grasp and trust in.\n\nPlease guide me, Lord, and help me find my way back to you. Open my heart to the teachings of the Catholic Church and help me understand them better. Strengthen my faith and give me the courage to live it out every day, even when its hard.\n\nI ask for the intercession of the Holy Spirit to fill me with wisdom and understanding, so that I may deepen my relationship with you, O Lord. May Mary, our Mother, be my guide and lead me to her son, Jesus Christ.\n\nThank you for your unfailing love and mercy. In Jesus name, I pray.',1,'Dear God,\n\nI come to you with a heavy heart as I struggle with my Catholic faith. I feel lost, unsure, and distant from your love. I know that your love for me is unfailing, but I find it hard to grasp and trust in.\n\nPlease guide me, Lord, and help me find my way back to you. Open my heart to the teachings of the Catholic Church and help me understand them better. Strengthen my faith and give me the courage to live it out every day, even when its hard.\n\nI ask for the intercession of the Holy Spirit to fill me with wisdom and understanding, so that I may deepen my relationship with you, O Lord. May Mary, our Mother, be my guide and lead me to her son, Jesus Christ.\n\nThank you for your unfailing love and mercy. In Jesus name, I pray.',NULL),
(217,'Struggle with Catholic Faith','openAI',NULL,'Feel closer to God and Catholic faith','Dear God,\n\nI come to you with a heavy heart, struggling with my Catholic faith. I want to feel closer to you and to find certainty in my beliefs, but I am lost and confused. Please help me to strengthen my faith and to have a deeper understanding of your love and grace. Guide me in my journey towards spiritual growth and give me the courage to seek your will above all else. Fill me with your peace, wisdom and direction so that I may navigate the challenges of life with grace and faith. I trust in your love and protection, and I know that with you by my side, I can overcome any obstacle. Grant me the grace to trust in you, to commit myself to you, and to serve you with my whole heart.',1,'Dear God,\n\nI come to you with a heavy heart, struggling with my Catholic faith. I want to feel closer to you and to find certainty in my beliefs, but I am lost and confused. Please help me to strengthen my faith and to have a deeper understanding of your love and grace. Guide me in my journey towards spiritual growth and give me the courage to seek your will above all else. Fill me with your peace, wisdom and direction so that I may navigate the challenges of life with grace and faith. I trust in your love and protection, and I know that with you by my side, I can overcome any obstacle. Grant me the grace to trust in you, to commit myself to you, and to serve you with my whole heart.',NULL),
(219,'Blessings for Health','openAI',NULL,'Blessings for friend\'s health','Dear God,\nWe come before you today with a heavy heart, asking for your healing and guidance in the life of Jenny. We know that you have the power to heal and we ask for your divine intervention in her life. We pray that you will give wisdom to the doctors as they search for answers to her illness. We ask that you will comfort Carol and her family during this difficult time and give them the strength to endure. We pray for a miraculous healing in Jennys body and that she will be restored to full health. Above all, we pray for your will to be done in their lives, and ask that you give them peace and hope in the midst of their trial. We trust in your goodness and mercy, and thank you for hearing our prayers. \nIn Jesus name, we pray.',1,'Dear God,\nWe come before you today with a heavy heart, asking for your healing and guidance in the life of Jenny. We know that you have the power to heal and we ask for your divine intervention in her life. We pray that you will give wisdom to the doctors as they search for answers to her illness. We ask that you will comfort Carol and her family during this difficult time and give them the strength to endure. We pray for a miraculous healing in Jennys body and that she will be restored to full health. Above all, we pray for your will to be done in their lives, and ask that you give them peace and hope in the midst of their trial. We trust in your goodness and mercy, and thank you for hearing our prayers. \nIn Jesus name, we pray.\nAmen.','JGAO1ul9.jpg'),
(220,'Health and job','newPrayer',NULL,'Health and job','We come to you today to ask for your loving and healing presence in the lives of Jenny and Joey. We ask that you bless Jenny with good health, strength, and healing, and that you help her to recover from any illness or ailment that she may be facing. We pray that you grant her the energy and resilience she needs to move forward with grace and strength.\n\nWe also ask that you guide and support Joey as he searches for a new job closer to home. We pray that you provide him with opportunities that align with his skills, experience, and passions, and that you help him to find a fulfilling job that brings him joy and purpose.\n\nMay your light shine upon Jenny and Joey, and may they feel your love, comfort, and guidance throughout their journeys. We trust in your infinite wisdom and goodness, and we thank you for your unwavering love and grace.',1,'We come to you today to ask for your loving and healing presence in the lives of Jenny and Joey. We ask that you bless Jenny with good health, strength, and healing, and that you help her to recover from any illness or ailment that she may be facing. We pray that you grant her the energy and resilience she needs to move forward with grace and strength.\n\nWe also ask that you guide and support Joey as he searches for a new job closer to home. We pray that you provide him with opportunities that align with his skills, experience, and passions, and that you help him to find a fulfilling job that brings him joy and purpose.\n\nMay your light shine upon Jenny and Joey, and may they feel your love, comfort, and guidance throughout their journeys. We trust in your infinite wisdom and goodness, and we thank you for your unwavering love and grace.','\"\"undefined\"\"'),
(221,'Easter Blessing','openAI',NULL,'Easter season hearts of humility','Dear God,\n\nAs we approach this Easter season, we come to you with hearts full of love, hope, and gratitude. We ask that you bless this special time of year with peace and harmony for all.\n\nMay your grace and mercy reign down upon us and guide us to a place of understanding, compassion, and unity. Let us seek to love one another, to forgive those who have wronged us, and to be a light in the world.\n\nWe pray for those who are hurting, for those who are struggling, for those who are lost or alone. May they find hope and comfort in the knowledge that you are always with them.\n\nAbove all, we thank you for your unconditional love and for the greatest gift of all, your son Jesus Christ. May his sacrifice be a reminder of your love and a source of strength for us all.\n\nIt is in your holy name that we pray for peace and harmony this Easter and always.',1,'Dear God,\n\nAs we approach this Easter season, we come to you with hearts full of love, hope, and gratitude. We ask that you bless this special time of year with peace and harmony for all.\n\nMay your grace and mercy reign down upon us and guide us to a place of understanding, compassion, and unity. Let us seek to love one another, to forgive those who have wronged us, and to be a light in the world.\n\nWe pray for those who are hurting, for those who are struggling, for those who are lost or alone. May they find hope and comfort in the knowledge that you are always with them.\n\nAbove all, we thank you for your unconditional love and for the greatest gift of all, your son Jesus Christ. May his sacrifice be a reminder of your love and a source of strength for us all.\n\nIt is in your holy name that we pray for peace and harmony this Easter and always.','yKxKnfxE.jpg'),
(222,'Happy Easter','openAI',NULL,'Happy Easter prayer ','Dear God,\n\nWe come to you on this joyous occasion of Easter to thank you for the gift of salvation through Jesus Christ. We celebrate his victory over death and his resurrection, which brings hope and new life.\n\nWe pray that you bless all those who are celebrating Easter today, may they be surrounded by family and friends, and find comfort and joy in your love. May this day be a reminder of the abundant blessings that you have bestowed upon us.\n\nWe ask that you guide our thoughts, words, and actions so that we may always show your love and grace to others. May we spread joy and happiness to those around us and be a shining light in the world.\n\nWe thank you for this beautiful day, and we pray that it fills everyone\'s hearts with peace, hope, and gratitude. We ask this in the name of Jesus Christ, our Lord.\n',1,'Dear God,\n\nWe come to you on this joyous occasion of Easter to thank you for the gift of salvation through Jesus Christ. We celebrate his victory over death and his resurrection, which brings hope and new life.\n\nWe pray that you bless all those who are celebrating Easter today, may they be surrounded by family and friends, and find comfort and joy in your love. May this day be a reminder of the abundant blessings that you have bestowed upon us.\n\nWe ask that you guide our thoughts, words, and actions so that we may always show your love and grace to others. May we spread joy and happiness to those around us and be a shining light in the world.\n\nWe thank you for this beautiful day, and we pray that it fills everyones hearts with peace, hope, and gratitude. We ask this in the name of Jesus Christ, our Lord.\n\nAmen.','9ADGvWQf.jpg'),
(223,'Job Success','openAI',NULL,'Job interview success ','Dear God, please grant our request for our dear friend to find a job that is suitable for him. We pray that you will guide him in his upcoming interviews and give him the confidence and skills to shine above the rest. Please open the right doors for him and show him the path that will lead to success. May he find fulfillment in his work and experience your love and guidance every step of the way. In Jesus name we pray.',1,'Dear God, please grant our request for our dear friend to find a job that is suitable for him. We pray that you will guide him in his upcoming interviews and give him the confidence and skills to shine above the rest. Please open the right doors for him and show him the path that will lead to success. May he find fulfillment in his work and experience your love and guidance every step of the way. In Jesus name we pray, Amen.',NULL),
(224,'Increase Faith','openAI',NULL,'Increase faith ','Dear Heavenly Father,\n\nI come to you today to lift up the children and grandchildren of {{name}} who has requested our prayers. Lord, I pray that you shower them with your love, grace, and mercy. I pray that you keep them healthy and free from illness. Please protect them from all harm and danger.\n\nI also pray that you increase their faith in you. May they come to know you in a deeper way and trust in your plans for their lives. Help them to put their hope and trust in you, and to seek you in all things.\n\nFather, I know that you are good and that you hear our prayers. I pray that you answer this request according to your will. Please bless these children and grandchildren abundantly and let them feel your loving presence in their lives.\n\nIn Jesus name, I pray.',1,'Dear Heavenly Father,\n\nI come to you today to lift up the children and grandchildren of this person who has requested our prayers. Lord, I pray that you shower them with your love, grace, and mercy. I pray that you keep them healthy and free from illness. Please protect them from all harm and danger.\n\nI also pray that you increase their faith in you. May they come to know you in a deeper way and trust in your plans for their lives. Help them to put their hope and trust in you, and to seek you in all things.\n\nFather, I know that you are good and that you hear our prayers. I pray that you answer this request according to your will. Please bless these children and grandchildren abundantly and let them feel your loving presence in their lives.\n\nIn Jesus name, I pray. Amen.',NULL),
(225,'Heart Valve','openAI',NULL,'Prayer for heart valve operation. ','Dear God, we come to you in prayer, asking for healing and strength for {{name}}\'s father. Please remove the fluid from his lungs and guide the medical team who will be performing his heart valve surgery. Grant him the physical strength and energy he needs to continue to serve and help others, as this is his hearts desire. Comfort him, his family, and loved ones during this difficult time. We thank you, God, for your love and healing power. In Jesus name, we pray. ',1,'Dear God, we come to you in prayer, asking for healing and strength for this persons father. Please remove the fluid from his lungs and guide the medical team who will be performing his heart valve surgery. Grant him the physical strength and energy he needs to continue to serve and help others, as this is his hearts desire. Comfort him, his family, and loved ones during this difficult time. We thank you, God, for your love and healing power. In Jesus name, we pray. Amen.',NULL),
(226,'House sale','openAI',NULL,'Selling a house','Heavenly Father,\n\nWe come to You today seeking Your divine intervention in the life of Noman and his wife. We know that You hold the keys to every door of opportunity, and that includes the sale of their house in California.\n\nLord, we ask that You bless this couple with a quick and profitable sale of their home. We pray that You send the right buyer to their doorstep - someone who will appreciate the house and the effort they have put into it.\n\nWe ask that You grant them a fair price for their home and that You guide them through the entire process. We trust in Your wisdom and intervention, and we know that You will provide for all their needs.\n\nLord, we ask that You bless Noman and his family with peace and patience as they wait for Your timing. May they trust in Your ways and rest in the knowledge that You have their best interests at heart.\n\nWe give You all the glory and honor, Lord, for hearing our prayer and bringing about the perfect outcome for Noman and his family. We ask all this in Your holy name.',1,'Heavenly Father,\n\nWe come to You today seeking Your divine intervention in the life of Noman and his wife. We know that You hold the keys to every door of opportunity, and that includes the sale of their house in California.\n\nLord, we ask that You bless this couple with a quick and profitable sale of their home. We pray that You send the right buyer to their doorstep - someone who will appreciate the house and the effort they have put into it.\n\nWe ask that You grant them a fair price for their home and that You guide them through the entire process. We trust in Your wisdom and intervention, and we know that You will provide for all their needs.\n\nLord, we ask that You bless Noman and his family with peace and patience as they wait for Your timing. May they trust in Your ways and rest in the knowledge that You have their best interests at heart.\n\nWe give You all the glory and honor, Lord, for hearing our prayer and bringing about the perfect outcome for Noman and his family. We ask all this in Your holy name.\n\nAmen.',NULL),
(227,'Found a job','openAI',NULL,'Found a job','Dear Lord,\n\nThank you for hearing our prayer and providing a job for Sief. We are grateful for your kindness and blessing us with this opportunity that has brought us happiness. \n\nMay you continue to watch over him and guide him in this new chapter of his career. May he flourish and find fulfillment in his work, and may it bring him closer to you as he uses his talents for good. \n\nThank you again, Lord, for all the countless blessings you bestow upon us every day. Our faith in you strengthens us and we trust in your continued provision and guidance. \n\nIn Jesus’ name, we pray.',1,'Dear Lord,\n\nThank you for hearing our prayer and providing a job for my nephew, Sief. We are grateful for your kindness and blessing us with this opportunity that has brought us happiness. \n\nMay you continue to watch over him and guide him in this new chapter of his career. May he flourish and find fulfillment in his work, and may it bring him closer to you as he uses his talents for good. \n\nThank you again, Lord, for all the countless blessings you bestow upon us every day. Our faith in you strengthens us and we trust in your continued provision and guidance. \n\nIn Jesus’ name, we pray.\n\nAmen.','QuxLwufJ.jpg'),
(228,'Find a job','openAI',NULL,'Find a job','Dear God,\n\nWe come before you with a humble heart, seeking your guidance and blessings for {{name}} Andrew. He has been waiting for a long time to find a good job, and we ask that you bless him with a job that is fulfilling and suits his needs.\n\nHelp him to find a job where he can use his skills and talents to the fullest, and where he can contribute to society in a positive way. Give him strength and perseverance during the job search process, and help him to remain positive and confident.\n\nLord, we pray that your divine intervention will open doors for him and that he will receive your favor in abundance. We trust in your goodness, and we know that you will never leave him nor forsake him.\n\nThank you for hearing our prayers, and we believe that you will bring a good job his way soon. In Jesus name, we pray.',1,'Dear God,\n\nWe come before you with a humble heart, seeking your guidance and blessings for our son Andrew. He has been waiting for a long time to find a good job, and we ask that you bless him with a job that is fulfilling and suits his needs.\n\nHelp him to find a job where he can use his skills and talents to the fullest, and where he can contribute to society in a positive way. Give him strength and perseverance during the job search process, and help him to remain positive and confident.\n\nLord, we pray that your divine intervention will open doors for him and that he will receive your favor in abundance. We trust in your goodness, and we know that you will never leave him nor forsake him.\n\nThank you for hearing our prayers, and we believe that you will bring a good job his way soon. In Jesus name, we pray. Amen.','LnDVkKNx.jpg'),
(229,'Surgery','openAI',NULL,'Surgery','Dear Heavenly Father,\n\nWe come before you today to lift up a prayer for the ongoing recovery of {{name}}. We thank you for guiding the hands of the doctors during her surgery and we ask that you continue to watch over her, so that she may heal peacefully and without any complications.\n\nWe pray that any discomfort that she feels will soon be replaced with comfort and that her strength will be renewed. We ask that you grant her the courage and hope she needs to keep fighting and to keep her spirits high during this time of difficulty.\n\nPlease surround her with your love and the healing power of your grace. We pray that she will be restored to full health and experience a complete recovery.\n\nWe trust in your infinite wisdom and pray that you will provide her with the necessary strength and support to overcome this challenge. In Jesus name we pray.',1,'Dear Heavenly Father,\n\nWe come before you today to lift up a prayer for the ongoing recovery of our dear mother. We thank you for guiding the hands of the doctors during her surgery and we ask that you continue to watch over her, so that she may heal peacefully and without any complications.\n\nWe pray that any discomfort that she feels will soon be replaced with comfort and that her strength will be renewed. We ask that you grant her the courage and hope she needs to keep fighting and to keep her spirits high during this time of difficulty.\n\nPlease surround her with your love and the healing power of your grace. We pray that she will be restored to full health and experience a complete recovery.\n\nWe trust in your infinite wisdom and pray that you will provide her with the necessary strength and support to overcome this challenge. In Jesus name we pray, Amen.',NULL),
(234,'Jenny Illness','openAI',NULL,'Jenny, daughter of Carol','Dear God, we lift up Jenny, the daughter of Carol, to your loving and healing touch. We pray that you would grant her strength and courage as she faces her illness. We ask that you would guide doctors and nurses to find the cause of her illness and bring healing to her body. Lord, we ask that you would give Jenny and her family peace and comfort as they face this difficult time. We believe in your power to heal and trust in your goodness. We commit this request into your hands and ask for a complete recovery. In Jesus name, we pray. Amen.',1,'Dear God, we lift up Jenny, the daughter of Carol, to your loving and healing touch. We pray that you would grant her strength and courage as she faces her illness. We ask that you would guide doctors and nurses to find the cause of her illness and bring healing to her body. Lord, we ask that you would give Jenny and her family peace and comfort as they face this difficult time. We believe in your power to heal and trust in your goodness. We commit this request into your hands and ask for a complete recovery. In Jesus name, we pray. Amen.',NULL),
(235,'Mysterious Illness','openAI',NULL,'Jenny with a mysterious illness','Dear God,\n\nWe come to you with heavy hearts, praying for Jenny, who has been struggling with a mysterious illness for some time now. We ask for your divine intervention and healing touch to restore her health and bring her back to her normal state.\n\nWe pray that you guide the medical team caring for her to find a proper diagnosis and effective treatment. We ask that you bless them with wisdom and precision to make the right decisions for her care. We also pray for Carol and her family, that you fill them with strength, comfort, and peace during this difficult time.\n\nPlease give Jenny the courage to endure whatever lies ahead, and surround her with your love, comfort, and healing. May she feel your presence and know that you are there, guiding her every step of the way. We trust in your divine power and believe that you have the ultimate plan for her.\n\nWe pray for a miraculous healing, and we thank you for the love, blessings, and guidance you provide.\n\nAmen.',1,'Dear God,\n\nWe come to you with heavy hearts, praying for Jenny, who has been struggling with a mysterious illness for some time now. We ask for your divine intervention and healing touch to restore her health and bring her back to her normal state.\n\nWe pray that you guide the medical team caring for her to find a proper diagnosis and effective treatment. We ask that you bless them with wisdom and precision to make the right decisions for her care. We also pray for Carol and her family, that you fill them with strength, comfort, and peace during this difficult time.\n\nPlease give Jenny the courage to endure whatever lies ahead, and surround her with your love, comfort, and healing. May she feel your presence and know that you are there, guiding her every step of the way. We trust in your divine power and believe that you have the ultimate plan for her.\n\nWe pray for a miraculous healing, and we thank you for the love, blessings, and guidance you provide.\n\nAmen.',NULL),
(238,'Christmas','openAI',NULL,'Pray as a community at Christmas','Dear heavenly Father,\n\nWe come before you with thankful hearts and grateful souls to celebrate Christmas as a prayerful community. We thank you for the support and blessings you have showered on us through the yearlong journey of Pray Over Us. We are grateful for your love, mercy, and grace that continually guide us.\n\nDear Lord, as we celebrate Christmas, we pray for the world to experience peace, love, and unity as we commemorate the birth of Jesus Christ, our Savior. We pray that you bless every member of this community with joy, happiness, and a renewed hope as we enter the new year. May your presence light up our hearts and homes with the true meaning of Christmas - the miracle of your love and salvation.\n\nWe pray that we continue to support and uplift one another as we journey through life with our eyes fixed on you. May we be a shining light that points people towards your love and mercy. We ask for your protection, strength, and grace to sustain us today and always.\n\nWe offer our prayers and gratitude to you, Lord, through the name of Jesus Christ, our Savior. Amen.',1,'Dear heavenly Father,\n\nWe come before you with thankful hearts and grateful souls to celebrate Christmas as a prayerful community. We thank you for the support and blessings you have showered on us through the yearlong journey of Pray Over Us. We are grateful for your love, mercy, and grace that continually guide us.\n\nDear Lord, as we celebrate Christmas, we pray for the world to experience peace, love, and unity as we commemorate the birth of Jesus Christ, our Savior. We pray that you bless every member of this community with joy, happiness, and a renewed hope as we enter the new year. May your presence light up our hearts and homes with the true meaning of Christmas - the miracle of your love and salvation.\n\nWe pray that we continue to support and uplift one another as we journey through life with our eyes fixed on you. May we be a shining light that points people towards your love and mercy. We ask for your protection, strength, and grace to sustain us today and always.\n\nWe offer our prayers and gratitude to you, Lord, through the name of Jesus Christ, our Savior. Amen.',NULL),
(239,'Christmas','openAI',NULL,'Celebrate the birth of Jesus','Heavenly Father,\n\nAs we gather together as a prayerful community to celebrate the birth of your son, Jesus Christ, we give you thanks for the blessings that we have received throughout this year. We thank you for the love and support that we have received from one another, and for the opportunities to spread your light and love to those around us.\n\nAs we enter into this Christmas season, we pray that you would fill our hearts with joy and peace. We pray that we would be reminded of the true meaning of Christmas, and that we would be inspired to live out your love and grace in all that we do.\n\nWe ask that you would continue to bless Pray Over Us, and that you would use this community to bring hope, healing, and encouragement to those who need it most. We ask that you would guide us in all that we do, and that you would give us the strength and wisdom to remain faithful to your will and purpose.\n\nWe thank you again for this beautiful community, and for the opportunity to celebrate Christmas together as brothers and sisters in Christ. May your light shine brightly in our lives, and may we continue to grow in faith and love in the coming year.\n\nIn Jesus name we pray, Amen.',1,'Heavenly Father,\n\nAs we gather together as a prayerful community to celebrate the birth of your son, Jesus Christ, we give you thanks for the blessings that we have received throughout this year. We thank you for the love and support that we have received from one another, and for the opportunities to spread your light and love to those around us.\n\nAs we enter into this Christmas season, we pray that you would fill our hearts with joy and peace. We pray that we would be reminded of the true meaning of Christmas, and that we would be inspired to live out your love and grace in all that we do.\n\nWe ask that you would continue to bless Pray Over Us, and that you would use this community to bring hope, healing, and encouragement to those who need it most. We ask that you would guide us in all that we do, and that you would give us the strength and wisdom to remain faithful to your will and purpose.\n\nWe thank you again for this beautiful community, and for the opportunity to celebrate Christmas together as brothers and sisters in Christ. May your light shine brightly in our lives, and may we continue to grow in faith and love in the coming year.\n\nIn Jesus name we pray, Amen.',NULL),
(240,'September 11','openAI',NULL,'Tragic events of September 11','Dear God, we come to you today remembering the tragic events of September 11, 2001. We pray for all those who lost loved ones, for all those who were injured, and for all those who were affected by this unthinkable tragedy. We pray for their healing, both physical and emotional. We pray that you will give them peace and comfort in the midst of their pain. Lord, we ask that you help us never forget the sacrifices made by those who lost their lives that day, and the bravery shown by those who risked their lives to help others. We pray for your continued guidance and protection for our country, and for all those who work tirelessly to keep us safe. Please be with us today and always. Amen.',1,'Dear God, we come to you today remembering the tragic events of September 11, 2001. We pray for all those who lost loved ones, for all those who were injured, and for all those who were affected by this unthinkable tragedy. We pray for their healing, both physical and emotional. We pray that you will give them peace and comfort in the midst of their pain. Lord, we ask that you help us never forget the sacrifices made by those who lost their lives that day, and the bravery shown by those who risked their lives to help others. We pray for your continued guidance and protection for our country, and for all those who work tirelessly to keep us safe. Please be with us today and always. Amen.',NULL),
(241,'Test','openAI',NULL,'Help me through this test','Dear Lord,\n\nAs {{name}} comes before you today, {{gender2}} asks for your help in guiding {{gender2}}  through this test. Please grant {{gender3}} wisdom, knowledge, and understanding to comprehend each question and answer accurately. May your divine assistance be with {{name}} as {{gender2}} writes {{gender1}} responses, and may the feeling of anxiety and worry be replaced by peace of mind and confidence that {{gender2}} can succeed. Guide {{name}} to recall all that {{gender2}} has learned, and help {{gender3}} to focus on the task before me. Lord, please bless the work of {{gender1}} hands and the thoughts of {{gender1}} mind during this test, and may {{gender1}} performance be a reflection of {{gender1}} commitment to excellence. Thank you for hearing my prayers. In Jesus name, I pray.',1,'Dear Lord,\n\nAs I come before you today, I ask for your help in guiding me through this test. Please grant me wisdom, knowledge, and understanding to comprehend each question and answer accurately. May your divine assistance be with me as I write my responses, and may the feeling of anxiety and worry be replaced by peace of mind and confidence that I can succeed. Guide me to recall all that I have learned, and help me to focus on the task before me. Lord, please bless the work of my hands and the thoughts of my mind during this test, and may my performance be a reflection of my commitment to excellence. Thank you for hearing my prayers. In Jesus name, I pray.',NULL),
(242,'Find job','openAI',NULL,'Find job','Heavenly Father,\n\nI come to you with a heavy heart and ask for your divine intervention in the life of {{name}}. He is in need of finding a job that will fulfill his needs and give him purpose.\n\nLord, I know that you have a plan for his life, and I pray that you will guide him in the right direction. Give him the strength and perseverance to keep searching and the confidence to know that he will find the perfect job.\n\nFather, I ask that you open doors of opportunity for him and provide him with the resources he needs to succeed. May he be filled with hope and faith in your promises, knowing that you are the ultimate provider.\n\nThank you, Lord, for hearing my prayer and for your constant love and guidance. I know that with your help, my nephew will find the job he is waiting for.',1,'Heavenly Father,\n\nI come to you with a heavy heart and ask for your divine intervention in the life of my nephew. He is in need of finding a job that will fulfill his needs and give him purpose.\n\nLord, I know that you have a plan for his life, and I pray that you will guide him in the right direction. Give him the strength and perseverance to keep searching and the confidence to know that he will find the perfect job.\n\nFather, I ask that you open doors of opportunity for him and provide him with the resources he needs to succeed. May he be filled with hope and faith in your promises, knowing that you are the ultimate provider.\n\nThank you, Lord, for hearing my prayer and for your constant love and guidance. I know that with your help, my nephew will find the job he is waiting for.','1TPLAvxK.jpg'),
(243,'Harmony with Family Members','openAI',NULL,'End to conflict between family members','Dear God,\n\nWe come to you today with heavy hearts as we ask for your intervention and guidance in resolving the issues that are causing division among {{name}}\'s family members. We know that you desire for us to live in peace and harmony, and we trust in your ability to bring healing to our relationships.\n\nWe pray that you would soften their hearts towards one another and grant them the humility and grace to seek reconciliation. Give them the strength and wisdom to resolve their differences with love and patience, and to put aside any hurt or bitterness that may be hindering their progress.\n\nWe ask that you would bless them with your peace, which surpasses all understanding, and give them the courage to move forward in unity and forgiveness. Help them to focus on their shared love for one another and to build bridges of trust and understanding that will endure for a lifetime.\n\nWe thank you for hearing my prayer and for your constant presence in our lives. May your Holy Spirit guide {{name}}\'s family as they work towards a resolution, and may your love shine upon them always.\n\nIn Jesus name we pray.',1,'Dear God,\n\nWe come to you today with heavy hearts as we ask for your intervention and guidance in resolving the issues that are causing division among our family members. We know that you desire for us to live in peace and harmony, and we trust in your ability to bring healing to our relationships.\n\nWe pray that you would soften our hearts towards one another and grant us the humility and grace to seek reconciliation. Give us the strength and wisdom to resolve our differences with love and patience, and to put aside any hurt or bitterness that may be hindering our progress.\n\nWe ask that you would bless us with your peace, which surpasses all understanding, and give us the courage to move forward in unity and forgiveness. Help us to focus on our shared love for one another and to build bridges of trust and understanding that will endure for a lifetime.\n\nWe thank you for hearing our prayer and for your constant presence in our lives. May your Holy Spirit guide us as we work towards a resolution, and may your love shine upon us always.\n\nIn Jesus name we pray.','27TpTzPq.jpg'),
(244,'Courage','openAI',NULL,'Give us courage','Dear God,\n\nAs we come to you in prayer, we acknowledge that your plans and will are greater than our own. Help us to let go of our own desires and instead trust in your perfect plan for our lives.\n\nMay we not be driven by fear, but rather by faith and love. Help us to remember that prayer is not a burden, but a blessing that allows us to commune with you.\n\nMay our hearts be open to your will and our minds be receptive to your guidance. Help us to trust in your goodness and to have the courage to follow where you lead.\n\nWe pray, \"Fiat Voluntas Dei.\" May your will be done in our lives, now and always.',1,'Dear God,\n\nAs we come to you in prayer, we acknowledge that your plans and will are greater than our own. Help us to let go of our own desires and instead trust in your perfect plan for our lives.\n\nMay we not be driven by fear, but rather by faith and love. Help us to remember that prayer is not a burden, but a blessing that allows us to commune with you.\n\nMay our hearts be open to your will and our minds be receptive to your guidance. Help us to trust in your goodness and to have the courage to follow where you lead.\n\nWe pray, \"Fiat Voluntas Dei.\" May your will be done in our lives, now and always.','BfI7tVSs.jpg'),
(245,'Heart Valve Replacement','openAI',NULL,'Heart valve replacement and pacemaker','Lord, we come before you today with grateful hearts for the continued recovery of {{name}}. We thank you for the successful heart surgery and for the skilled doctors and nurses who assisted during the procedure. We ask that you continue to touch his body with healing hands and give him strength and energy each day. We pray for his complete recovery and for the pacemaker to function properly, ensuring his heart beats as it should. Grant him peace, comfort, and an abundance of hope during this time. We also pray for the visiting nurses who care for him, that you would bless them with wisdom, knowledge, and compassion as they attend to his needs. We ask all these things in your precious name.',1,'Lord, I come before you today a grateful heart for the continued recovery of my dear father. I thank you for the successful heart surgery and for the skilled doctors and nurses who assisted during the procedure. I ask that you continue to touch his body with healing hands and give him strength and energy each day. I pray for his complete recovery and for the pacemaker to function properly, ensuring his heart beats as it should. Grant him peace, comfort, and an abundance of hope during this time. I also pray for the visiting nurses who care for him, that you would bless them with wisdom, knowledge, and compassion as they attend to his needs. I ask all these things in your precious name.',NULL),
(246,'Job','openAI',NULL,'Found a job','Dear God,\n\nWe come before you with grateful hearts, thanking you for answering our prayers and providing a job for {{name}}. We recognize that all blessings come from you, and we are truly grateful for this one.\n\nWe praise you, God, for your mercy and grace. We thank you for opening doors and providing opportunities for {{name}} to connect with this employer. We pray that you continue to watch over {{name}} and bless him in all that he does. May his new job be a source of fulfillment and purpose in his life, and may he be a shining example of your love and grace in the workplace.\n\nWe ask that you guide him in all his endeavors and bless his efforts. May he continue to walk in your ways and be a faithful servant to you, oh Lord. Give him strength and wisdom to perform his duties to the best of his abilities and to honor you with his work.\n\nWe pray that you continue to bless {{name}} and his family with good health, happiness, and love. Help us all to walk in your ways and to seek your guidance in all that we do.\n',1,'Dear God,\n\nWe come before you with grateful hearts, thanking you for answering our prayers and providing a job for Fahd, our beloved nephew. We recognize that all blessings come from you, and we are truly grateful for this one.\n\nWe praise you, God, for your mercy and grace. We thank you for opening doors and providing opportunities for Fahd to connect with this employer. We pray that you continue to watch over Fahd and bless him in all that he does. May his new job be a source of fulfillment and purpose in his life, and may he be a shining example of your love and grace in the workplace.\n\nWe ask that you guide him in all his endeavors and bless his efforts. May he continue to walk in your ways and be a faithful servant to you, oh Lord. Give him strength and wisdom to perform his duties to the best of his abilities and to honor you with his work.\n\nWe pray that you continue to bless Fahd and his family with good health, happiness, and love. Help us all to walk in your ways and to seek your guidance in all that we do.\n\nIn Jesus name, we pray, Amen.',NULL),
(247,'Blessing for Moms','openAI',NULL,'Mothers Day blessing','Dear Lord,\n\nWe come before you to give thanks and praise for the wonderful mothers in our lives. We thank you for the care, love and attention they provide to their children, dependents, and pets. Give them the strength, courage and patience to continue to do this important work of nurturing, teaching and guiding their children to become responsible, loving and caring members of society.\n\nPlease bless all mothers this Mothers Day and help them to feel appreciated and loved. May they be reminded of the importance of their role and the impact they have on their children\'s lives. We ask that you would surround them with your love and support and bless them with health, happiness and prosperity.\n\nThank you, Lord, for every mother who selflessly gives of herself every day, and for the gift of motherhood itself. We lift up these mothers to you and ask that you continue to bless them now and always. \n\nIn your name we pray.',1,'Dear Lord,\n\nWe come before you to give thanks and praise for the wonderful mothers in our lives. We thank you for the care, love and attention they provide to their children, dependents, and pets. Give them the strength, courage and patience to continue to do this important work of nurturing, teaching and guiding their children to become responsible, loving and caring members of society.\n\nPlease bless all mothers this Mothers Day and help them to feel appreciated and loved. May they be reminded of the importance of their role and the impact they have on their children\'s lives. We ask that you would surround them with your love and support and bless them with health, happiness and prosperity.\n\nThank you, Lord, for every mother who selflessly gives of herself every day, and for the gift of motherhood itself. We lift up these mothers to you and ask that you continue to bless them now and always. \n\nIn your name we pray.','EgusQ6ja.jpg'),
(248,'Rosa our grandmother','openAI',NULL,'Rosa our grandmother','Dear God, we come before you today with hearts overflowing with gratitude for the life of Rosa, our beloved grandma, who met you in 1988 at the astounding age of 110. We thank you for the long and fulfilling life you blessed her with, and for the precious memories she left us with. \n\nLord, we ask that you embrace grandma Rosa with your love and grace in your kingdom. We pray that she may experience eternal peace, happiness, and bliss. We also pray that you comfort our family and loved ones who grieve her loss. \n\nWe thank you for the incredible example of life and faith that grandma Rosa has left for us. May her life inspire us to live selflessly, love unconditionally, and seek your face continually. \n\nWe ask this in your precious and holy name.',1,'Dear God, I come before you today my heart overflowing with gratitude for the life of Rosa, my beloved grandma, who met you in 1988 at the astounding age of 110. I thank you for the long and fulfilling life you blessed her with, and for the precious memories she left me with. \n\nLord, I ask that you embrace grandma Rosa with your love and grace in your kingdom. I pray that she may experience eternal peace, happiness, and bliss. I also pray that you comfort our family and loved ones who grieve her loss. \n\nI thank you for the incredible example of life and faith that grandma Rosa has left for me. May her life inspire me to live selflessly, love unconditionally, and seek your face continually. \n\nWe ask this in your precious and holy name.',NULL),
(249,'Raising our family','openAI',NULL,'Raising our family','Dear God,\n\nOn this special day, we lift up in prayer the mother of our children and grandchildren. We thank you for her love, guidance, and constant sacrifices in raising our family.\n\nPlease bless her with your grace, strength, and wisdom as she continues to navigate through motherhood. May she always feel your presence and guidance in her life.\n\nWe ask that you continue to bless our family with love, joy, and peace. May our hearts always be filled with gratitude and appreciation for the gift of motherhood.\n\nOn this Mothers Day, we honor and celebrate the mother of our children and grandchildren. May she be showered with love, affection, and appreciation today and always.\n\nIn Jesus name we pray,\n\nAmen.',1,'Dear God,\n\nOn this special day, we lift up in prayer the mother of our children and grandchildren. We thank you for her love, guidance, and constant sacrifices in raising our family.\n\nPlease bless her with your grace, strength, and wisdom as she continues to navigate through motherhood. May she always feel your presence and guidance in her life.\n\nWe ask that you continue to bless our family with love, joy, and peace. May our hearts always be filled with gratitude and appreciation for the gift of motherhood.\n\nOn this Mothers Day, we honor and celebrate the mother of our children and grandchildren. May she be showered with love, affection, and appreciation today and always.\n\nIn Jesus name we pray,\n\nAmen.',NULL),
(250,'special mom\'s','newPrayer',NULL,'special\'s mom','Dear God,\n\nOn this special day, we come before you with hearts full of gratitude and love. We ask that you bless {{name}} of 3 children and 2 grandchildren with happiness, health, and love.\n\nThank you for the gift of motherhood, which brings joy, laughter, and purpose to our lives. May this day be filled with special moments and cherished memories for the mother of our children, and may she know how much she is loved and appreciated.\n\nWe ask that you continue to guide her, protect her, and bless her with the strength, wisdom, and patience to handle all the challenges that come her way. May she continue to be a role model and inspiration to her family and all those around her.\n\nDear God, we offer this prayer to you with grateful hearts and thank you for the gift of motherhood.',1,'Dear God,\n\nOn this special day, I come before you with hearts full of gratitude and love. I ask that you bless my wife and mother of 3 children and 2 grandchildren with happiness, health, and love.\n\nThank you for the gift of motherhood, which brings joy, laughter, and purpose to our lives. May this day be filled with special moments and cherished memories for my wife and mother of our children, and may she know how much she is loved and appreciated.\n\nWe ask that you continue to guide her, protect her, and bless her with the strength, wisdom, and patience to handle all the challenges that come her way. May she continue to be a role model and inspiration to her family and all those around\'s her.\n\nDear God, we offer this prayer to you with grateful hearts and thank you for the gift of motherhood. Amen.',NULL),
(251,'special mom','openAI',NULL,'special mom','Dear God, today we honor and remember Farideh Ireifej, a wonderful mother who is now with you in heaven. We thank you for the blessings she brought to our lives and the memories we hold dear. As we celebrate Mothers Day, we ask you to bless her soul and grant her eternal peace and rest. May her legacy live on through her family, and may we continue to cherish the love she shared with us while she was here on earth.',1,'Dear God, today I honor and remember Farideh Ireifej, my wonderful mother who is now with you in heaven. I thank you for the blessings she brought to my life and the memories I hold dear. As I celebrate Mothers Day, I ask you to bless her soul and grant her eternal peace and rest. May her legacy live on through her family, and may we continue to cherish the love she shared with us while she was here on earth.',NULL),
(252,'New house','openAI',NULL,'Repeat prayer and new house','Heavenly Father, we come to you today with a humble heart and a prayer of request. We know that repetition of prayer is powerful and that you hear every prayer that we offer up to you.\n\nToday, we ask for your guidance and support as our dear brother Noman seeks to sell his house in California and consider moving his family to Texas. Lord, we ask that you provide him with the clarity and wisdom to make the right decision for himself and his family.\n\nWe pray that you bless him with a successful sale and a smooth transition to his new home, and that you surround him with peace, comfort, and abundance throughout the process.\n\nMay your loving presence be felt by Noman and his family, and may they feel your loving embrace and support every step of the way. In Jesus holy name, we pray.',1,'Heavenly Father, we come to you today with a humble heart and a prayer of request. We know that repetition of prayer is powerful and that you hear every prayer that we offer up to you.\n\nToday, we ask for your guidance and support as our dear brother Noman seeks to sell his house in California and consider moving his family to Texas. Lord, we ask that you provide him with the clarity and wisdom to make the right decision for himself and his family.\n\nWe pray that you bless him with a successful sale and a smooth transition to his new home, and that you surround him with peace, comfort, and abundance throughout the process.\n\nMay your loving presence be felt by Noman and his family, and may they feel your loving embrace and support every step of the way. In Jesus holy name, we pray.',NULL),
(253,'Farewell to a Priest','openAI',NULL,'saying goodbye to a priest as he moves on to a different church','Dear God,\n\nWe come to you to ask for your blessings for Fr. Al as he embarks on a new journey. We ask that you grant him all the strength and grace he needs to transition smoothly from Saint Benedict Catholic Church.\n\nWe also ask that you watch over him and grant him wisdom and guidance in his new chapter. Let him feel your presence every step of the way, and let him know that he is loved and valued.\n\nWe thank you for the time that Fr. Al dedicated to Saint Benedict Catholic Church, and we pray that his legacy continues to be felt for many generations to come.\n\nMay he be filled with joy, peace, and fulfillment as he pursues his new path, and may he always be guided by your hand.\n\nWe ask this in Jesus name.',1,'Dear God,\n\nWe come to you to ask for your blessings for Fr. Al as he embarks on a new journey. We ask that you grant him all the strength and grace he needs to transition smoothly from Saint Benedict Catholic Church.\n\nWe also ask that you watch over him and grant him wisdom and guidance in his new chapter. Let him feel your presence every step of the way, and let him know that he is loved and valued.\n\nWe thank you for the time that Fr. Al dedicated to Saint Benedict Catholic Church, and we pray that his legacy continues to be felt for many generations to come.\n\nMay he be filled with joy, peace, and fulfillment as he pursues his new path, and may he always be guided by your hand.\n\nWe ask this in Jesus name.',NULL),
(254,'Cousin Christine','openAI',NULL,'Cousin Christine fighting for her life','Dear Heavenly Father,\n\nWe come to You with heavy hearts, praying for our dear cousin Christine who is fighting for her life. We ask for Your healing power to be upon her, Lord, and to keep her free from pain throughout her journey.\n\nWe trust in Your love and faithfulness, and we know that You are able to do miracles. We pray that You will give Christine the strength she needs to keep fighting and to always feel Your presence by her side.\n\nGrant peace and comfort to Christine\'s family and loved ones, as they stand by her during this difficult time. We ask that You surround them with Your love and comfort, and give them the hope and assurance they need to trust in Your plan.\n\nIn Jesus name, we pray.',1,'Dear Heavenly Father,\n\nI come to You with a heavy heart, praying for my dear cousin Christine who is fighting for her life. I ask for Your healing power to be upon her, Lord, and to keep her free from pain throughout her journey.\n\nI trust in Your love and faithfulness, and I know that You are able to do miracles. I pray that You will give Christine the strength she needs to keep fighting and to always feel Your presence by her side.\n\nGrant peace and comfort to Christine\'s family and loved ones, as they stand by her during this difficult time. I ask that You surround them with Your love and comfort, and give them the hope and assurance they need to trust in Your plan.\n\nIn Jesus name, we pray.\n\nAmen.',NULL),
(255,'Passing of Ambassador','openAI',NULL,'Passing of Ambassador','Dear God,\n\nWe come before you today with heavy hearts as we mourn the passing of our dear cousins son. We are devastated for the loss of this young man, who had a promising career ahead of him as the USA Ambassador to a country in the Middle East.\n\nLord, we pray for comfort and strength for the family during this difficult time. May they experience your peace that surpasses all understanding. Help them to trust in your plan and to feel your love as they navigate through this season of grief.\n\nWe ask that you bless and comfort the people of the country that he was to represent. Help them to know that he had the best intentions for their country, and that his dreams and aspirations were cut short.\n\nWe pray that you grant the departed soul eternal rest. May he rest in your loving arms and bask in the glory of your presence. We know that he will be missed by all who knew him, but we also know that you will comfort and console them as they grieve this loss.\n\nWe pray for those who are injured in such incidents and for the safety of all your children who go out for their daily exercise. May they always be protected and guided by your hand.\n\nWe ask all these things in your holy and precious name.',1,'Dear God,\n\nWe come before you today with heavy hearts as we mourn the passing of our dear cousins son. We are devastated for the loss of this young man, who had a promising career ahead of him as the USA Ambassador to a country in the Middle East.\n\nLord, we pray for comfort and strength for the family during this difficult time. May they experience your peace that surpasses all understanding. Help them to trust in your plan and to feel your love as they navigate through this season of grief.\n\nWe ask that you bless and comfort the people of the country that he was to represent. Help them to know that he had the best intentions for their country, and that his dreams and aspirations were cut short.\n\nWe pray that you grant the departed soul eternal rest. May he rest in your loving arms and bask in the glory of your presence. We know that he will be missed by all who knew him, but we also know that you will comfort and console them as they grieve this loss.\n\nWe pray for those who are injured in such incidents and for the safety of all your children who go out for their daily exercise. May they always be protected and guided by your hand.\n\nWe ask all these things in your holy and precious name.',NULL),
(256,'Presentation','openAI',NULL,'Grandson Joseph and Presentation','Dear Lord,\n\nWe come to you with a humble heart and ask for your blessing upon {{name}}\'s grandson Joseph. He has an important presentation tomorrow that will affect his future, and we ask for your guidance and wisdom to be with him.\n\nPlease calm his nerves and give him the confidence he needs to present his material with clarity and conviction. May he be able to articulate his thoughts and ideas with ease and make a positive impact on his audience.\n\nWe pray that you bless his efforts with a successful outcome. May his hard work and dedication receive the recognition it deserves, and may doors of opportunity open for him as he moves forward in his life.\n\nMay he feel your presence and love surrounding him, and may he be reminded that he is not alone. We entrust him to your care and ask that you watch over him throughout this process.\n\nIn Jesus name, we pray.',1,'Dear Lord,\n\nWe come to you with a humble heart and ask for your blessing upon our grandson Joseph. He has an important presentation tomorrow that will affect his future, and we ask for your guidance and wisdom to be with him.\n\nPlease calm his nerves and give him the confidence he needs to present his material with clarity and conviction. May he be able to articulate his thoughts and ideas with ease and make a positive impact on his audience.\n\nWe pray that you bless his efforts with a successful outcome. May his hard work and dedication receive the recognition it deserves, and may doors of opportunity open for him as he moves forward in his life.\n\nMay he feel your presence and love surrounding him, and may he be reminded that he is not alone. We entrust him to your care and ask that you watch over him throughout this process.\n\nIn Jesus name, we pray.',NULL),
(257,'Paul','openAI',NULL,'Prayer for Saint Paul','Heavenly Father,\n\nOn this special day, we lift up our prayers for your son Paul and all those who bear the names of St. Paul and St. Peter. We ask for your divine protection and guidance to be bestowed upon him. Strengthen him with the wisdom and courage to follow your will in every aspect of his life.\n\nLord, we entrust Paul into your loving arms, asking that you watch over him amidst lifes challenges and temptations. Shield him from harm and guide him in making choices that align with your perfect plan for his life. Grant him discernment and clarity as he navigates his path, and surround him with supportive and uplifting companions who will steer him closer to You.\n\nWe also pray for all individuals named Paul and Peter, that they may experience your divine love and grace. Safeguard them from any harm, physical or spiritual. Illuminate their minds and renew their spirits, that they may faithfully serve you and be an inspiration to others.\n\nWe remember the steadfast faith and dedication of St. Paul and St. Peter, who devoted their lives to spreading your message of love and redemption. May their intercession strengthen and inspire all those who bear their names, granting them the courage to boldly live out their faith.\n\nIn your infinite mercy, Lord, we entrust our prayers to you, believing wholeheartedly in your unwavering love and care. May your Holy Spirit guide Paul and all individuals with the names of Paul and Peter, leading them on a path that glorifies your name.\n\nWe ask all these things in the name of your Son, Jesus Christ, who lives and reigns with you and the Holy Spirit, one God, forever and ever.',1,'Heavenly Father,\n\nOn this special day, we lift up our prayers for your son Paul and all those who bear the names of St. Paul and St. Peter. We ask for your divine protection and guidance to be bestowed upon him. Strengthen him with the wisdom and courage to follow your will in every aspect of his life.\n\nLord, we entrust Paul into your loving arms, asking that you watch over him amidst lifes challenges and temptations. Shield him from harm and guide him in making choices that align with your perfect plan for his life. Grant him discernment and clarity as he navigates his path, and surround him with supportive and uplifting companions who will steer him closer to You.\n\nWe also pray for all individuals named Paul and Peter, that they may experience your divine love and grace. Safeguard them from any harm, physical or spiritual. Illuminate their minds and renew their spirits, that they may faithfully serve you and be an inspiration to others.\n\nWe remember the steadfast faith and dedication of St. Paul and St. Peter, who devoted their lives to spreading your message of love and redemption. May their intercession strengthen and inspire all those who bear their names, granting them the courage to boldly live out their faith.\n\nIn your infinite mercy, Lord, we entrust our prayers to you, believing wholeheartedly in your unwavering love and care. May your Holy Spirit guide Paul and all individuals with the names of Paul and Peter, leading them on a path that glorifies your name.\n\nWe ask all these things in the name of your Son, Jesus Christ, who lives and reigns with you and the Holy Spirit, one God, forever and ever.',NULL),
(258,'Travel to Europe','openAI',NULL,'Travel to Europe','Dear Heavenly Father, \n\nWe come before you today with grateful hearts, thanking you for {{name}}\'s opportunity to embark on this journey to Europe with {{gender1}} family. We acknowledge that you are the ultimate protector, and we humbly ask for your divine intervention and guidance as {{gender2}} embarks on this flight.\n\nLord, we place our complete trust in you and ask that you oversee every detail of {{name}}\'s travel. Surround their aircraft with your loving arms, ensuring a safe and smooth journey from takeoff to landing. Calm {{gender1}} fears and anxieties, replacing them with your peace that surpasses all understanding.\n\nWe pray for the health and well-being of each member of {{name}}\'s family throughout this trip. Protect {{gender3}} from any illness or harm, both on the plane and during their time abroad. Grant them strength, vitality, and resilience to enjoy every moment and experience in good health.\n\nHeavenly Father, we also pray for the pilots and the entire flight crew. Grant them wisdom, skill, and discernment as they navigate and oversee their flight. Guide their actions, decisions, and judgment so that they may carry everyone safely and securely to their destination.\n\nMay their time in Europe be filled with joy, discovery, and enriching experiences, but above all, may it be marked by your presence and protection. Lead them to encounter friendly and helpful faces throughout our journey and bless them with memorable moments that will create lifelong memories.\n\nIn your magnificent and loving name, we pray.',1,'Dear Heavenly Father, \n\nWe come before you today with grateful hearts, thanking you for the opportunity to embark on this journey to Europe with my family. We acknowledge that you are the ultimate protector, and we humbly ask for your divine intervention and guidance as we embark on this flight.\n\nLord, we place our complete trust in you and ask that you oversee every detail of our travel. Surround our aircraft with your loving arms, ensuring a safe and smooth journey from takeoff to landing. Calm our fears and anxieties, replacing them with your peace that surpasses all understanding.\n\nWe pray for the health and well-being of each member of our family throughout this trip. Protect us from any illness or harm, both on the plane and during our time abroad. Grant us strength, vitality, and resilience to enjoy every moment and experience in good health.\n\nHeavenly Father, we also pray for the pilots and the entire flight crew. Grant them wisdom, skill, and discernment as they navigate and oversee our flight. Guide their actions, decisions, and judgment so that they may carry us safely and securely to our destination.\n\nMay our time in Europe be filled with joy, discovery, and enriching experiences, but above all, may it be marked by your presence and protection. Lead us to encounter friendly and helpful faces throughout our journey and bless us with memorable moments that will create lifelong memories.\n\nIn your magnificent and loving name, we pray. Amen.',NULL),
(259,'Trip to Cape Cod','openAI',NULL,'Family trip to Cape Code','Heavenly Father,\n\nWe come before you with grateful hearts, seeking your divine guidance and protection as we embark on our trip to Cape Cod with my son and my grandchildren. Lord, you are the ultimate source of safety and joy, and we trust in your unfailing love and care.\n\nWe pray for traveling mercies upon our journey. Please watch over us every step of the way, ensuring safe passage as we navigate the roads and highways. Shield us from any accidents, hazards, or unexpected obstacles that may arise. Father, be our ever-present guardian and guide.\n\nAs we reach our destination in Cape Cod, we ask for your blessing upon our time together. May this trip be filled with moments of joy, laughter, and cherished memories. Grant us good weather, so we may fully enjoy the beauty of your creation and the wonders of this coastal setting. Protect us from any harm or danger, both seen and unseen.\n\nLord, surround us with your peace and tranquility, allowing us to unwind and experience true rest. Help us to appreciate the simple pleasures of this vacation and strengthen the bond between family members. May love and unity be the foundation of our time together.\n\nLastly, Father, we acknowledge that our ultimate happiness comes from you. Even as we anticipate this trip, we remember that true joy is found in your presence. May our hearts be open to receiving your blessings and may our trip be a testimony to your grace and goodness.\n\nIn faith, we commit this journey into your hands, believing that you will protect us, guide us, and shower us with your abundant blessings. We thank you in advance for all that you will do.\n\nIn Jesus name, we pray.',1,'Heavenly Father,\n\nWe come before you with grateful hearts, seeking your divine guidance and protection as we embark on our trip to Cape Cod with my son and my grandchildren. Lord, you are the ultimate source of safety and joy, and we trust in your unfailing love and care.\n\nWe pray for traveling mercies upon our journey. Please watch over us every step of the way, ensuring safe passage as we navigate the roads and highways. Shield us from any accidents, hazards, or unexpected obstacles that may arise. Father, be our ever-present guardian and guide.\n\nAs we reach our destination in Cape Cod, we ask for your blessing upon our time together. May this trip be filled with moments of joy, laughter, and cherished memories. Grant us good weather, so we may fully enjoy the beauty of your creation and the wonders of this coastal setting. Protect us from any harm or danger, both seen and unseen.\n\nLord, surround us with your peace and tranquility, allowing us to unwind and experience true rest. Help us to appreciate the simple pleasures of this vacation and strengthen the bond between family members. May love and unity be the foundation of our time together.\n\nLastly, Father, we acknowledge that our ultimate happiness comes from you. Even as we anticipate this trip, we remember that true joy is found in your presence. May our hearts be open to receiving your blessings and may our trip be a testimony to your grace and goodness.\n\nIn faith, we commit this journey into your hands, believing that you will protect us, guide us, and shower us with your abundant blessings. We thank you in advance for all that you will do.\n\nIn Jesus name, we pray.',NULL),
(260,'Elected Leaders','newPrayer',NULL,'Prayer for elected leaders','God of all nations, Father of the human family, we give you thanks for the freedom we exercise and the many blessings of democracy we enjoy in these United States of America. We ask for your protection and guidance for all who devote themselves to the common good, working for justice and peace at home and around the world. We lift up all our duly elected leaders and public servants, those who will serve us as president, as legislators and judges, those in the military and law enforcement. Heal us from our differences and unite us, O Lord, with a common purpose, dedication, and commitment to achieve liberty and justice in the years ahead for all people, and especially those who are most vulnerable in our midst. ',1,'God of all nations, Father of the human family, we give you thanks for the freedom we exercise and the many blessings of democracy we enjoy in these United States of America. We ask for your protection and guidance for all who devote themselves to the common good, working for justice and peace at home and around the world. We lift up all our duly elected leaders and public servants, those who will serve us as president, as legislators and judges, those in the military and law enforcement. Heal us from our differences and unite us, O Lord, with a common purpose, dedication, and commitment to achieve liberty and justice in the years ahead for all people, and especially those who are most vulnerable in our midst. ',NULL),
(261,'Long covid','newPrayer',NULL,'Heal those with long covid','Dear Heavenly Father,\n\nI come before you with a heart filled with compassion and love for my dear friend who is going through the challenges of long COVID and the persistent tinnitus that accompanies it. I lift them up to you, knowing that you are the Divine Healer, and nothing is beyond Your power.\n\nLord, I pray for comfort and strength for my friend during this difficult time. May Your loving presence surround them, providing solace in moments of pain and frustration. Bring them peace and reassurance that You are with them every step of the way.\n\nI humbly ask for healing for their body, mind, and spirit. Touch the areas affected by COVID, and bring restoration to any lingering health issues. Ease the burden of tinnitus, granting moments of relief and respite from its persistent noise.\n\nIn Your infinite wisdom, guide the medical professionals who are caring for my friend. Grant them discernment and knowledge to provide the best treatments and support on the journey towards recovery.\n\nMay this period of struggle be an opportunity for spiritual growth and a deepening of faith. May my friend feel Your love, grace, and comfort in every moment, knowing that You are a God who hears and answers prayers.\n\nLord, I ask for a miracle, if it be Your will, that my friend be restored to full health and vitality. But if healing comes gradually, grant them patience and perseverance to endure and to find joy and meaning even amidst challenges.\n\nWe place our trust in You, knowing that Your plans are perfect, and Your love is unwavering. May Your healing touch be upon my friend, bringing restoration and renewal.\n\nIn the name of Jesus Christ, I pray. Amen.\n\nRemember, you are not alone in your journey, and there are many who care for you and support you. Continue to seek medical assistance, surround yourself with loved ones, and lean on your faith during these times. God bless you!',0,'Dear Heavenly Father,\n\nI come before you with a heart filled with compassion and love for my dear friend who is going through the challenges of long COVID and the persistent tinnitus that accompanies it. I lift them up to you, knowing that you are the Divine Healer, and nothing is beyond Your power.\n\nLord, I pray for comfort and strength for my friend during this difficult time. May Your loving presence surround them, providing solace in moments of pain and frustration. Bring them peace and reassurance that You are with them every step of the way.\n\nI humbly ask for healing for their body, mind, and spirit. Touch the areas affected by COVID, and bring restoration to any lingering health issues. Ease the burden of tinnitus, granting moments of relief and respite from its persistent noise.\n\nIn Your infinite wisdom, guide the medical professionals who are caring for my friend. Grant them discernment and knowledge to provide the best treatments and support on the journey towards recovery.\n\nMay this period of struggle be an opportunity for spiritual growth and a deepening of faith. May my friend feel Your love, grace, and comfort in every moment, knowing that You are a God who hears and answers prayers.\n\nLord, I ask for a miracle, if it be Your will, that my friend be restored to full health and vitality. But if healing comes gradually, grant them patience and perseverance to endure and to find joy and meaning even amidst challenges.\n\nWe place our trust in You, knowing that Your plans are perfect, and Your love is unwavering. May Your healing touch be upon my friend, bringing restoration and renewal.\n\nIn the name of Jesus Christ, I pray. Amen.\n\nRemember, you are not alone in your journey, and there are many who care for you and support you. Continue to seek medical assistance, surround yourself with loved ones, and lean on your faith during these times. God bless you!',NULL),
