(310,'custom prayer title','customPrayer',NULL,'customPrayer','Heavenly Father,\n\nWe come before You with heavy hearts, lifting up Kimberlys uncle who is now in hospice care. Lord, You are the Divine Healer and the Giver of Peace. We ask that You surround him with Your comforting presence and grant him peace and serenity in this difficult time.\n\nMay Your Holy Spirit fill him with strength, courage, and deep trust in Your infinite mercy. We pray that he feels Your loving arms around him, providing comfort and relief from any pain or fear.\n\nLord Jesus, You understand suffering and sorrow. We ask that You be especially close to Kimberlys uncle, offering him solace and the assurance of Your love. If it is Your will, we pray for healing and restoration. If his earthly journey is drawing to a close, we ask that You welcome him into Your eternal embrace, where there is no more suffering or pain.\n\nBless Kimberly and her family with Your grace and strength as they support him during this time. May they find comfort in their faith and in the promise of Your everlasting life.\n\nWe ask all this through Christ our Lord.',1,'Heavenly Father,\n\nWe come before You with heavy hearts, lifting up Kimberlys uncle who is now in hospice care. Lord, You are the Divine Healer and the Giver of Peace. We ask that You surround him with Your comforting presence and grant him peace and serenity in this difficult time.\n\nMay Your Holy Spirit fill him with strength, courage, and deep trust in Your infinite mercy. We pray that he feels Your loving arms around him, providing comfort and relief from any pain or fear.\n\nLord Jesus, You understand suffering and sorrow. We ask that You be especially close to Kimberlys uncle, offering him solace and the assurance of Your love. If it is Your will, we pray for healing and restoration. If his earthly journey is drawing to a close, we ask that You welcome him into Your eternal embrace, where there is no more suffering or pain.\n\nBless Kimberly and her family with Your grace and strength as they support him during this time. May they find comfort in their faith and in the promise of Your everlasting life.\n\nWe ask all this through Christ our Lord.',NULL),
(311,'custom prayer title','customPrayer',NULL,'customPrayer','Heavenly Father,\n\nWe come before You with hearts filled with both sorrow and hope. Today, we pray for the eternal rest of Kimberly’s uncle, who has been called to join the Angels and all the Saints in Your heavenly kingdom. Grant him, O Lord, eternal peace and let perpetual light shine upon him.\n\nMerciful God, in Your infinite love and mercy, welcome him into the joy of eternal life. May he be embraced by Your everlasting love and find rest in Your presence.\n\nComfort Kimberly and her family in their time of grief. Surround them with Your love and give them strength, knowing that their beloved uncle is now at peace with You.\n\nWe ask this through Christ our Lord.',1,'Heavenly Father,\n\nWe come before You with hearts filled with both sorrow and hope. Today, we pray for the eternal rest of Kimberly’s uncle, who has been called to join the Angels and all the Saints in Your heavenly kingdom. Grant him, O Lord, eternal peace and let perpetual light shine upon him.\n\nMerciful God, in Your infinite love and mercy, welcome him into the joy of eternal life. May he be embraced by Your everlasting love and find rest in Your presence.\n\nComfort Kimberly and her family in their time of grief. Surround them with Your love and give them strength, knowing that their beloved uncle is now at peace with You.\n\nWe ask this through Christ our Lord.',NULL),
