(321,'title','openAI',NULL,'openAI','O God, the Creator and Redeemer of all the faithful, grant to the soul of Kimberlys uncle, Your servant, the remission of all his sins; that through our devout prayers, he may obtain the pardon which he has always desired. May he experience the bliss of eternal happiness in Your heavenly kingdom, where he may forever rejoice in Your presence with all the Angels and Saints. We ask this through Christ our Lord. Amen.',1,'O God, the Creator and Redeemer of all the faithful, grant to the soul of Kimberlys uncle, Your servant, the remission of all his sins; that through our devout prayers, he may obtain the pardon which he has always desired. May he experience the bliss of eternal happiness in Your heavenly kingdom, where he may forever rejoice in Your presence with all the Angels and Saints. We ask this through Christ our Lord. Amen.',NULL),
(322,'title','openAI',NULL,'openAI','O God, who hast commanded us to honor our father and mother, have compassion in Thy mercy on the soul of my uncle, and forgive him his transgressions; grant me to profit by the intercession he makes for me, through Jesus Christ Our Lord. Amen.',1,'O God, who hast commanded us to honor our father and mother, have compassion in Thy mercy on the soul of my uncle, and forgive him his transgressions; grant me to profit by the intercession he makes for me, through Jesus Christ Our Lord. Amen.',NULL),
(323,'title','openAI',NULL,'openAI','Eternal rest grant unto him, O Lord,\nAnd let perpetual light shine upon him.\nMay he rest in peace.\n',1,'Eternal rest grant unto him, O Lord,\nAnd let perpetual light shine upon him.\nMay he rest in peace.\n',NULL),
(324,'title','openAI',NULL,'openAI','Almighty and merciful God, we place before you the soul of Kimberlys uncle who has departed from this life. May he find eternal rest and peace in your loving embrace. We pray that he may be welcomed into the company of the Angels and all Saints in heaven. Grant him forgiveness for his sins and bring him to the everlasting joy of your presence. Comfort Kimberly and her family in their grief and fill their hearts with the hope of your promise of resurrection. We ask this through Christ our Lord. Amen.',1,'Almighty and merciful God, we place before you the soul of Kimberlys uncle who has departed from this life. May he find eternal rest and peace in your loving embrace. We pray that he may be welcomed into the company of the Angels and all Saints in heaven. Grant him forgiveness for his sins and bring him to the everlasting joy of your presence. Comfort Kimberly and her family in their grief and fill their hearts with the hope of your promise of resurrection. We ask this through Christ our Lord. Amen.',NULL),
(325,'title','openAI',NULL,'openAI','Dear Heavenly Father,\n\nWe lift up Uncle Antoine in Lebanon to you, as he prepares for surgery at the age of 90. We ask for your guidance and protection during this time and pray for a successful outcome. May your healing hand be upon him, and may he be surrounded by your peace and comfort throughout the procedure and recovery. Grant him strength and courage as he faces this challenge, and may he feel Your presence and love in a special way during this time.\n\nWe ask all of this in the name of your Son, Jesus Christ. Amen. \n\nOur Lady of Lebanon, pray for us. St. Charbel, pray for us. Amen.',1,'Dear Heavenly Father,\n\nWe lift up Uncle Antoine in Lebanon to you, as he prepares for surgery at the age of 90. We ask for your guidance and protection during this time and pray for a successful outcome. May your healing hand be upon him, and may he be surrounded by your peace and comfort throughout the procedure and recovery. Grant him strength and courage as he faces this challenge, and may he feel Your presence and love in a special way during this time.\n\nWe ask all of this in the name of your Son, Jesus Christ. Amen. \n\nOur Lady of Lebanon, pray for us. St. Charbel, pray for us. Amen.',NULL),
(326,'title','openAI',NULL,'openAI','Heavenly Father, we lift up Mike Geoghan and his family to you during this difficult time. We pray for a successful surgery and a speedy recovery for Mike. Grant him strength and healing, and surround his family with your love and comfort. May they find peace and solace in your presence. We ask for your divine intervention and guidance as Mike continues his journey towards health and wholeness.',1,'Heavenly Father, we lift up Mike Geoghan and his family to you during this difficult time. We pray for a successful surgery and a speedy recovery for Mike. Grant him strength and healing, and surround his family with your love and comfort. May they find peace and solace in your presence. We ask for your divine intervention and guidance as Mike continues his journey towards health and wholeness.',NULL),
(327,'title','openAI',NULL,'openAI','Heavenly Father, I come to you today to pray for this teen who is being influenced by the pursuit of material wealth and losing sight of the important things in life. Help them to see that true happiness and fulfillment come from serving others and living a life of love and compassion. May they be guided back to a path of spiritual growth and connection to you, and may they learn to value the things that truly matter in life. Amen.',1,'Heavenly Father, I come to you today to pray for this teen who is being influenced by the pursuit of material wealth and losing sight of the important things in life. Help them to see that true happiness and fulfillment come from serving others and living a life of love and compassion. May they be guided back to a path of spiritual growth and connection to you, and may they learn to value the things that truly matter in life. Amen.',NULL),
(328,'title','openAI',NULL,'openAI','Dear Heavenly Father,\n\nWe lift up to you {{name}}\'s dear husband who is recovering from a heart attack. We ask for your healing touch to be upon him, strengthening his body and giving him the courage and endurance to face each day of his recovery journey. Grant him comfort in his pain and anxiety, and surround him with your loving presence and peace.\n\nWe also pray for his medical team, guiding them in their decisions and treatments, and giving them the wisdom and skill to care for him with compassion and excellence.\n\nMay {{name}}\'s husband feel the support and love of all who are praying for him, and may he know that he is never alone in this battle. Give him hope and assurance that your grace and mercy are always with him.\n\nWe entrust him into your loving hands, knowing that you are the ultimate healer and source of all comfort. May your will be done in his life, and may he experience your blessing and restoration in body, mind, and spirit.\n\nIn Jesus name, we pray.',1,'Dear Heavenly Father,\n\nWe lift up to you my dear husband who is recovering from a heart attack. I ask for your healing touch to be upon him, strengthening his body and giving him the courage and endurance to face each day of his recovery journey. Grant him comfort in his pain and anxiety, and surround him with your loving presence and peace.\n\nI also pray for his medical team, guiding them in their decisions and treatments, and giving them the wisdom and skill to care for him with compassion and excellence.\n\nMay my husband feel the support and love of all who are praying for him, and may he know that he is never alone in this battle. Give him hope and assurance that your grace and mercy are always with him.\n\nI entrust him into your loving hands, knowing that you are the ultimate healer and source of all comfort. May your will be done in his life, and may he experience your blessing and restoration in body, mind, and spirit.\n\nIn Jesus name, I pray.',NULL),
(329,'title','openAI',NULL,'openAI','Heavenly Father, \n\nWe come before you with a grateful heart for the precious gift of {{name}}\'s three children and two grandchildren. Thank you for blessing him with the joy and love they bring into his life. \n\nWe entrust them into Your loving care and protection, asking that You watch over them always. Keep them safe from harm and guide them on the path of righteousness. May Your grace and love surround them every day. \nWe pray for their health, happiness, and well-being, and we ask for Your wisdom and guidance as {{name}} raises them to know and love You. \n\nThank you, Lord, for the blessing of family.',1,'Heavenly Father, \nI come before you with a grateful heart for the precious gift of my three children and two grandchildren. Thank you for blessing me with the joy and love they bring into my life. \nI entrust them into Your loving care and protection, asking that You watch over them always. Keep them safe from harm and guide them on the path of righteousness. May Your grace and love surround them every day. \nI pray for their health, happiness, and well-being, and I ask for Your wisdom and guidance as I raise them to know and love You. \nThank you, Lord, for the blessing of family. ',NULL),
(330,'title','openAI',NULL,'openAI','O God, our heavenly Father, we come before you with hearts heavy with sadness and concern for the people of Lebanon and the State of Israel. We pray for an end to the violence and conflicts that have plagued these lands for far too long. Grant peace to those who are suffering, comfort to those who are grieving, and strength to those who are working for reconciliation. May your love and mercy bring healing and unity to all who are divided. We ask this in the name of your Son, Jesus Christ, our Lord.',1,'O God, our heavenly Father, we come before you with hearts heavy with sadness and concern for the people of Lebanon and the State of Israel. We pray for an end to the violence and conflicts that have plagued these lands for far too long. Grant peace to those who are suffering, comfort to those who are grieving, and strength to those who are working for reconciliation. May your love and mercy bring healing and unity to all who are divided. We ask this in the name of your Son, Jesus Christ, our Lord.',NULL),
(331,'title','openAI',NULL,'openAI','Hail Mary, full of grace, the Lord is with thee. Blessed art thou amongst women, and blessed is the fruit of thy womb, Jesus. Holy Mary, Mother of God, pray for us sinners, now and at the hour of our death. Amen.\n\nDear Lord, we come to you in prayer for our beloved Amo Wajih who has passed away. We ask that you watch over his children Yasmeen and Jad, and his wife Denise, and grant them strength and comfort during this difficult time. Surround them with your love and peace as they navigate their grief and loss. May they find solace in the memories of their loved one and in the knowledge that Amo Wajih is now with you, in your loving embrace. We place our trust in you, Lord, and ask for your guidance and grace in their healing process.',1,'Hail Mary, full of grace, the Lord is with thee. Blessed art thou amongst women, and blessed is the fruit of thy womb, Jesus. Holy Mary, Mother of God, pray for us sinners, now and at the hour of our death. Amen.\n\nDear Lord, we come to you in prayer for our beloved Amo Wajih who has passed away. We ask that you watch over his children Yasmeen and Jar, and his wife Denise, and grant them strength and comfort during this difficult time. Surround them with your love and peace as they navigate their grief and loss. May they find solace in the memories of their loved one and in the knowledge that Amo Wajih is now with you, in your loving embrace. We place our trust in you, Lord, and ask for your guidance and grace in their healing process.',NULL),
(332,'title','openAI',NULL,'openAI','Heavenly Father, I come to you with a heavy heart and a request for healing. I ask for your divine intervention and guidance as I battle against cancer. Please grant me the strength, courage, and endurance to continue fighting this disease with unwavering faith. I entrust myself into your loving hands, knowing that you are the ultimate healer and provider of miracles. I believe in your power to cure me and ask for your grace and blessings to help me overcome this trial. Amen.',1,'Heavenly Father, I come to you with a heavy heart and a request for healing. I ask for your divine intervention and guidance as I battle against cancer. Please grant me the strength, courage, and endurance to continue fighting this disease with unwavering faith. I entrust myself into your loving hands, knowing that you are the ultimate healer and provider of miracles. I believe in your power to cure me and ask for your grace and blessings to help me overcome this trial. Amen.',NULL),
(333,'title','openAI',NULL,'openAI','Dear Heavenly Father,\n\nWe come before you with grateful hearts, thanking you for the gift of our children and the privilege of education. As our kids begin a new school year, we ask for your divine protection and guidance to be with them every step of the way.\n\nGrant them wisdom to learn, courage to face challenges, strength to overcome obstacles, and perseverance to never give up. May they be blessed with teachers who inspire them, classmates who support them, and opportunities to grow in knowledge and faith.\n\nHelp them to stay focused, motivated, and disciplined in their studies. Give them a love for learning and a desire to reach their full potential. And most importantly, fill their hearts with your love, joy, and peace so they may shine as beacons of your light in the world.\n\nWe entrust our children into your loving care, knowing that you will always watch over them and lead them on the path of righteousness. May this new school year be a time of growth, transformation, and blessings for our kids.\n\nIn the name of Jesus Christ, our Lord and Savior, we pray.\n\nAmen.',1,'Dear Heavenly Father,\n\nWe come before you with grateful hearts, thanking you for the gift of our children and the privilege of education. As our kids begin a new school year, we ask for your divine protection and guidance to be with them every step of the way.\n\nGrant them wisdom to learn, courage to face challenges, strength to overcome obstacles, and perseverance to never give up. May they be blessed with teachers who inspire them, classmates who support them, and opportunities to grow in knowledge and faith.\n\nHelp them to stay focused, motivated, and disciplined in their studies. Give them a love for learning and a desire to reach their full potential. And most importantly, fill their hearts with your love, joy, and peace so they may shine as beacons of your light in the world.\n\nWe entrust our children into your loving care, knowing that you will always watch over them and lead them on the path of righteousness. May this new school year be a time of growth, transformation, and blessings for our kids.\n\nIn the name of Jesus Christ, our Lord and Savior, we pray.\n\nAmen.',NULL),
(334,'title','openAI',NULL,'openAI','Heavenly Father,\n\nWe come to you today with a heavy heart, asking for your grace and healing for our friend who is recovering from surgery. We pray that you would touch their body with your healing hand, bringing them comfort and strength in this time of need.\n\nGrant them a quick and smooth recovery, Lord, and surround them with your love and peace as they navigate this journey back to health. Give them courage and hope as they face each day, and fill them with the assurance of your presence and care.\n\nWe also pray for their doctors and healthcare providers, that you would guide their hands and minds as they work to restore our friend to full health. May they be instruments of your healing grace, bringing relief and restoration to our dear one.\n\nIn your mercy and kindness, Lord, hear our prayer and grant our friend a speedy and complete recovery. We place our trust and hope in you, knowing that you are the ultimate source of healing and wholeness.\n\nAmen.',1,'Heavenly Father,\n\nWe come to you today with a heavy heart, asking for your grace and healing for our friend who is recovering from surgery. We pray that you would touch their body with your healing hand, bringing them comfort and strength in this time of need.\n\nGrant them a quick and smooth recovery, Lord, and surround them with your love and peace as they navigate this journey back to health. Give them courage and hope as they face each day, and fill them with the assurance of your presence and care.\n\nWe also pray for their doctors and healthcare providers, that you would guide their hands and minds as they work to restore our friend to full health. May they be instruments of your healing grace, bringing relief and restoration to our dear one.\n\nIn your mercy and kindness, Lord, hear our prayer and grant our friend a speedy and complete recovery. We place our trust and hope in you, knowing that you are the ultimate source of healing and wholeness.\n\nAmen.',NULL),
(335,'title','openAI',NULL,'openAI','\"O Lord, we lift up our friend who is recovering from surgery into your loving and healing hands. Grant them strength and comfort during this time of recovery. We pray that you guide the hands of their healthcare providers and grant them a speedy and smooth recovery. May your grace and love surround them, giving them peace and confidence in their healing process. Amen.\"',1,'\"O Lord, we lift up our friend who is recovering from surgery into your loving and healing hands. Grant them strength and comfort during this time of recovery. We pray that you guide the hands of their healthcare providers and grant them a speedy and smooth recovery. May your grace and love surround them, giving them peace and confidence in their healing process. Amen.\"',NULL),
(336,'title','openAI',NULL,'openAI','Heavenly Father,\n\nWe come to you with heavy hearts, asking for your strength and comfort to be with our beloved family member who is battling a chronic illness. Help them to endure their suffering with grace and courage, knowing that you are always by their side.\n\nGrant them the strength to face each day with determination and hope, knowing that you will never leave them nor forsake them. Surround them with your love and peace, so that they may find solace in your presence.\n\nMay they feel your healing touch upon them, bringing them relief from their pain and comfort in their distress. Give them the courage to trust in your plan for their life, knowing that you work all things for the good of those who love you.\n\nWe also ask for strength and comfort for their caregivers and loved ones, that they may be sustained in their support and care for their family member. Grant them patience, compassion and endurance as they walk alongside their loved one in this difficult journey.\n\nWe place our trust in you, O Lord, knowing that you are our refuge and strength in times of trouble. May your healing power bring comfort and relief to our dear family member, and may your love surround them always.\n\nWe ask all this in the name of Jesus, our Lord.\n\nAmen.',1,'Heavenly Father,\n\nWe come to you with heavy hearts, asking for your strength and comfort to be with our beloved family member who is battling a chronic illness. Help them to endure their suffering with grace and courage, knowing that you are always by their side.\n\nGrant them the strength to face each day with determination and hope, knowing that you will never leave them nor forsake them. Surround them with your love and peace, so that they may find solace in your presence.\n\nMay they feel your healing touch upon them, bringing them relief from their pain and comfort in their distress. Give them the courage to trust in your plan for their life, knowing that you work all things for the good of those who love you.\n\nWe also ask for strength and comfort for their caregivers and loved ones, that they may be sustained in their support and care for their family member. Grant them patience, compassion and endurance as they walk alongside their loved one in this difficult journey.\n\nWe place our trust in you, O Lord, knowing that you are our refuge and strength in times of trouble. May your healing power bring comfort and relief to our dear family member, and may your love surround them always.\n\nWe ask all this in the name of Jesus, our Lord.\n\nAmen.',NULL),
