l and Palestine, for all those who have been affected by this conflict. Comfort them in their grief and pain, and bring healing and restoration to their land.\n\nWe trust in your power to bring about a just and lasting peace in the Holy Land. May your will be done on earth as it is in heaven. Amen.',NULL),
